1	content	<div>The fellowship I found in A.A. enabled me to face my problem honestly and squarely. I couldn’t do it among my relatives; I couldn’t do it among my friends. No one likes to admit that they’re a drunk, that they can’t control this thing. But when we come into A.A., we can face our problem honestly and openly. I went to closed meetings and open meetings. And I took everything that A.A. had to give me. Easy does it, first things first, one day at a time. It was at that point that I reached surrender. I heard one very ill woman say that she didn’t believe in the surrender part of the A.A. program. My heavens! Surrender to me has meant the ability to run my home, to face my responsibilities as they should be faced, to take life as it comes to me day by day and work my problems out. That’s what surrender has meant to me. I surrendered once to the bottle, and I couldn’t do these things. Since I gave my will over to A.A., whatever A.A. has wanted of me I’ve tried to do to the best of my ability. When I’m asked to go out on a call, I go. I’m not going; A.A. is leading me there. A.A. gives us alcoholics direction into a way of life without the need for alcohol. That life for me is lived one day at a time, letting the problems of the future rest with the future. When the time comes to solve them, God will give me strength for that day. </div>	Reading	1	2023-10-26 00:45:28.911097	2023-10-26 00:45:28.911097
2	topic	<div><br></div><ul><li> How has the fellowship of AA changed your sobriety? </li><li> What are some of your favorite sayings from the rooms?  </li></ul><div><br></div>	Reading	1	2023-10-26 00:45:28.91781	2023-10-26 00:45:28.91781
3	content	<div><strong> Let’s look at Sam’s experience: </strong><br><br></div><div>I have learned from experience that staying abstinent, working the Program, and attending meetings through painful times is a guarantee of personality change. We no longer have to escape our pain through using. The Program has given us a previous tool—humility—which, used regularly, will transform pain into growth. Armed with humility, we who once dreaded change as much as death can learn to face real life with a new courage and hope. <br><br></div><div>Before I entered the fellowship, I lived in a fantasy world of my own creation. I attempted to control not only effort but outcomes of situations. I tried to keep myself calm with chemicals and food, with no recognition for the ups and downs of daily living. I was seeking an unreal world of complete security, romance, and approval, and the more I tried to control (demand) these things, the more chaos I created. It becomes clear to us in getting sober that we have to change. I like what Bill W. has to say about these rude awakenings in this passage from the Twelve and Twelve: <br><br></div><div>And as we grow spiritually, we find that our old attitudes toward our instincts need to undergo drastic revisions. Our desires for emotional security and wealth, for personal prestige and power, for romance, and for family satisfactions—all these have to be tempered and redirected. We have learned that the satisfaction of instincts cannot be the sole end and aim of our lives. If we place instincts first, we have got the cart before the horse; we shall be pulled backward into disillusionment. But when we are willing to place spiritual growth first—then and only then do we have a real chance. (page 114) <br><br></div><div>Humility seems to be the basic ingredient for transforming pain into growth. In Step Seven of the Twelve and Twelve, humility is defined as the “perspective to see that character building and spiritual values have to come first, and that material satisfactions are not the purpose of living.” We learn that an honest desire to seek and do God’s will is necessary for humility. <br><br></div><div>“What an order. I can’t go through with it,” used to be my initial reaction to growing through the Steps. I could accept solutions intellectually, but when it came to practical application, I had trouble. I know today that I don’t have to do it perfectly; it takes time to get better. I know that I don’t have to do it alone, that I have a wealth of wisdom and support in this fellowship at my disposal, and that gives me hope for change, growth, and new frontiers. </div><div><br></div>	Reading	2	2023-10-26 00:47:18.580541	2023-10-26 00:47:18.580541
4	topic	<ul><li> What role does humility play in your recovery? </li><li> How have your priorities changed through your journey in sobriety? </li><li> Describe an instance where your unrealistic pursuit of control got you into trouble. </li></ul><div><br></div>	Reading	2	2023-10-26 00:47:18.584263	2023-10-26 00:47:18.584263
5	content	<div> You may be familiar with some version of the Drop the Rock parable. It’s about the Twelve Step group members who set sail on the ship Recovery across the sea of Life for the island of Serenity. As the parable is usually told, soon after the boat pulls away from the dock, the passengers realize that some of their friends are not yet on board. <br><br></div><div> Sure enough, their friend Mary comes running down the street and onto the dock. The people on the boat cheer her on. “Dive in and swim, Mary!” they shout. “You can do it!” Mary dives into the water and swims for the boat as fast and hard as she can. But as she gets close to the boat, she slows and struggles to stay afloat. Everyone on board can see why: a heavy rock is hanging from a snarl of strings around Mary’s neck. “Drop the rock!” they all shout. “Let go! Drop the rock!” <br><br></div><div> Treading water, Mary looks down at the rock. She realizes it contains her fear, resentments, self-pity, anger, intolerance, resentments, and other character flaws. She also realizes that if she doesn’t let go of them, she will drown. <br><br></div><div> She tears off the strings, holds the rock away from her body, and lets it go. <br><br></div><div> Freed of the heavy and useless weight, Mary easily swims the rest of the way to the boat. She climbs aboard, dripping and deeply relieved. When most people tell this story, this is where they stop. That’s understandable, because that part alone is useful and instructive. <br><br></div><div> But here’s how that parable might continue: As Mary is drying off, she notices something heavy in her pants pocket. She reaches in and discovers another rock, although much smaller than the one she’d just released. She recognizes this as her character defect of self-centeredness and immediately tosses it into the water. <br><br></div><div> As everyone congratulates Mary, they look back toward shore. Someone else is in the water, swimming desperately toward the boat. But that person, too, is being pulled underwater after every few strokes. As the swimmer gets closer to the boat, Mary can see that it’s Ramon, her old friend and—before they went through treatment together—drinking buddy. <br><br></div><div> Mary runs to the rail, leans over, and shouts, “Hey, Ramon, it’s me, Mary! Drop the rock! Can you see the ripples from the rocks I just dropped? We don’t have to carry around our character defects any more. If I can do it, you can!” <br><br></div><div> As the ripples from Mary’s rocks reach Ramon, he pulls the strings off his shoulders and raises his hand above his head in a thumbs-up. <br><br></div><div> “You’re almost there!” Mary shouts. <br><br></div><div> “I’m coming!” Ramon shouts back. <br><br></div><div> He dives under the ripples and disappears. Half a minute later, his head pops out of the water, only thirty feet from the boat. <br><br></div><div> He disappears beneath the water again. Everyone on board watches breathlessly. <br><br></div><div> Then suddenly Ramon appears next to the boat, just below Mary. He gasps, “Help me in!” <br><br></div><div> Mary leans over, stretches out her arm, and pulls Ramon aboard. </div><div><br></div>	Reading	3	2023-10-26 00:48:52.014974	2023-10-26 00:48:52.014974
6	topic	<ul><li> What lessons can we draw from the "Drop the Rock" parable in the context of recovery and growth? </li><li> What does the extended part of the parable with Mary and Ramon represent in terms of recovery and mutual support? </li><li> How have you experienced the power of letting go in your recovery journey, and what did it lead to? </li></ul><div><br></div>	Reading	3	2023-10-26 00:48:52.018753	2023-10-26 00:48:52.018753
7	content	<div>The Big Book doesn’t teach us hundreds of different things; it teaches us a small number of things hundreds of times. And those few things are presented in a sequence. When most of us began working the Steps, we saw them as simply a list, much like the Ten Commandments. Now, however, we understand that the <em>specific sequence of the Twelve Steps is the transformative element of the Program. </em>The Twelve Steps are a unified, interdependent whole, not a collection of twelve separate items. Each Step requires and builds on <em>all</em> of the earlier Steps.<br><br>As the Big Book explains on page xxii, the Twelve Steps <em>trace exactly the same path to recovery that was blazed by the earliest members of Alcoholics Anonymous.</em> That paragraph also makes clear that <em>The Twelve Steps . . . summarize the program.<br></em><br>Step One is the truth about the problem: it gets our attention and gives meaning to our struggle. Step Two is the truth about the solution, based on the truth about the problem. Step Three is the truth about what blocks us from experiencing a solution. Steps Four through Nine get us unblocked. Steps Ten through Twelve keep us unblocked. Or, to put it another way: Step One is where we were. Step Two is where we wanted to be. Steps Three through Nine are how we get well. And Steps Ten through Twelve are how we stay well.<br><br>As old-timers Joe and Charlie pointed out in their workshops and in their book <em>A Program for You</em>, the Big Book is organized in a very deliberate sequence. Because it is a textbook for recovery, it is meant to be read and studied in that sequence. And that sequence begins this way: <em>We have a problem. The problem defines the solution. And there are prescribed actions that can bring about a solution.<br></em><br>Most of us in recovery know a number of Twelve Step slogans, such as “First Things First,” “Easy Does It,” and “It Works if You Work It.” Each of these can be helpful and inspiring at various points in our recovery. But we get the most benefit from them as guideposts to a new way of life in the context of this simple three-part template of <em>problem, solution, and program of action provided by the Twelve Steps.</em><br><br>If we practice each of the Steps as an individual strategy, they may give us some benefit and relief. But for them to become an unshakable foundation for living, the Steps must be practiced in the order in which they were written and <em>lived into</em> over a lifetime.</div>	Reading	4	2023-10-26 02:16:18.998685	2023-10-26 02:16:18.998685
