9	content	<div>Last year I fulfilled a dream I’ve had since I was a boy—I began singing in an Anglican choir. For eight months, it was one of the most fulfilling things I’d ever done.<br><br>I live out in the country, and my church is in the city, about forty-five miles away. This meant driving ninety miles on Wednesday nights and Saturday afternoons for rehearsals—and, of course, on Sunday mornings and high holidays.<br><br>I’ve been in recovery over eleven years. I know that I’m still powerless over alcohol, but I no longer want to drink. Alcohol and a self-centered life nearly destroyed me and my family. I go to two meetings a week and haven’t missed one in years.<br><br>But I did miss a Wednesday night choir rehearsal. I came down with a stomach bug, so I called the choir director and she agreed that the best thing was for me to stay home.<br><br>I went to Saturday rehearsal as usual, but on Sunday our car didn’t start, so I missed church. Then, three days later, our water heater sprang a serious leak a few minutes before it was time to leave for the city. By the time I had everything cleaned up, I knew I’d arrive shortly before rehearsal ended, so I stayed home.<br><br>After that, my momentum was gone. When Saturday morning came, I was surprisingly resistant. All I could think about was the ninety-mile trip and how long and tedious it would be. I <em>really </em>didn’t want to go—even though I still really enjoyed singing. I found myself thinking, <em>Maybe I should quit the choir.</em><br><br>Something about that thought made me stop and examine it. Its tone was vaguely familiar. After a minute or two, I recognized the voice. It was a voice I hadn’t heard in years. It was the voice that had said, early in my recovery, <em>Maybe you should quit the Program. Go have a drink instead.</em><br><br>That’s when I realized that sustained momentum is part of what drives recovery. And Step Ten is partly about sustaining momentum. I threw myself into the car and started driving to church.<br><br>I made sure to get to every one of the next several rehearsals, and kept checking myself daily to see if my momentum had returned. It took a few weeks, but eventually it did. I thank God that, over the last eleven years, I never lost my momentum in going to meetings or practicing the Steps.</div>	Reading	5	2023-11-02 02:42:00.412232	2023-11-02 02:42:00.412232
10	topic	<ul><li> Have you ever faced moments of resistance or temptation in your recovery journey, similar to Larry's early experience of wanting to quit the program? </li><li> In what ways does Step Ten play a role in the concept of keeping momentum in your recovery? </li></ul>	Reading	5	2023-11-02 02:42:00.427081	2023-11-02 02:42:00.427081
11	content	<div>As beloved AA speaker Chuck C. has observed, when we first began working the Program, we thought that alcohol (or drugs, or overeating, or whatever) was our problem, because we have a body that can’t tolerate it, coupled with a mind that can’t leave it alone.<br><br>But when we first used alcohol, it wasn’t a problem for us—it was an answer. That’s why we drank—or shot up, or overate, or gambled away our savings. This means that our foundational problem existed before we began drinking or drugging or overeating.<br><br>By the time we reach Step Ten, we clearly understand what that foundational problem is: <em>overreliance on self.</em> That was our single biggest character defect, and for much or our life, it blocked us from having a spiritual experience.<br><br>I smile when I hear people refer to the Twelve Steps as a self-help program, because it’s exactly the opposite. Our “selves” need help.<em> The Twelve Steps teach us how and when to ask for help from a Higher Power</em>— not how to rely more on the self and self-centeredness.<br><br>When we reach Step Ten, we are no longer drinking or using or overeating. But something much greater has also occurred: we’ve sobered up to our humanness—to our limitations. We’ve also sobered up to our need to grow and serve on an ongoing basis. We know that we cannot simply settle for chemical relief. We know that if chemical relief is all we focus on, we have taken the first step toward relapse.<br><br>As we work Step Ten, we also come to understand some subtle aspects of the Program that are not generally visible to newcomers. Our attitude toward the Steps has shifted—and continues to shift—in profound ways. Let’s look closely at some of these shifts.</div>	Reading	6	2023-11-09 00:03:29.822804	2023-11-09 00:03:29.822804
17	content	<div>This story involves me and a former boss, who I’ll call Evelyn. This took place when she was new to the job and wanted to make some changes. Many of these were good changes. But Evelyn also wanted to change how the duties of my job were configured. This surprised me, because I’d always gotten good performance reviews from Wally, my previous boss, and good to great evaluations from the people I worked with. It seemed to me that Evelyn was trying to fix something that wasn’t broken. Worse, it looked to me like her proposed changes would make me less effective—and less happy in my job, because they would give me far less flexibility.<br><br>I asked to meet with Evelyn, and I explained to her exactly what I just explained to you. She listened and then said, “I understand. The thing is, Louis, you only get to see the people you work with. You don’t get to see the bigger picture. Seeing that is my job. I understand that the changes will have some negative effects on you. But they’ll support larger positive changes for the organization as a whole. You’ll lose some flexibility, but our customers will gain in consistency and reliability.”<br><br>Despite my decades of recovery, I responded entirely out of self-interest—quickly and mindlessly. I said, “Why do I have to be the sacrificial lamb?” Which was, of course, wildly overstating my potential loss and pain. A better question would have been, <em>Can we try to find some ways to create that consistency and reliability that will have less of a negative impact on me?</em><br><br>I don’t recall my posture or body language at that moment. But I’m sure my tone of voice was tense, if not outright angry— and I was definitely rippling out unpleasant energy.<br><br>Evelyn felt it. She frowned and said, “I don’t need you to be Jesus on the cross. I <em>do</em> need you to be a team player. That’s part of your job description.”<br><br>This was now officially an argument. I said to her angrily, “I’ve always been a team player.”<br><br>She nodded and said, “I know you have. That’s one of the reasons you continue to work here. Now please <em>stay </em>a team player.” She stood up and said, “Louis, this discussion is over.”<br><br>I walked back to my office. I was seething. Mindlessly, self-centeredly, indulgently seething.<br><br>At that moment, I was powerless over my anger and my sense of betrayal. I had also completely lost perspective. Evelyn was asking me to take a real but relatively small hit—to make my schedule more rigid, and to make my life a little more difficult. But at the time I felt like I’d been gut-punched. It didn’t occur to me at all to ask for spiritual direction, or to ask my Higher Power to remove my anger and self-righteousness.<br><br>Over the next few days, Evelyn and I had two more tense conversations on the subject. As I thought about the changes she wanted to implement, I couldn’t see how they benefited anyone— not our customers, not our organization, and not any of the people who worked for it. She seemed to be adding regimentation entirely for its own sake—or maybe just to please herself. At one point I even said as much to her. She responded by shaking her head and saying, “Now I know why Wally resigned.”<br><br>Then I got a call from <em>her </em>boss, LeShaun. Evelyn had gone to him and asked him to intervene. She was as frustrated as I was. To her great credit, she didn’t just fire me—although, at the time, I half expected her to.<br><br>LeShaun suggested that the three of us meet in his office a few days later. I agreed.<br><br>During those few days, I happened to reread one of my favorite passages from Emmet Fox’s book <em>The Sermon on the Mount:</em><br><br><br></div><blockquote>If, when someone is behaving badly, instead of thinking of the trouble, you will immediately switch your attention off from the human to the Divine, and concentrate upon God, or upon the Real Spiritual Self of the person in question, you will find —if you really do this—that his conduct will immediately change. This is the secret of handling difficult people. . . . If people are troublesome, you have only to change your thought about them, and then they will change too . . .</blockquote><div><br><br>That knocked some sense back into me. I realized what I’d been doing, and I vowed to show up in LeShaun’s office giving off very different ripples. I told myself I’d follow Fox’s suggestion as closely as I could.<br><br>When I got to LeShaun’s office, Evelyn was already there. I took a deep breath, mentally asked for spiritual direction, and walked in.<br><br>From the beginning, LeShaun treated the two of us as colleagues who weren’t getting along, not as boss and subordinate. That helped me—and, presumably, Evelyn—feel safe.<br><br>First LeShaun asked Evelyn to explain the situation from her viewpoint. She did, laying out her case clearly and a bit forcefully, but not unfairly. As she spoke, I mentally held her in the purest light of her true spiritual nature. I kept silent and simply sat there—relaxed, attentive, and open.<br><br>When she was done, LeShaun asked me to tell my own story. So I did—calmly and straightforwardly, without trying to argue my case or control the outcome, and without getting upset. Throughout it all, I mentally held Evelyn in a kind of spiritual halo. <br><br>LeShaun looked thoughtful. He asked each of us one or two follow-up questions. Then he leaned forward and said, “Sitting with me in my office are two caring, committed employees who want the best for this enterprise and for the people it serves. While it sounds like the two of you developed some heat under your collars, it’s also clear to me that your disagreement is over how to best be of service. It’s not about turf or personalities. I thank you both for that.”<br><br>Then he offered a solution—a brilliant solution, really—that allowed me to keep 90 percent of my flexibility while also giving Evelyn the continuity and standardization she felt were so important. Plus, it was better for our customers than either the status quo or Evelyn’s proposed changes. It was also an idea I would never have come up with on my own.<br><br>Then LeShaun said, “Now, if I’ve heard you both correctly, that should settle your dispute. Does it?” He looked at each of us. Evelyn and I said “Yes” at the same moment.<br><br>LeShaun nodded. “Are there any other outstanding issues that the three of us need to discuss?”<br><br>Evelyn and I looked at each other. We both shook our heads. A minute later, Evelyn and I were walking back to our offices together, chatting pleasantly.<br><br>It would have been very easy for me to have brought our little war—and my angry, self-protective ripples—into LeShaun’s office. To this day I’m grateful that, instead, I let myself radiate a calm, open presence; told my story simply and straightforwardly; and otherwise kept my damn mouth shut. I’m also grateful that I asked for spiritual guidance instead of trying to wrest control of the situation.<br><br>This was an important lesson for me because I can easily get on my high horse about being right.<br><br>And here’s a postscript: Evelyn turned out to be a pretty good boss—in some ways, better than Wally.</div>	Reading	9	2023-11-30 03:37:52.791456	2023-11-30 03:37:52.791456
12	topic	<ul><li> What is the true nature of the program in relation to self-reliance and self-centeredness? </li><li> How has your higher power helped you work through your character defects?</li><li> What transformation(s) have you made progress through the Twelve Steps by reaching Step Ten? </li></ul>	Reading	6	2023-11-09 00:03:29.835651	2023-11-09 03:46:10.177637
13	content	<div>As we work Step Ten and it becomes integrated into our life, we let go of trying to control the world—or other people.<br><br>We see that our former strategies of demanding, dominating, manipulating, wheedling, flattering, and people pleasing were all forms of overreliance on self. We also come to see that these strategies were the source of most of our (and anyone’s) defective interactions.<br><br>Now, as we practice Step Ten, we stop looking to others to fulfill us. Instead, we focus on how we can be of service—while also noticing and acknowledging our own needs.<br><br>Being of service doesn’t mean becoming a doormat. It’s exactly the opposite. We learn to become assertive instead of aggressive or dependent. Instead of trying to get others to do what we want, we do whatever is compassionate, or just, or most appropriate for the situation.<br><br>We also speak the truth about who we are and what we’re feeling. We learn what our real needs are, and we learn to express them clearly and directly, without trying to manipulate others into fulfilling them. We understand that assertiveness is our perfect right—as well as the antidote to the demands we used to make of others.<br><br>We are also aware that we can never know exactly how others will respond. When we express ourselves and our needs clearly and directly, they might happily accommodate us. Or they might say “Not gonna happen” or “Not interested” or “Screw you for asking” or even “Screw you for needing that.”<br><br>Throughout my drinking years and during the first few years of my recovery, I was a compulsive people pleaser. I would do whatever I felt would make others happy and comfortable, in the hope that they would think favorably of me. This was one of my biggest character defects. It was also a subtle form of domination, because I was trying to get everybody else to do my bidding. Through my people pleasing, I demanded that others meet a need in me, which was to be liked. <em>I was focused on myself, and I compulsively tried to get others to focus on me as well.</em><br><br>Bill W. had the very same character defect. In his 1958 <em>Grapevine </em>article “The Next Frontier: Emotional Sobriety,” he observed that his own painful dependencies caused him to demand that other people in AA meet his needs. Repeatedly, he tried to get others to do his bidding and depend upon him. Eventually he recognized that he lacked <em>emotional sobriety.</em> From an emotional standpoint, he was still acting like an addict.<br><br>During those years when I too lacked emotional sobriety, I radiated an essence of neediness and unsteadiness that blocked me from having a spiritual experience. Now imagine the essence you radiate when you simply show up as yourself in a spirit of compassion and service, and let other people know exactly who you are and what you feel.<br><br>Over time, as we work Step Ten, one of the things that changes is the essence of what we radiate. Some people call it a vibe or an intangible influence. This is the energy behind the Ripple Effect.</div>	Reading	7	2023-11-16 01:58:55.526414	2023-11-16 01:58:55.526414
14	topic	<ul><li>How does people-pleasing relate to character defects and emotional sobriety in recovery? </li><li>How does doing Step Ten change the way people come across or the vibe they give off?<br><br></li></ul>	Reading	7	2023-11-16 01:58:55.540482	2023-11-16 01:58:55.540482
15	content	<div>As part of working Step Ten, we learn to pay attention to our emotions as they arise in each new moment.<br><br>When used properly, our emotions help us stay alive and healthy. Fear keeps us safe. Guilt prevents us from repeating a harmful action. Awe keeps us humble and grateful. In a balanced life, our emotions serve as valuable and faithful indicators of how we’re living and how we’re using our free will. They often also point to what we’re planning to do next—and, sometimes, to what we need to do instead.<br><br>Before we began working the Steps, we viewed our emotions as a posse of friends and a group of enemies. Our life consisted mostly of wanting to experience pleasant emotions and avoid unpleasant ones.<br><br>Now, however, we realize that this was a hallmark of our lack of emotional sobriety. We also understand that simply trying to feel good is a road that leads to relapse. In working Step Ten, we let go of the distinction of <em>pleasant </em>and <em>unpleasant</em>, and instead we focus on whether an emotion points toward a <em>sustainable </em>or <em>unsustainable </em>recovery and life.<br><br>The emotions that point us toward a sustainable life are themselves sustainable. No matter how much of them we experience, they continue to support our lives. Sustainable emotions include peace of mind, connectedness, love, compassion, joy, serenity, and peace.<br><br>The emotions that lead us toward an unsustainable life are themselves inherently unsustainable. The more they grow, the more they can get in the way. The most common unsustainable emotions are the unpleasant ones: shame, guilt, remorse, resentment, anger, rage, irritability, and so on. Quite a few are forms of fear, such as anxiety, unease, panic, and terror. When we feel these emotions briefly, we pay attention to them, identify their source and whether they’re cues to some action we need to take to regain balance in our lives, and then we let them go. Treated this way, they’re not a problem. However, if we cling to them and keep feeding them, eventually they will harm us—and, often, allow us to harm others.<br><br>But there’s another group of emotions that are equally unsustainable— yet they feel pleasant, at least at first. These include arrogance, overconfidence, excessive pride, superiority, self-righteousness, and hubris. Others include the relief we feel when we avoid discovery or punishment for acting badly and the pleasure we take in someone else’s pain or failure. (The German language actually has a word for this: <em>Schadenfreude</em>.)<br><br>We work Step Ten with the unshakable knowledge (faith) that we can’t live a sustainable life with a primary focus on self. Knowing this, we carefully observe our own emotions on an ongoing basis. We nurture those that, in turn, will nurture a sustainable life and recovery. We also notice those that will not; we take the appropriate actions if needed and then let them go. All the while, we keep in mind that <em>the more we sustain our recovery, the more it sustains us.</em></div>	Reading	8	2023-11-23 02:00:35.369745	2023-11-23 02:00:35.369745
