25	content	<div class="trix-content">\r\n<div>So far, I’ve spoken of the Ripple Effect as something that ripples out from one person to another. But as we keep working Step Ten, we learn to notice the Ripple Effect operating <em>inside </em>us. This occurs in multiple ways—five, at least.<br><br>First, when we’re living a life of service and carrying out the will of our Higher Power, we can feel the rightness of it in our own body. (This doesn’t mean it always feels easy or comfortable. Sometimes it may feel just the opposite.)<br><br>Second, over time we’ll not only feel that we are rippling out into the universe, but that the universe is rippling through us, expressing itself through us. This may be accompanied by a sense that we are in exactly in the right place, doing just what we need to do.<br><br>Third, as we work Step Ten and our recovery continues, a process of neurological healing takes place in our brain. New neural pathways get created and strengthened; old, harmful ones atrophy and disappear. An internal Ripple Effect literally heals our brain.<br><br>Fourth, as we develop our presence and internal awareness, we get better at tracking the subtle processes through which emotions and impulses arise in our body. Instead of mindlessly letting them ripple out through reactivity, we examine them. We discern the needs behind them. We choose our response based on the unique details and relationships of that moment. We work the appropriate Step. As necessary, we ask our Higher Power for help and guidance. We also learn to notice when we are impatient and distracted, not bringing our full presence to the moment. This awareness enables us to do an internal reset—and quickly return to the here and now.<br><br>Fifth, we become aware of more and more aspects of our personality that we were blind to before.</div>\r\n</div>	Reading	13	2024-01-04 01:10:06.529742	2024-01-24 20:55:39.356892
