21	content	<div>The Big Book provides us with specific directions for working Step Ten, as well as some clear promises and warnings. When we follow its directions, we live into the promises. When we don’t, we live into the warnings.<br><br>On pages 84 and 85, the Big Book promises us eight outcomes, which I’ve numbered here as a list.<br><br>1. And we have ceased fighting anything or anyone—even alcohol (or any other addiction).<br><br>2. For by this time sanity will have returned.<br><br>3. We will seldom be interested in liquor [or whatever substance or activity fueled our addiction].<br><br>4. If tempted, we recoil from it as from a hot flame.<br><br>5. We react sanely and normally, and we will find that this has happened automatically. We will see that our new attitude toward liquor [or any other addictive substance or activity] has been given us without any thought or effort on our part. It just comes! That is the miracle of it.<br><br>6. We’re not fighting it, neither are we avoiding temptation. We feel as though we had been placed in a position of neutrality—safe and protected. We have not even sworn off.<br><br>7. Instead, the problem has been removed. It does not exist for us. 8. We are neither cocky nor are we afraid.<br><br>The Big Book goes on to tell us that all this becomes the reality of our life, “. . . so long as we keep in fit spiritual condition.”<br><br>How do we stay in fit spiritual condition? By living according to these clear directions (page 85): “Every day is a day when we must carry the vision of God’s will into all of our activities.” Instead of constantly asking <em>What do I want? </em>as we did when we lived in the grip of self-centeredness, we ask,<br><br></div><blockquote>“How can I best serve Thee—Thy will (not mine) be done.” These are the thoughts that must go with us constantly. We can exercise our willpower along this line all we wish. It is the proper use of the will.</blockquote><div><br>The Big Book has just warned us that because we now live in the world of the Spirit,<br><br></div><blockquote>. . . It is easy to let up on the spiritual program of action and rest on our laurels. We’re headed for trouble if we do, for alcohol is a subtle foe. We are not cured of alcoholism. What we really have is a daily reprieve, contingent on the maintenance of our spiritual condition.</blockquote><div><br>And that’s true not only for alcoholism, but for any addiction, including our addiction to self-centeredness. Self-reliance, self-sacrifice, and other forms of self-centeredness are also subtle foes. Because they can creep in in exactly the same way, we need a daily reprieve from these as well. Step Ten is the ongoing practice that, day by day and moment by moment, prepares us for that reprieve. As the Big Book reminds us on page 83, “The spiritual life is not a theory. <em>We have to live it.</em>”</div>	Reading	11	2023-12-14 01:33:16.850048	2023-12-14 01:33:16.850048
