23	content	<div class="trix-content">\r\n<div>If you’re in a committed relationship, you may notice another distinction as you work Step Ten.<br><br>In long-term partnerships, usually one partner’s needs primarily get taken care of. I call this person the project. The other partner, who primarily takes care of the project’s needs, can be called the project manager. Projects like being taken care of. Project managers like taking care of them.<br><br>This arrangement can be perfectly healthy, since we all go about life getting our needs met through some dominance and some dependence. In fact, it often creates a good footprint for a family. In a generally healthy couple, it generates a balanced partnership out of two people’s natural differences.<br><br>In a less healthy couple, however, the person with the overdeveloped sense of dependence becomes the 24/7 project, while the partner with the overdeveloped sense of dominance becomes the 24/7 project manager. The classic example is the addict and the codependent.<br><br>In practice, things are often more nuanced. For instance, one member of a couple might be the financial project manager in the relationship, while the other is the emotional project manager. One partner might manage most of the couple’s relationships with neighbors, while the other manages most relationships with extended family. The roles of project and project manager can also shift over time, for example, in an emergency when one partner has a long-term illness, or as couples age.<br><br>In couples—especially those with kids—the project manager is the primary caregiver. In part this is because most primary caregivers are hardwired to protect their kids and their families. And, in most couples, the primary caregiver also serves as the family’s project manager in another way, providing much of the emotional security.<br><br>In American culture, the role of primary caregiver is often represented stereotypically by a female. Listen to a dozen random country western songs sung by males. Many of them will involve a man struggling to feel emotionally safe and secure through his dependence on a woman.<br><br>As we work Step Ten and recovery becomes more and more of a way of life for us, these differences become increasingly visible. Project/project manager relationships—whether balanced or imbalanced—aren’t just a heterosexual relationship phenomenon, of course. These roles tend to evolve in all committed couples, whether they’re straight, gay, or otherwise. All of us are variations on the same theme: human being.</div>\r\n</div>	Reading	12	2023-12-28 01:33:55.552869	2024-01-24 20:56:26.875566
