30	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<ul>\r\n<li><strong>STEP 10:</strong> </li>\r\n<li>(Continued to take personal inventory and when </li>\r\n<li>we were wrong promptly admitted it.)</li>\r\n<li> </li>\r\n<li>Have you started Step 10?</li>\r\n<li>If not, are there any parts of the reading that spoke to you?</li>\r\n<li>If you have, can you describe the transition from Step 10 into Step 11?</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	15	2024-01-17 23:01:51.650815	2024-01-25 02:09:22.92813
79	content	<blockquote>I used to spend so much time reacting and responding to everyone else that my life had no direction. Other people’s lives, problems, and wants set the course for my life. Once I realized it was okay for me to think about and identify what I wanted, remarkable things began to take place in my life. <br><strong>- ANONYMOUS</strong></blockquote><div><br>We each have a life to live, one that has purpose and meaning. We can help our Higher Power give direction and purpose to our life by setting goals.<br><br>    We can set goals annually, monthly, or daily in times of crisis. Goals create direction and pace; goals help us achieve a manageable life that is directed in the course we choose for ourselves. <br><br>    We can help give our lives direction by setting goals.<br><br><em>Today, I will pay attention to setting a course of action for my life, rather than letting others control my life and affairs.<br></em><br></div>	Reading	40	2024-09-05 03:21:09.702271	2024-09-05 03:21:33.803046
27	content	<div> The Serenity Prayer is one of the Program’s most concentrated sources of inspiration and guidance. It is also one of the most beloved and often quoted. Here is the most common version:<br><br></div><blockquote>God grant me the serenity<br>To accept the things I cannot change;<br>The courage to change the things I can;<br>And the wisdom to know the difference.</blockquote><div><br>This version of the prayer sets up a duality: the things we can change and the things we cannot. But the Ripple Effect teaches us that these are not our only options.<br><br>In Step One we admitted that our addiction was not something we could cure, or manage, or otherwise change for the better. Then, in Step Two, we admitted that we could not become saner or more spiritual on our own. We also understood that as we worked Steps Three through Nine—especially Steps Six and Seven—we would have a spiritual experience and a transformation would occur. But we also understood that we could not make these things happen. <em>They would happen to us</em>.<br><br>The Ripple Effect is the opposite of trying to control or manipulate the world. It is about showing up, speaking, and acting in a way that— somehow—sets the stage for positive change, often in ways we can’t plan or predict.<br><br>In recognition of the Ripple Effect, here’s another version of the Serenity Prayer to capture its spirit:<br><br></div><blockquote>God grant me the serenity<br>To accept the things I cannot change;<br>The courage to change the things I can;<br>And the wisdom to also do the things I can<br>That will bring about the changes I can’t.</blockquote><div><br>This is the essence of Steps Six and Seven. When we work them for the first time, we understand that it is not possible for us, on our own, to get rid of our shortcomings and character defects. Our Higher Power must do that for us.<br><br>Yet in order to work those Steps—and for them to work on and through us—we also have to act, by asking our Higher Power to remove those flaws. We have to ask for the necessary events to ripple through us. We make a willful commitment to no longer do things the way we used to—and an equally willful commitment to accept whatever happens next. This altered Serenity Prayer beautifully embodies this same process and attitude.</div>	Reading	14	2024-01-09 03:37:23.77349	2024-01-09 03:38:49.241144
19	content	<div>Our emotions offer us a continuous opportunity to know if what we’re doing, thinking, or planning is sustainable or unsustainable. They give us immediate and constant feedback about how we’re using our free will—or how we’re about to use it.<br><br>Our emotions are also very reliable indicators of when we need to practice Step Ten. Whenever an unsustainable emotion arises, and stays with us more than briefly, that’s a sign that Step Ten is called for. As we practice paying attention to our emotions day by day, we get a very accurate measure of what’s working in our life—and what’s not. In Step Ten, <em>as we continue to watch for selfishness, dishonesty, resentment, and fear</em>, we learn to become better observers of ourselves. With practice, we get better and better at these directions:<br><br></div><ol><li>Noticing any harm we create <em>as soon as we create it</em>—and making amends as soon as possible.</li><li> Recognizing unsustainable thoughts, emotions, and impulses when they first appear.</li><li>Noticing ever smaller and more subtle manifestations of those emotions, thoughts, and impulses.</li><li> Intuiting the probable outcome of embracing or following each one.</li><li> Restraining ourselves from doing harm to ourselves and others.</li><li>Asking our Higher Power to remove whatever shortcomings and character defects we observe—and to give us guidance for what to do next.</li><li>Acting out of the best parts of ourselves—with the guidance of our spiritual direction—instead of from our self-direction.</li></ol><div><br></div><div>In working Step Ten, we apply our free will by choosing which thoughts, impulses, and emotions to act on and which ones to let go. We quickly let go of unpleasant and unsustainable emotions as if they were a hot flame. We also recognize that certain pleasurable emotions—selfcongratulation, excessive pride, superiority, and their counterparts—as just as unsustainable as jealousy, rage, resentment, or self-pity.<br><br>As a result, as we work Step Ten, our transgressions become less frequent. When we do fall prey to the subtle foe of self-interest, we generally create smaller crises and less damaging situations—and we usually learn something important from them. We still make blunders— perhaps even a major one—now and then, but we know how to handle it when we do.<br><br><br></div><blockquote><a href="http://aa.humblebot.io/readings/15">Read Part 2 Here</a></blockquote><div><br><br></div>	Reading	10	2023-12-07 02:24:46.29211	2024-01-18 01:20:47.483313
29	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div>Suppose that you wake up on a Sunday morning and review your plan for the day. As part of working this part of Step Eleven, you also review your emotions around each part of the plan. Okay, we’re going to have breakfast and read the paper. Nice. We’ll also do some chores around the house. It’ll be good to get those done. Then I have to write that report for our Monday morning meeting at work. Crap. I don’t want to. Not on a Sunday.<br><br>Because you’re observing your own emotions, you can see immediately that you’re feeling positive, sustainable emotions about everything except the report. You’re feeling some resentment about that. But because you immediately recognize that resentment, you don’t have to go through the day feeling resentful. You have other choices. You can remind yourself that the resentment is a form of self-interest, and let go of it—or ask God to take it from you. You can write the report right after breakfast. By getting it out of the way, you can spare yourself (and your partner) your resentment all day.<br><br>When an emotion, thought, or impulse arises, you can also ask yourself this question: <em>Is following this likely to bring me peace of mind? </em>With some self-examination, the answer will usually be quite clear. We’re never baffled for too long in distinguishing self-will from the will of our Higher Power. When we’re attracted to an unbalanced or unsustainable activity, we’ll sense that it’s not right. We’ll recoil in guilt or distaste or unease. That is all the information we need. <br><br>We ignore this information at our peril. <em>One of the greatest missteps in long-term sobriety is having clear insight into what’s right and what’s not— and then ignoring that insight.</em><br><br>Our self-observation throughout the day leads us, naturally and seamlessly, into Step Eleven: “Sought through prayer and meditation to improve our conscious contact with God as <em>we understood Him</em>, praying only for knowledge of His will for us and the power to carry that out.” The book <em>Twelve Steps and Twelve Traditions</em> describes this transition beautifully—and makes a solemn promise to us—on page 98:</div>\r\n<div> </div>\r\n<div> </div>\r\n<blockquote>There is a direct linkage among self-examination [Step Ten], meditation, and prayer [Step Eleven]. Taken separately, these practices can bring much relief and benefit. But when they are logically related and interwoven, the result is an unshakable foundation for life.</blockquote>\r\n<div><br><br> </div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	15	2024-01-17 23:01:51.632741	2024-01-25 02:09:22.909876
31	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p>The story I’m about to tell you took place soon after I did Step Nine for the first time. I was just beginning to do Step Ten. I’d been in recovery for maybe five or six months.</p>\r\n<p>I was doing the right things, and feeling good. I had a lot to be grateful for. But on that day—I remember it was a Saturday afternoon—I wasn’t feeling grateful at all. My boyfriend Roberto was at his parents’ house with our daughter, Ariella, and our black Labrador retrievers, and I was home alone. All of a sudden this terrible funk hit me, completely out of nowhere.</p>\r\n<p><br>This was a new form of misery for me. It wasn’t the misery of a hangover or a craving. Or the misery of guilt because I’d done something thoughtless and mean. It had no source at all that I could see. I remember thinking, <em>What the hell? I thought I was on a glorious path of joyous and serene sobriety.</em> I kind of assumed I would never feel bad again. Which, looking back, is silly—but it’s how I felt right then.</p>\r\n<p><br>I also felt like I was exuding misery. I was relieved that Roberto and Ariella weren’t home and didn’t see what a wreck I was. I finally thought, <em>Okay, I’ve got to do something. What can I do?</em></p>\r\n<p><br>I decided to go to the park, just to breathe in some nature and be out in the world.</p>\r\n<p><br>Almost as soon as I got to the park, a couple of half-grown golden retrievers ran up to me, wagging their tails and licking my hands. I love my Labs, but I love goldens even more. These two were super happy, and they obviously wanted me to throw something. So I threw a stick, and they both went charging after it.<br>I heard their owner calling them. I looked and saw a man who looked a little like my dad. He was with his daughter, who was about Ariella’s age, maybe twelve or thirteen. I could see she had Down syndrome.</p>\r\n<p><br>I went over to them and told them about my Labs, and the girl got excited. She said, “I adore Labs!” She pointed to the goldens and said, “The orange guys are Bonnie and Clyde. My dad named them after criminals. He’s weird.” She handed me a stick and picked up one of her own. She said to me, “We need to throw and fetch until they’re tired out.” I looked at her dad. He just smiled and said, “All true.”</p>\r\n<p><br>The three of us spent the next half hour hurling sticks across the lawn until our arms hurt. By then the dogs had had enough too, and just stood there panting. The girl said to me, “You want to know something? Bonnie and Clyde are both boys, but with their you-know-whats cut off. My dad named them. He’s weird.”<br>Her father shrugged and said, “Yup, I’m weird. Okay, Jocelyn, let’s blow this pop stand.” They leashed the dogs, waved goodbye, and walked off.</p>\r\n<p><br>By now I was feeling good. The energy of the girl and the dogs was contagious, and all the throwing had released endorphins in my body. I walked home smiling, amazed at what had just happened. My favorite breed of dog had come to fetch me and taken me to a happy family that made me more grateful than ever for my own.</p>\r\n<p><br>When I got home, Roberto and Ariella were sitting on the porch, singing a Justin Bieber song. I shouted, “Your musical taste sucks!” and threw my arms around them both.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	16	2024-01-25 02:18:13.400381	2024-01-25 02:21:32.867245
32	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<ul>\r\n<li>Unexpected Moments of Misery</li>\r\n<li>Connecting With Nature</li>\r\n<li>Gratitude and Awareness of the Present Moment</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	16	2024-01-25 02:18:13.406863	2024-01-25 02:21:32.889867
35	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<p>    I used to be a serious pot smoker. I lit up pretty much every day, sometimes two or three times. I was also a pretty heavy drinker. Am I an addict? At a certain point I decided it didn’t matter—I just needed my life to be manageable. I needed to do something before everything fell completely to pieces. That’s when I started going to MA (Marijuana Anonymous) and AA meetings.</p>\r\n<p>    The Program has worked well for me. I’ve been drug- and alcohol-free for just over three years. Life isn’t perfect, but it’s good. And it really helps to have a clear head.</p>\r\n<p>    Here’s what happened just two weeks ago. I’m reading in the library, in one of its big cushioned chairs. I feel something shift in my pocket and fall out. So I stand up and, sure enough, my keys are gone.</p>\r\n<p>    I pull off the bottom cushion of the chair. There are my keys —along with a bag of weed, maybe half an ounce.</p>\r\n<p>    My first thought is, <em>Wow, it’s a gift from the gods. My second is, Don’t be an idiot. You know you’ll regret it if you light up. My third is, I don’t have to smoke it. I can sell it. If it’s good stuff, it’s worth sixty or seventy bucks. </em>All this goes through my head in about two seconds. </p>\r\n<p>    Then my good sense returns. I stuff the bag and my keys into my coat pocket and head for the men’s room. I dump the pot into the toilet and flush it.</p>\r\n<p>    I go back and start reading again, but now I’m feeling <em>really </em>uncomfortable. How could I even <em>think </em>about using again? Or worse, dealing? I feel like I’ve committed some terrible Twelve Step sin. And then I think, <em>Have I just taken the first step toward relapse? </em></p>\r\n<p>    I take out my phone and call my sponsor. I say to him, “Brent, can you talk? I feel terrible, like I just stole toys from Santa Claus or something.”</p>\r\n<p>    He laughs and says, “Okay, tell me what happened.”</p>\r\n<p>    So I tell him the story and say, “I know I need to do a Tenth Step about this. Can you help me think it through?”</p>\r\n<p>    Brent is silent for a couple of seconds. Then he says, “Working Step Ten is a good idea. But I’d say you’ve only committed one wrong, and it’s not the one you think. You’re trying to punish yourself for being human.”</p>\r\n<p>    This is completely not what I’m expecting. I say, “Come again?” My sponsor says, “Remember what the Big Book says? <em>If tempted, we recoil from it as from a hot flame.</em> That’s exactly what you did. Nothing in the Program says that it’s wrong to feel tempted. In fact, the sentence I just quoted implies that we likely <em>will </em>be tempted. That’s what I love about the Program. It allows us to be human. It assumes we’re going to be human. It doesn’t demand perfection. It focuses on spiritual progress, not spiritual perfection.”</p>\r\n<p>    I say to him, “So it’s not a shortcoming to be tempted?” “No,” he says. “It’s a shortcoming to act on that temptation. But, you know, it’s also a shortcoming to expect that you’ll never be tempted. You’re showing yourself too little compassion and understanding. That’s something worth asking your Higher Power to remove.” In my head and heart, I did a Step Ten right there in the library. I also found a copy of the Big Book on the shelves and looked at what it had to say about that Step. On page 85 was a sentence I’d read many times before, but had never really thought much about. <em>We are neither cocky nor are we afraid. </em></p>\r\n<p>    I had gotten afraid—afraid that I was losing my sobriety because I’d felt a moment of temptation.</p>\r\n</div>\r\n</div>	Reading	18	2024-02-08 02:07:15.903009	2024-02-08 02:10:18.724399
36	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<ul>\r\n<li>Navigating Temptation and Relapse Prevention</li>\r\n<li>Embracing Imperfection in Recovery</li>\r\n</ul>\r\n<p> </p>\r\n</div>\r\n</div>	Reading	18	2024-02-08 02:07:15.917515	2024-02-08 02:10:18.780296
33	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p>All of this may sound terribly cosmic or “woo-woo” to someone who hasn’t had a spiritual experience. But it’s not woo-woo at all. We realize—not just in our head, but in our body—that the Ripple Effect is as normal as breathing or walking or smiling.</p>\r\n<p> </p>\r\n<p>Because of this realization, we’re naturally more calm, more loving, more serene, more willing to help, and more present than we used to be. Even people who think that the Ripple Effect is esoteric can’t help but notice the quality of our presence.</p>\r\n<p> </p>\r\n<p>To show you just how down-to-earth the Ripple Effect is, let’s look at our needs.</p>\r\n<p> </p>\r\n<p>When we practiced our addiction, whenever we felt a need, we demanded that other people meet it for us. We did this through dominance (such as bullying, manipulation, deal-making), dependence (such as people pleasing, flattery, playing the victim), or both.</p>\r\n<p> </p>\r\n<p>Now, as Step Ten becomes a natural part of our life, we have grown out of this self-centered orientation. Instead, when a need arises in us, we examine it rather than spring into mindless action. Then we focus on meeting that need ourselves—either through our own actions, by asking for help from someone, or by asking for spiritual direction from our Higher Power.</p>\r\n<p> </p>\r\n<p>For instance, imagine that you want to find the right sponsor. You’re aware of the need, but you know that you can’t magically make that person appear. So instead, you go to lots of different meetings, where you’ll have the opportunity to meet many people. At each meeting, you keep an eye out for folks who might make a good sponsor. If someone impresses you in the right way, you introduce yourself to the person and talk for a bit. If this initial interaction feels right, you invite the person to have coffee or tea with you. But that’s not all you do. <em>You also ask your Higher Power for spiritual guidance.</em></p>\r\n<p> </p>\r\n<p>We keep in mind Steps Six and Seven and remember that it’s not always enough for us to do the right things; often we also have to ask for help, so that the things we can’t do on our own can come about.</p>\r\n<p> </p>\r\n<p>For example, in your search for a sponsor, you might have coffee at a café with Chris, whom you’ve seen a few times at meetings. It turns out that Chris is moving to New Zealand in three weeks, so she clearly can’t be your sponsor. But after a few minutes, Chris’s friend Sabrina comes into the café, spots her, and sits down next to you.</p>\r\n<p> </p>\r\n<p>As the three of you chat, you learn that Sabrina is also in a Twelve Step group and has three years of solid sobriety. You go to one of that group’s meetings and feel very much at home and like the kind of program that Sabrina is working. A month later you ask Sabrina if she will be your sponsor. She accepts.</p>\r\n<p> </p>\r\n<p>None of this would have happened if you hadn’t introduced yourself to Chris. That was your doing. But also, none of it would have happened if events entirely beyond your control—and your ability to plan—hadn’t taken place.</p>\r\n<p> </p>\r\n<p>On the one hand, this sequence of events may seem perfectly ordinary. On the other, it is very much a spiritual experience:<em> a remarkable and unexpected turn for the better that turns out to be perfect for everybody involved.</em></p>\r\n<p> </p>\r\n<p>We cannot control life. Often we cannot solve our own problems. But we can show up fully, ask the right questions, and open ourselves to unknown possibilities. When we do this, the universe may reveal to us a much better solution than we could have ever designed or imagined on our own.</p>\r\n</div>\r\n</div>\r\n</div>	Reading	17	2024-02-01 00:20:26.362257	2024-02-01 00:26:52.493829
