39	content	<div>&nbsp; &nbsp;<strong>People tell me </strong>I have every reason to be angry at my dad, because he molested me regularly for six years—from when I was seven until I was twelve.</div><div>&nbsp; &nbsp;I tell them, “No. I have every <em>right </em>to be angry. But I have a very good reason not to stay in anger and resentment.” Then I tell them the story I’m about to tell you.</div><div>&nbsp; &nbsp;I’m not going to give you the details of how he molested me. I’ll just say it’s not pretty. It happened dozens of times— whenever my mother was out of town. The details are mostly what you’d imagine—except that usually Dad was drunk or stoned.</div><div>&nbsp; &nbsp;The other pertinent detail is that my mom died of lung cancer when I was nineteen. She smoked two packs a day from the time she was a teenager, and she never slowed down until the last few months of her life.</div><div>&nbsp; &nbsp;The story I want to tell took place last summer, when I was forty-two. I hadn’t seen or spoken to my father for almost twenty years, when I ran into him unexpectedly.</div><div>&nbsp; &nbsp;I live in a small town in Missouri about fifty miles from where I grew up. I teach high school English. I like my job and I love having summers off.</div><div>&nbsp; &nbsp;I also love being clean and sober. From high school until five years ago, I put all kinds of shit into my body—meth, coke, crack, quaaludes, and lots and lots of alcohol—but never heroin, thank God. I’ll receive my five-year sobriety medallion next month.</div><div>&nbsp; &nbsp;Being clean and sober has meant not having to live in hell. I’m very grateful for that. But until about two years ago, I wasn’t very happy either. I’ve done plenty of therapy, and all kinds of healing strategies—EMDR, somatic therapy, massage, reiki, tai chi, yoga. They all helped me to come back to my body. But they didn’t help me with my anger and resentment. Those emotions kept living inside me like rats inside the walls of a house.</div><div>&nbsp; &nbsp;Early one morning last summer, I was rereading the story “Freedom from Bondage” in the Big Book. That really struck a nerve in me. In that story, a woman feels like she’s being eaten away by resentment toward her mother. I’d read it before—a couple of times—but this time a voice in my head said, That’s me.</div><div>&nbsp; &nbsp;I closed the book. That same voice said, <em>Enough. I’ve had enough. Dad already screwed up my life big time. I don’t want resentment and anger to screw it up more.<br></em><br></div><div>&nbsp; &nbsp;I started crying—and I couldn’t stop. I must have cried for ten minutes straight.<br><br></div><div>&nbsp; &nbsp;And you know what? After all those tears, afterward I was just as angry and resentful as before. That’s when I knew I couldn’t heal on my own. Even if I tried every type of therapy in the whole goddamn world.</div><div>&nbsp; &nbsp;I opened the Big Book again, to the Steps on page 59. I bowed my head and said aloud, “God, I have to have your help. Please take away my resentment and anger at Dad. I’ve kept him out of my life, but I can’t keep him out of my head.” And then I said something I hadn’t even consciously realized: “I don’t know if I can keep feeling this way without drinking or drugging again. Thy will be done.”</div><div>&nbsp; &nbsp;I felt a little better after that, so I wiped my eyes and drove to a restaurant downtown that makes really good pancakes.</div><div>&nbsp; &nbsp;I was sitting in a booth by the window, drinking coffee and waiting for my food, when a beat-up station wagon pulled up outside. The driver’s door opened and an old, obese man got out —very slowly. It looked like he had serious arthritis, or some other problem with moving. He kept trying to pull himself up out of the seat, without success.</div><div>&nbsp; &nbsp;I thought, <em>There’s someone who needs some help,</em> so I slid out of the booth and started to go outside to help him. And then, after a few steps, I realized—<em>it was my father. </em>Much older and much heavier, but definitely him. And what I felt for him right then was sadness. Just sadness. And a little twinge of pity.</div><div>&nbsp; &nbsp;At that point, he managed to stand up, close the car door, and take a couple of steps. He didn’t look in my direction, and for a second I thought he was going to come into the restaurant. But he walked past the door and down the sidewalk. And then I lost sight of him.</div><div>&nbsp; &nbsp;I sat back down in the booth and said silently, <em>Thank you, Father.</em></div><div>&nbsp; &nbsp;I have some compassion for my father now. At times I still have flashes of anger or resentment toward him—but when I do, I immediately say a prayer: <em>God, please take this away.</em> And soon the feelings blow away.</div><div>&nbsp; &nbsp;I’m not interested in forgiving my father or reconciling with him. But I am interested in having a life—and I’m doing my best to have one, with the help of my Higher Power.</div>	Reading	20	2024-02-29 03:02:22.48811	2025-04-07 03:23:05.174134
37	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p>For children, Valentine’s Day means candy hearts, silly cards, and excitement in the air.</p>\r\n<p>How different Valentine’s Day can be for us as adults. The Love Day can be a symbol that we have not yet gotten love to work for us as we would like.</p>\r\n<p>Or it can be a symbol of something different, something better. We are in recovery now. We have begun the healing process. Our most painful relationships, we have learned, have assisted us on the journey to healing, even if they did little more than point out our own issues or show us what we don’t want in our life.</p>\r\n<p>We have started the journey of learning to love ourselves. We have started the process of opening our heart to love, real love that flows from us, to others, and back again. Do something loving for yourself. Do something loving and fun for your friends, for your children, or for anyone you choose.</p>\r\n<p>It is the Love Day. Wherever we are in our healing process, we can have as much fun with it as we choose. Whatever our circumstances, we can be grateful that our heart is opening to love.</p>\r\n<p> </p>\r\n<p><em>I will open myself to the love available to me from people, the Universe, and my Higher Power today. I will allow myself to give and receive the love I want today. I am grateful that my heart is healing, that I am learning to love.</em></p>\r\n</div>\r\n</div>\r\n</div>	Reading	19	2024-02-15 03:23:00.137113	2024-02-15 03:25:09.78956
38	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<ul>\r\n<li>\r\n<p>Practicing Self-Love and Compassion</p>\r\n</li>\r\n<li>\r\n<p>Gratitude and Healing on Valentine's Day</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>	Reading	19	2024-02-15 03:23:00.161902	2024-02-15 03:25:09.824671
44	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p> </p>\r\n<ul>\r\n<li>Which of these <strong>internal reminders</strong> do you see yourself using in recovery?</li>\r\n<li>How do you balance <strong>action </strong>and <strong>serenity</strong>?</li>\r\n</ul>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	22	2024-03-21 03:24:45.576845	2024-03-21 03:34:35.022616
41	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p>   I’m a psychotherapist who has written some well-received selfhelp books. I give talks, lead workshops, and occasionally appear on radio or TV shows. I’m also an alcoholic with thirty-two years of recovery.</p>\r\n<p> </p>\r\n<p>   In my AA group, of course, I’m just Arvette C. In some ways I’m not very anonymous, because I mention my addiction and recovery in my writing, and there aren’t a lot of Arvettes around. When new people show up to the group, some of them recognize me immediately.</p>\r\n<p> </p>\r\n<p>   On the other hand, in some ways people <em>don’t</em> really recognize me. What they see is the respected elder and therapist and author with three decades of sobriety.</p>\r\n<p> </p>\r\n<p>   What they fail to see is the flawed human being who is wired exactly like they are, and who is every bit as dependent on a Higher Power.</p>\r\n<p> </p>\r\n<p>   My husband Don and I have been married for over forty years. He was a therapist, too, until he retired a few years ago. Our marriage is a good one, but that doesn’t mean we don’t have problems. People think therapists lead charmed lives, that we don’t struggle with the same crapola they do.</p>\r\n<p> </p>\r\n<p>   Last March, Don and I were at the annual state AA roundup. I was one of the scheduled speakers. Don and I were having breakfast in the hotel restaurant about an hour before I was scheduled to speak. I noticed the people a couple of tables away —a pair of young men—looking at me. One of them pointed briefly at me and then spoke to his partner. I’m used to people occasionally recognizing me and pointing me out, so I just smiled at the couple and returned to eating and chatting with Don.</p>\r\n<p> </p>\r\n<p>   Then, a minute later, one of the young men got up and came over. I assumed he wanted to thank me for my books, so I put on a big smile. When he got to the table, he leaned down close to me and whispered, “Ma’am, your dress is tucked into your underwear in back.”</p>\r\n<p> </p>\r\n<p>   My face must have turned the color of a tomato. I reached around and, sure enough, in back, the hem of my dress had gotten tucked into my panties. I stood up partway and fixed things as surreptitiously as I could. I thanked the young man, who said, “No problem,” and went back to his table.</p>\r\n<p> </p>\r\n<p>   At that point I was totally flustered, totally off balance. I looked at Don, who had raised both his eyebrows.</p>\r\n<p>   I said to him in an angry whisper, “Why didn’t you tell me?”</p>\r\n<p>   Don spread his hands. “I didn’t notice.”</p>\r\n<p>   “How could you not notice?” I said.</p>\r\n<p>   “How could <em>you </em>not notice?” Don asked.</p>\r\n<p>   I threw my napkin at him and said, “Screw you.”</p>\r\n<p>   Don’s eyes went wide. I hadn’t said anything like that to my husband in decades.</p>\r\n<p> </p>\r\n<p>   Two words echoed in my head: <em>Step Ten</em>. I reached across the table and took his hand in mine. “Oh, my God,” I said. “Darling, I’m so sorry. So sorry. That was totally wrong of me. I was flustered and upset and embarrassed. I imagined the whole restaurant staring at my butt in my granny panties. What amends do you need me to make?”</p>\r\n<p> </p>\r\n<p>   Don took a sip of coffee—one of his standard ways to buy time. He frowned and said in a very serious tone of voice, “Two things. Number one, next time you tell me to tuck in my shirt, I’m going to giggle, and you’re not going to say a thing. Number two, I want you relax and enjoy your breakfast, and then go and give an inspiring talk.”</p>\r\n<p> </p>\r\n<p>   Let me tell you something. It doesn’t matter how long or solid your recovery is, or how completely you’ve turned your life over to a Higher Power. You’re still going to have problems: with your character flaws, especially as they surface with the significant people in your life, and sometimes with your clothing. There’s nothing in the Big Book that says all your problems will go away.</p>\r\n</div>\r\n</div>\r\n</div>	Reading	21	2024-03-07 03:06:38.842138	2024-03-07 03:08:39.219399
42	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p> </p>\r\n<ul>\r\n<li>Humility and Imperfection<strong><br></strong></li>\r\n<li>Acceptance of Flaws and Self-Compassion</li>\r\n</ul>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>	Reading	21	2024-03-07 03:06:38.867565	2024-03-07 03:08:39.322191
81	content	<blockquote>We should learn not to grow impatient with the slow healing process of time. We should discipline ourselves to recognize that there are many steps to be taken along the highway leading from sorrow to renewed serenity. . . . We should anticipate these stages in our emotional convalescence: unbearable pain, poignant grief, empty days, resistance to consolation, disinterestedness in life, gradually giving way . . . to the new weaving of a pattern of action and the acceptance of the irresistible challenge of life.</blockquote><div><br>— JOSHUA LOTH LIEBMAN<br><br>Recovery is a process. It is a gradual process, a healing process, and a spiritual process—a journey rather than a destination.<br><br>Just as codependency takes on a life of its own and is progressive, so recovery progresses. One thing leads to another and things—as well as us—get better.<br><br>We can relax, do our part, and let the rest happen.<br><br>Today, I will trust this process and this journey that I have undertaken.<br><br></div>	Reading	41	2024-09-12 03:31:20.834914	2024-09-12 03:41:34.689351
82	topic	<ul><li> Patience in the Healing Process </li><li>Coping with Emotional Stages in Recovery</li><li>Balancing Action and Acceptance</li></ul>	Reading	41	2024-09-12 03:31:20.842093	2024-09-12 03:41:34.716353
83	content	<blockquote>Before recovery, my relationships were lousy. I didn’t do very well on my job. I was enmeshed in my dysfunctional family. But at least I knew what to expect!</blockquote><div><br>— ANONYMOUS<br><br>I want the second half of my life to be as good as the first half was miserable. Sometimes, I’m afraid it won’t be. Sometimes, I’m frightened it might be.<br><br>The good stuff can scare us. Change, even good change, can be frightening. In some ways, good changes can be more frightening than the hard times.<br><br>The past, particularly before recovery, may have become comfortably familiar. We knew what to expect in our relationships. They were predictable. They were repeats of the same pattern—the same behaviors, the same pain, over and over again. They may not have been what we wanted, but we knew what was going to happen.<br><br>This is not so when we change patterns and begin recovering. We may have been fairly good at predicting events in most areas of our life. Relationships would be painful. We’d be deprived. Each year would be almost a repeat of the last. Sometimes it got a little worse, sometimes a little better, but the change wasn’t drastic. Not until the moment when we began recovery. Then things changed. And the further we progress in this miraculous program, the more we and our circumstances change. We begin to explore uncharted territory.<br><br>Things get good. They do get better all the time. We begin to become successful in love, in work, in life. One day at a time, the good stuff begins to happen and the misery dissipates. We no longer want to be a victim of life. We’ve learned to avoid unnecessary crisis and trauma.<br><br>Life gets good.<br><br>“How do I handle the good stuff?” asked one woman. “It’s harder and more foreign than the pain and tragedy.”<br><br>“The same way we handled the difficult and the painful experiences” I replied. “One day at a time.”<br><br></div><blockquote>Today, God, help me let go of my need to be in pain and crisis. Help me move as swiftly as possible through sad feelings and problems. Help me find my base and balance in peace, joy, and gratitude. Help me work as hard at accepting what’s good as I have worked in the past at accepting the painful and the difficult.</blockquote>	Reading	42	2024-09-19 04:08:37.447319	2024-09-19 04:08:37.447319
84	topic	<ul><li><strong>Breaking Old Patterns of Dysfunction</strong></li><li> Accepting the Good in Recovery </li></ul>	Reading	42	2024-09-19 04:08:37.454514	2024-09-19 04:10:11.813412
65	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<blockquote>\r\n<p><em>I ask that You might help me work through all my problems, to Your Glory and Honor.</em></p>\r\n<p><em>— ALCOHOLICS ANONYMOUS</em></p>\r\n</blockquote>\r\n<p> </p>\r\n<p>    Many of us lived in situations where it wasn’t okay to identify, have, or talk about problems. Denial became a way of life—our way of dealing with problems.</p>\r\n<p> </p>\r\n<p>    In recovery, many of us still fear problems. We may spend more time reacting to a problem than we do to solving it. We miss the point; we miss the lesson; we miss the gift. Problems are a part of life. So are solutions.</p>\r\n<p> </p>\r\n<p>    A problem doesn’t mean life is negative or horrible. Having a problem doesn’t mean a person is deficient. All people have problems to work through.</p>\r\n<p> </p>\r\n<p>    In recovery, we learn to focus on solving our problems. First, we make certain the problem is our problem. If it isn’t, our problem is establishing boundaries. Then we seek the best solution. This may mean setting a goal, asking for help, gathering more information, taking an action, or letting go.</p>\r\n<p> </p>\r\n<p>    Recovery does not mean immunity or exemption from problems; recovery means learning to face and solve problems, knowing they will appear regularly. We can trust our ability to solve problems, and know we’re not doing it alone. Having problems does not mean our Higher Power is picking on us. Some problems are part of life; others are ours to solve, and we’ll grow in necessary ways in the process.</p>\r\n<p> </p>\r\n<p>    Face and solve <em>today’s</em> problems. Don’t worry needlessly about tomorrow’s problems, because when they appear, we’ll have the resources necessary to solve them.</p>\r\n<p> </p>\r\n<p>    Facing and solving problems—working through problems with help from a Higher Power—means we’re living and growing and reaping benefits.</p>\r\n<p> </p>\r\n<blockquote>\r\n<p><em>God, help me face and solve my problems today. Help me do my part and let the rest go. I can learn to be a problemsolver.</em></p>\r\n</blockquote>\r\n<p> </p>\r\n<h3><em>February 22</em></h3>\r\n<p> </p>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	33	2024-06-08 03:14:16.41252	2024-06-08 03:19:21.118686
66	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<ul>\r\n<li>Boundaries and Problem-Solving</li>\r\n<li>Role of your Higher Power</li>\r\n</ul>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	33	2024-06-08 03:14:16.425124	2024-06-08 03:19:21.162294
43	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p>These are quick, simple phrases you can use whenever you’re in doubt, in pain, or in trouble. Recite them silently to help you ground yourself in a spirit of service—and in the here and now.</p>\r\n<p> </p>\r\n<ul>\r\n<li><strong><em>Listen up</em></strong> or <strong><em>Pay attention</em></strong>. Recite this to yourself when you’re bored, or when you catch your mind wandering—especially if it’s wandered into obsessive self-interest.</li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><strong><em>How can I be most helpful right now?</em></strong> This is another quick, effective antidote for self-centeredness. Another version is Do the next right thing.</li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><strong><em>Let’s get to work.</em></strong> This is shorthand for <em>I realize there’s something I need to do—an effort or change I need to make. I’m willing to shoulder that responsibility, and I’m not going to procrastinate. I’m starting right now.</em></li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><strong><em>Keep it simple.</em> </strong>This classic AA slogan is especially helpful when you’re confused or overwhelmed.</li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><em><strong>Don’t play God</strong> </em>or simply <em>Not God.</em> Use this internal wake-up call when you’ve put self-centeredness before service—or before the will of your Higher Power.</li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><strong><em>There I go again.</em></strong> Maybe you just caught yourself doing something unwise. Mentally recite these words, preferably with a forgiving smile, not a shameful accusation. Then stop and work Step Ten. Or maybe you were able to catch yourself just <em>before </em>doing something you’d have regretted later. Recite this phrase silently, take a deep breath, give yourself a quick mental thumbs-up, and return to the here and now.</li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><em><strong>Don’t go there.</strong> </em>Saying this mentally, or even out loud, will help you nip many potential problems in the bud. Stop where you are and say this phrase aloud to wake yourself up.</li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><em><strong>Pause . . . Relax . . . Take it easy</strong>.</em> Silently repeat this sequence—a variation on the AA slogan <em>Easy Does It</em>—whenever you feel tense or anxious. Then follow that prescription.</li>\r\n</ul>\r\n<p> </p>\r\n<ul>\r\n<li><strong><em>Let go. </em></strong>Gently say this short version of the AA slogan <em>Let Go and Let God</em> to yourself—and then do it. Let go of your fears, your anxious hopes, your wanting to control what happens, and your desire to know or understand everything or get all the answers. Above all, let go of your self-centeredness. Stay open and present, and live into the next unfolding moment, and the next, and the next.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	22	2024-03-21 03:24:45.564549	2024-03-21 03:34:34.930372
