132	body	<div><strong>1. </strong>If we are painstaking about this phase of our development, we will be amazed before we are half way through.<br><strong>2.</strong> We are going to know a new freedom and a new happiness.<br><strong>3.</strong> We will not regret the past nor wish to shut the door on it.<br><strong>4. </strong>We will comprehend the word serenity and we will know peace.<br><strong>5. </strong>No matter how far down the scale we have gone, we will see how our experience can benefit others.<br><strong>6.</strong> That feeling of uselessness and self-pity will disappear.<br><strong>7. </strong>We will lose interest in selfish things and gain interest in our fellows.<br><strong>8.</strong> Self-seeking will slip away.<br><strong>9. </strong>Our whole attitude and outlook upon life will change.<br><strong>10.</strong> Fear of people and of economic insecurity will leave us.<br><strong>11.</strong> We will intuitively know how to handle situations which used to baffle us.<br><strong>12.</strong> We will suddenly realize that God is doing for us what we could not do for ourselves<br><br>   Are these extravagant promises? We think not. They are being fulfilled among us - sometimes quickly, sometimes slowly. They will always materialize if we work for them.</div>	ServiceReading	4	2025-01-29 01:49:11.280883	2025-02-06 02:00:12.710929
45	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p>    It’s been eight years since I stopped drinking and nine since my divorce. I’ve got a son, Dylan, who lives with my ex in Stockton, about 600 miles away. Dylan turned eleven last fall.</p>\r\n<p> </p>\r\n<p>    I was a binge drinker. My addiction cost me my first career, and it was a big factor in my divorce from Meghan. I wasn’t a very good husband. Until I stopped drinking, I wasn’t much of a dad either.</p>\r\n<p> </p>\r\n<p>    But Dylan was and is my son. And until recently, Meghan did everything she could to keep me away from him.</p>\r\n<p> </p>\r\n<p>    Our divorce was ugly. Meghan told her lawyer, “Bob is a no-good, useless drunk. The hell with him. I want the house; I want everything in it; I want whatever money we have left; and I want sole custody of Dylan forever.” The judge said yes to everything, and Meghan took Dylan 600 miles away.</p>\r\n<p> </p>\r\n<p>    At that point, I had no wife and no son and no job and no house. That’s when I hit bottom and knew I had to either jump off a bridge or change my life. That’s also when I went to my first Twelve Step meeting.</p>\r\n<p> </p>\r\n<p>    My first year of recovery was very rocky. But once I was back to work—I started fresh with selling cars, and now I’m the assistant manager of a large dealership—things began to improve steadily. I have plenty of regrets about how I used to be, but I’ve got a new life, a girlfriend I’m crazy about, and a great home group.</p>\r\n<p> </p>\r\n<p>    But I still feel a big hole in my life. Dylan. We talk a couple of times a week, and I see him three or four times a year. It always means flying or driving to Stockton. I’ve tried to get Meghan to let him come to Boise, but she always says no.</p>\r\n<p> </p>\r\n<p>    Dylan was so young when we split up. He doesn’t really remember his old, drunk, messed-up dad. All he knows is this sober, loving guy who his mother says terrible things about. Part of him doesn’t understand why his mother talks such trash about me. Sometimes I have to remind him, “Your mother has every reason to resent the man she was married to. I don’t like that guy either.”</p>\r\n<p> </p>\r\n<p>    I did the necessary Step Nine work with Meghan. She was clear about what amends she needed, and I made them all. I’m still making them. I send her a generous amount of child support every month—more than the court requires. She’ll talk to me about Dylan when there’s something we need to discuss. Otherwise, she keeps her distance.</p>\r\n<p> </p>\r\n<p>    The thing is, I want more time with my son. Meghan knows I’m a very different person from the man she married and divorced. But she absolutely refuses to let Dylan come out here. She says, “Ed, I can appreciate who you’ve become. But alcoholics sometimes relapse. If that ever happens with you, I don’t want Dylan to be there by himself, 600 miles from home.” I can’t really argue with that. But for a long time I resented it.</p>\r\n<p> </p>\r\n<p>    The story I want to tell happened a couple of months ago. Dylan called me—which is unusual in itself. We usually talk at times we set up in advance. He was crying. He and Meghan had an old rescue dog, a collie they named Hercules. Hercules was dying, and they were going to have to put him down within the next few days. Dylan was very sad.</p>\r\n<p> </p>\r\n<p>    We spent over half an hour talking about Hercules, who had been part of their family from the time they moved to Stockton. I asked him to tell me stories about his favorite times with Hercules. I let him talk, and mostly listened, and told him how sorry I was that he was losing a family member.</p>\r\n<p> </p>\r\n<p>    Dylan asked, “You don’t mind that I’m crying, do you?” and I said, “Of course not. People cry whenever those lose someone they love.” He nodded and said, “Mom’s crying too. She’s been great about Hercules, but she’s also sad. Mom, are you okay? Dad, I need to go now. Thanks for talking.”</p>\r\n<p> </p>\r\n<p>    After I hung up, I was filled with conflicting emotions. I was pleased to be able to connect with my son, and to be available when he needed me. But I was also a little angry that I couldn’t be there to comfort him in person. And I know this isn’t fair, but I also kind of resented poor Hercules, who’d been able to spend most of his life with Dylan. And I was angry at Meghan for keeping Dylan and me so far apart. Mostly, though, I felt sad for my son. He was far more important than my anger and resentment. Over the next few days, whenever those feelings bubbled up, I’d refocus my attention on Dylan and his grief.</p>\r\n<p> </p>\r\n<p>    A week later, Dylan called again. He still sounded sad, but maybe a bit more thoughtful. He said, “We took Hercules to the vet yesterday and had him put to sleep. Not like sleep at night. The vet injected him with something that killed him and put him out of his misery.”</p>\r\n<p> </p>\r\n<p>    I asked him to tell me what had happened, and he told the story in detail. They had set Hercules on an examining table, and he and Meghan had held the dog while the vet gave the fatal injection. Hercules had licked Dylan’s hand just before the needle went in.</p>\r\n<p> </p>\r\n<p>    Dylan and I talked for almost an hour. I asked him if his mother would get another dog for the family, and he said, “I asked her that question too, and she said, ‘When we’re both ready.’”</p>\r\n<p> </p>\r\n<p>    Eventually he was talked out, and we got ready to say goodbye. Then he said, “When are you coming to visit? I miss you.”</p>\r\n<p> </p>\r\n<p>    After we hung up, I started crying.</p>\r\n<p> </p>\r\n<p>    When I was done, I emailed Meghan. I thanked her for taking such good care of our son, and for being so loving and supportive with him during Hercules’ illness and death.</p>\r\n<p> </p>\r\n<p>    An hour later, I got an email back from her. She’d cut and pasted my line about her being loving and supportive with Dylan. Underneath it she wrote, <em>Back at you. M</em>.</p>\r\n<p> </p>\r\n<p>    After that, my resentment toward Meghan was gone.</p>\r\n<p> </p>\r\n<p>    I called my sponsor and said, “Roy, something really good just happened, but I can’t figure out exactly what.” I told him the story I just told you, and he said, “It sounds like you worked Step Ten without even realizing it.” I said, “Is that bad?” He said, “Hell, no. That’s the best way to work the Steps. It means they’re in your blood.”</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	23	2024-03-28 01:31:50.520478	2024-03-28 01:36:03.735847
