49	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<p>I drank and did coke for four years before my partner Andrea said, “That’s it. It’s either me or the drugs and the booze. You choose.” That’s when I went into treatment.</p>\r\n<p> </p>\r\n<p>I was in an inpatient program in Arizona for almost four months. Our insurance only covered the first sixty days. Andrea wasn’t very happy about that.</p>\r\n<p> </p>\r\n<p>The program was a good one. At first I tried all of my standard bullshit, and none of it worked on anyone. Which was a relief. It had worked on Andrea up until a few months before she laid down the law.</p>\r\n<p> </p>\r\n<p>I went through the usual resistance and denial and withdrawal, and I completely fell apart. My counselors helped me through some dark days. At one point I was ready to kill myself, and they talked me down.</p>\r\n<p> </p>\r\n<p>A few weeks into treatment, I started seriously working the Steps.</p>\r\n<p> </p>\r\n<p>By the time I went home and shifted into an aftercare program, I had worked the first eight Steps, and was well into making amends in Step Nine. I was feeling better than I’d felt in many years. My sanity had returned.</p>\r\n<p> </p>\r\n<p>So I get back, expecting a big welcome home, and maybe even a booze-and-drug-free party. But I get nothing of the sort. At the airport, Andrea gives me a peck on the cheek and says almost zip. When we get home, she lets me in, tells me she has errands to run, and takes off again.</p>\r\n<p> </p>\r\n<p>At first I figure that maybe she’s having a bad day, so I unpack, do some laundry, and make myself comfortable. I tell myself that things will get better.</p>\r\n<p> </p>\r\n<p>But they don’t. Andrea is distant and suspicious. She obviously doesn’t believe I’ve changed. She thinks I’m either faking it or that the changes won’t last, and any day I’ll turn into my old asshole drunk and coked-out self again.</p>\r\n<p> </p>\r\n<p>When I try to talk about it, she just says angrily, “Not now, okay?” or goes into the other room. As for sex, after four months of celibacy I’m more than ready but Andrea isn’t interested.</p>\r\n<p> </p>\r\n<p>I mean, I get all this. She’s still angry at me for four years of bullshit. She’s entitled to her anger. But she’s also giving me zero credit for who I’ve become. It seems to me that she wants me to go back to drugging and drinking.</p>\r\n<p> </p>\r\n<p>I talk to Tori, my aftercare counselor, about this. She says, “Jen, you can take the booze and the drugs out of a home, but you can’t take the history out of it. Andrea is probably very scared and very confused. You’re no longer the person she lived with for years. She adapted to your addiction and your unpredictability. Now that you’re sober, clean, sane, and predictable, she has no idea how to act around you. Because you’ve changed, she has to, too, if she’s going to be in relationship with you. It probably scares the hell out of her.”</p>\r\n<p> </p>\r\n<p>So I say to Tori, “Here’s what I don’t understand. If I’d come back exactly the same person I was before treatment, Andrea would be angry and resentful because I wasn’t any better. But now, because I’m better, she’s angry and resentful.”</p>\r\n<p> </p>\r\n<p>Tori just laughs and says, “Welcome to recovery. Are you working Step Ten?”</p>\r\n<p> </p>\r\n<p>At this point I feel like working Step Ten 24/7. I’m trying hard to walk the line between responsibility and codependence. Every time I do anything wrong—forget an item at the grocery store, misplace my keys, leave the basement light on after I come back upstairs—I say to Andrea, “My bad, hon. I’ll make it right.” Usually she just shrugs and says, in a robot-like voice, “It doesn’t matter.”</p>\r\n<p> </p>\r\n<p>So now I’m starting to get pretty pissed off too.</p>\r\n<p> </p>\r\n<p>Finally, after about two weeks of being home, we’re sitting on the couch watching a movie—it was Moonstruck, with Cher and Nicolas Cage—and I reach over and take her hand. She quickly pulls it away. And then something opens up inside me.</p>\r\n<p> </p>\r\n<p>I grab the remote, turn off the video, and stand up in front of her. I start to talk, in a voice I barely recognize—strong and calm and 100 percent serious. I have no idea what I’m even going to say. The words are just coming, without my thinking them.</p>\r\n<p> </p>\r\n<p>I say, “Baby, for years I treated you like crap. I’ve told you that several times, but maybe I haven’t told you enough. For all those years I was a total self-centered jerk. I have no idea why you put up with me for as long as you did. You deserve much better.</p>\r\n<p> </p>\r\n<p>“Now I’m trying as hard as I can to be the person you deserve. I’m working the Program day by day, going to meetings, and trying to be a decent human being. I’m going to screw up sometimes, but when I do, I’ll hold myself accountable and make amends. Maybe it’s already too late. Maybe I’ve hurt you too much, done too much damage. If that’s what’s going on, just tell me, and I’ll pack up and clear out.”</p>\r\n<p> </p>\r\n<p>Then I shut up. I just stand there, breathing hard. I’ve got no more words.</p>\r\n<p> </p>\r\n<p>For a couple of seconds, it’s like we’re both frozen in place. Then Andrea starts to sniffle. Then she leans over and starts to sob. Then she starts to howl, like a dying animal.</p>\r\n<p> </p>\r\n<p>I’m standing there in shock. Andrea is bent over, tears pouring out of her eyes, making noises I’ve never heard a human being make before. Meanwhile, I’m thinking, It sounds like someone’s being murdered. The neighbors must have called the police by now.</p>\r\n<p> </p>\r\n<p>Andrea falls on the floor, still howling. She starts shaking so hard that I wonder if she’s having a heart attack. That’s when the question forms in my head: How can I be of service right now?</p>\r\n<p> </p>\r\n<p>I get down on the floor beside her, wrap my arms around her from behind, and hold her hard and close for the next five minutes, while she cries and shakes and makes animal noises, until finally the pain has worked its way through her.</p>\r\n<p> </p>\r\n<p>And that’s what it took for things between us to begin to heal.</p>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>	Reading	25	2024-04-11 02:36:11.395497	2024-04-11 02:39:18.034201
50	topic	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content"> \r\n<ul>\r\n<li>The challenges/transformations of addiction/recovery.</li>\r\n</ul>\r\n<ul>\r\n<li>Rebuilding trust and connection after significant personal growth and change.</li>\r\n</ul>\r\n<ul>\r\n<li>The importance of empathy, communication, and vulnerability.</li>\r\n</ul>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>	Reading	25	2024-04-11 02:36:11.416815	2024-04-11 02:39:18.133824
47	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<div class="trix-content">\r\n<h2>External Reminders</h2>\r\n<p> </p>\r\n<p>Sometimes you need to reach out more than you need to reach in. Here are some phrases to help you quickly connect to the spiritual guidance of your Higher Power:</p>\r\n<p> </p>\r\n<p>• I need your help or Please help me or just Help!</p>\r\n<p> </p>\r\n<p>• Please guide me or Tell me what to do.</p>\r\n<p> </p>\r\n<p>• Thy will be done or I’ll do whatever You say.</p>\r\n<p> </p>\r\n<p>• Thank you: a quick and easy way to remember to be grateful for whatever you have, even when there’s trouble.</p>\r\n<p> </p>\r\n<h2>When Someone Is Treating You Badly</h2>\r\n<p> </p>\r\n<p>No life is free of conflicts. As we work the Program, we try as much as possible to resolve conflicts through listening, loving and mindful discussion, compromise, or a blend of these.</p>\r\n<p> </p>\r\n<p>Inevitably, though, conflicts with some people will persist or seem unresolvable. Here are some helpful practices for navigating them:</p>\r\n<p> </p>\r\n<p>• Show the other person the same tolerance, pity, and patience you would cheerfully grant a sick friend. If you have trouble doing this on your own, ask your Higher Power for help. (You’ll recognize this practice from page 67 of the Big Book.)</p>\r\n<p> </p>\r\n<p>• Ask yourself, How can I be most helpful to this person? If necessary, ask your Higher Power the same question. Once you know the answer, act on it.</p>\r\n<p> </p>\r\n<p>• If a harmful emotion or impulse bubbles up inside you, ask your Higher Power to remove it. This is the purest, simplest form of using Step Ten to work Step Seven.</p>\r\n<p> </p>\r\n<p>• If you’re about to say something you know you’ll regret, physically intervene on yourself. Literally bite your tongue. Or inhale and exhale quickly instead of speaking. Repeat as necessary.</p>\r\n<p> </p>\r\n<p>• Follow Emmet Fox’s advice and focus on God. Imagine the other person as a manifestation of the Divine All. Or picture that person bathed in love and Divine light. Or hold in your heart that person’s pure spiritual nature. Or simply beam love in that direction. It may also help to simply ignore what the person is saying.</p>\r\n<p> </p>\r\n<p>• Follow the lead of the recovering addict who wrote “Freedom from Bondage” in the Big Book (pages 544–553). Think of all the good things you would like for yourself. Then wish—or pray—that the person you’re in conflict with would get all of those good things. Do this repeatedly, if necessary.</p>\r\n<p> </p>\r\n<p>• If things keep getting worse, quickly remove yourself from the situation. Say, “Could you hold that thought? I need to step away briefly and take five.” Or “I’m not at my best right now; let me take a minute to collect myself . . . I’ll be right back.” Then leave. Take a few minutes to mentally review what just occurred and do a quick inventory, say one of the slogans or the Serenity Prayer, or do a quick Step Ten if you need to, and then return. If it’s clear that further interactions with the person won’t help, go back and say, “I don’t think we’re getting anywhere; I need to go and maybe we can pick this up another time when we’re both in a better place.”</p>\r\n<p> </p>\r\n<p>• When all else fails, end the conversation. Say “I need for us to just end this and move on” or “Let’s just agree to disagree.” Then walk away. This doesn’t solve the conflict, but it usually keeps things from unraveling further.</p>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>	Reading	24	2024-04-04 03:18:59.287977	2024-04-04 03:21:08.463311
