51	content	<div class="trix-content">\r\n<p>A variety of Step Ten inventory sheets are available for recovering people to fill out at the end of each day. These ask questions such as How was I selfish? How was I resentful? How was I dishonest? How did I demand control? Who did I hurt and how? Did I keep any secrets? What could I have done better? and so on. (For samples, type “Step Ten inventory” into your search engine.)</p>\r\n<p>These inventories can be very helpful, especially for people just beginning to work Step Ten. But this programmed approach can also limit how people view the Step.</p>\r\n<p>Here are some other options for making the most of predesigned inventories:</p>\r\n<p>• Add some personalized questions and create your own process for working with them. For example, if one of your character defects is excessive self-sacrifice, you might add to your inventory How many times today did I say “I’m sorry?” If you tend to dominate conversations, add the question How many times today did I interrupt people? If you’re quick to focus on self-interest, add the question How many times today did I ask myself, “What’s in it for me?”</p>\r\n<p>• Each morning, review your inventory questions—not as a review of your own past actions, but as a way to help ground and orient you for the day. Then mentally walk through the day to come, reviewing your goals, hopes, and plans. Note any potential trouble spots and reflect on how you plan to handle them.</p>\r\n<p>• Post your inventory in a prominent place in your kitchen, or above your desk, or as your screen saver. Each day, simply review it for thirty to sixty seconds. Let the questions sink deeply into you, day by day, until they become a part of you.</p>\r\n<p>As you continue to grow into the Steps—and as they take deeper root in you—even the words every day will take on new meaning. You will move from working Step Ten daily, to working it whenever it can be helpful, to living the Steps at all times. Eventually, living the Twelve Steps will become as natural and automatic as breathing—something you do not just every day, or day by day, but moment by moment, in every moment. Your life will then no longer be your life, but a life shared with others. It will be an ongoing, ever-unfolding spiritual experience.</p>\r\n</div>	Reading	26	2024-04-18 03:59:00.105694	2024-04-18 04:04:31.336356
