53	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<p>After the ship Recovery has been sailing for some time, one of the passengers suddenly shouts, “I see land!”</p>\r\n<p> </p>\r\n<p>Following the sound of his voice, most of the friends rush to the starboard rail and peer at the horizon. Sure enough, a sliver of beach has appeared.</p>\r\n<p> </p>\r\n<p>Slowly the boat approaches the shore. Soon the friends can make out trees and a dock, and, just beyond it, what looks like a waiting passenger train. The ship blows its horn, and a moment later a voice booms out over the loudspeakers.</p>\r\n<p> </p>\r\n<p>“Ladies and gentlemen, this is your captain. We’re now approaching Serenity Island. In a moment I’ll cut the engines and we’ll begin the last part of our approach. I’ll join all of you on deck shortly.” A few seconds later, the boats engines stop throbbing. Gradually the boat slows until, after a few minutes, it is barely moving.</p>\r\n<p> </p>\r\n<p>The captain—a smiling, elderly woman in a white uniform—climbs down from the wheelhouse and begins greeting passengers. As she shakes hands with Mary and Ramon, Ramon asks, “Why aren’t we moving? We’re still a good quarter mile from shore.”</p>\r\n<p> </p>\r\n<p>The captain nods. “This is as close as the boat can sail. From here to the shore, the water is very shallow.” She gestures to a shed on the deck behind her. “In a moment my crew will hand out life rings. You’ll need to swim the rest of the way.”</p>\r\n<p> </p>\r\n<p>“Swim?” Ramon asks. “I didn’t expect I’d have to swim. It’s been a long day and I’m tired.”</p>\r\n<p> </p>\r\n<p> </p>\r\n<p>The captain raises her eyebrows but maintains her smile. “Recovery is a journey, but it’s not a pleasure cruise. Once you’re on board, there’s guidance and momentum, but you can’t just kick back and become complacent.”</p>\r\n<p> </p>\r\n<p>“But I can’t swim!” the young man next to Ramon says. The captain nods again. “That’s why we have life rings. Each of you will put one on, and you’ll help each other get to shore.”</p>\r\n<p> </p>\r\n<p>Mary points toward the beach. “Where does the train go?” she asks the captain. “I can’t quite make out its destination sign from here. Wait . . . there’s an R. It says . . . it says, Recovery.”</p>\r\n<p> </p>\r\n<p>“That’s right,” the captain says. “The journey of recovery never ends— but over time the geography changes. So sometimes the journey is by water, sometimes by land. And sometimes even by air.” She points up at the sky above the island. Rising slowly into it, in the far distance, is a brightly colored passenger balloon with a large R painted on the side. In the basket beneath it, just barely visible, is a group of waving people.</p>\r\n<p> </p>\r\n<p>“Do you think they’re waving at us?” Mary asks.</p>\r\n<p> </p>\r\n<p>“Of course,” Ramon says. “And I’ll bet they’re shouting, ‘Hey, friends! Jump in—the water’s fine.’”</p>\r\n</div>\r\n</div>	Reading	27	2024-04-24 18:47:49.399622	2024-04-24 18:48:59.057907
