77	content	<div>Sometimes we get what we want right away. At other times, we wonder if our desires will ever be fulfilled.<br><br>We will be fulfilled in the best way possible and as quickly as possible. But some things take time. Sometimes, we have lessons to learn first, lessons that prepare us so we can accept the good we deserve. Things are being worked out in us, and in others. Blocks in us are being removed. A solid foundation is being laid.<br><br>Be patient. Relax and trust. Let go. Then, let go some more. Good things are planned for us. We will receive them at the first available moment. We will have all our heart longs for.<br><br>Relax and trust.<br><br>Today, I will identify what I want and need; then, I’ll be willing to let go of it. I will devote my energy to living my life today, so I may master my lessons as quickly as possible. I will trust that what I want and need is coming to me. I will let go of my need to control the details.<br><br></div>	Reading	39	2024-09-02 03:39:46.03496	2024-09-02 03:39:46.03496
