55	content	<div class="trix-content">\r\n<p>There’s an engine that’s always on in each of us. This engine creates an ongoing feedback loop of internal ripples that looks like this:</p>\r\n<p> </p>\r\n<p>• The condition of my character shapes my thinking.</p>\r\n<p>• The condition of my thinking shapes my decisions.</p>\r\n<p>• The condition of my decisions shapes my actions.</p>\r\n<p>• The condition of my actions shapes my practices and habits.</p>\r\n<p>• The condition of my practices and habits shapes my character.</p>\r\n<p> </p>\r\n<p>    As we work Step Ten, we steadily strengthen our ability to observe all aspects of this internal process. This helps us make conscious and loving choices, rather than impulsive or fearful ones.</p>\r\n<p> </p>\r\n<p>    The people who founded Alcoholics Anonymous didn’t think in terms of this engine, but they were keenly aware of its elements. Steps One and Two cover our thinking. Step Three covers our decisions. Steps Four through Nine cover our actions. Steps Ten and Eleven cover our practices and habits. And Step Twelve covers our character. Twelve Step Programs offer healing and transformation at every point in this loop.</p>\r\n<p> </p>\r\n<p>    Other programs for addressing addiction intervene at specific spots in the loop, but not throughout the entire loop. For example, rational behavioral therapy intervenes at the points of thinking and action. Reality therapy intervenes at the point of action. These and other helpful interventions help people stay out of trouble in the short term and change their behavior for the better. But they’re not spiritual programs that lead to transformed lives.</p>\r\n<p> </p>\r\n</div>	Reading	28	2024-05-09 03:29:21.227414	2024-05-09 03:30:35.662108
