59	content	<div class="trix-content">\r\n<p>As we practice Step Ten, we also are open to the ripples of unfolding events —to what psychiatrist Carl Jung called <em>synchronicity</em>.</p>\r\n<p> </p>\r\n<p>When we were in the throes of our addiction, we tried harder and harder to control events, other people, and ourselves. This proved unsustainable and unmanageable. Eventually we crashed and burned. Now, as our recovery matures, we no longer try to manage and control the world. We know that’s impossible. We also know that it can be the road to relapse.</p>\r\n<p> </p>\r\n<p>We understand that we simply cannot know what will happen next, no matter what we do. We have seen, many times, events evolve in ways we could never have imagined. We have experienced remarkable, unexpected, and unpredictable turns of events that were perfect for everyone. We have been part of spiritual experiences that we could not possibly have crafted, planned, caused, or controlled on our own.</p>\r\n<p> </p>\r\n<p>Eventually we lose any desire to impose our own personal will, because we know that our role in life is to rely on spiritual direction instead of the direction of self (ego) and then to carry those directions out in all our affairs.</p>\r\n<p> </p>\r\n<p>What happens to us is important. But as we work Step Ten, we come to see that what’s far more important is the integrity of our response to what happens.</p>\r\n<p> </p>\r\n<p>What happened to us is our history. The integrity of our response is our future. And, through the Ripple Effect, our response will have an effect on the future of the world.</p>\r\n</div>	Reading	30	2024-05-23 02:58:38.317476	2024-05-23 02:59:29.122137
