57	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<p>Because we have developed our own internal discernment, we also get better at noticing the subtle cues others give us about what is going on inside them. We notice their posture and the flow of their gestures. We hear the cadences and tone of their voice. We see the look in their eyes and the way they make (or avoid) eye contact. We cannot read minds, but we can learn to feel the energy of other people’s bodies as it ripples out and through our own.</p>\r\n<p> </p>\r\n<p>    When we observe a change in someone else’s presence, we are also able to examine it rather than simply react to it. Why does Jackie suddenly sound protective and defensive? Did I say something that bothered her? But all I said was, “How’s your brother doing?” in a friendly tone. Part of me wants to get defensive myself and say something snarky. But that will do neither of us any good. I wonder if something else is going on. The only way I’m going to find out is to check it out. Here goes. “Are you okay? I didn’t mean to pry.”</p>\r\n<p> </p>\r\n<p>    This discernment also enables us to recognize when we’ve acted fairly and compassionately and when we haven’t. If Jackie responds to our question with “I really don’t want to talk about it,” we neither defend ourselves nor blame ourselves. We simply say something such as “I understand,” and change the subject.</p>\r\n<p> </p>\r\n<p> </p>\r\n</div>\r\n</div>	Reading	29	2024-05-16 03:04:07.68165	2024-05-16 03:05:49.88409
