61	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<p>It is plain that a life which includes deep resentment leads only to futility and unhappiness. To the precise extent that we permit these, do we squander the hours that might have been worthwhile. But with the alcoholic, whose hope is the maintenance and growth of a spiritual experience, this business of harboring resentment is infinitely grave. For then we shut ourselves off from the sunlight of the spirit. The insanity of alcohol returns and we drink again. And with us, to drink is to die.</p>\r\n<p> </p>\r\n<p>If we were to live, we had to be free of anger. The grouch and the sudden rage were not for us. Anger is the dubious luxury of normal men, but for us alcoholics it is poison.</p>\r\n</div>\r\n</div>	Reading	31	2024-05-31 03:57:49.775038	2024-05-31 03:58:39.771589
