69	content	<div class="trix-content">\r\n<div class="trix-content">\r\n<blockquote>\r\n<h3><em>Let yourself have a good gripe session.</em></h3>\r\n</blockquote>\r\n<p style="text-align: right;">—WOMEN, SEX, AND ADDICTION<br>BY CHARLOTTE DAVIS KASL, PH.D.</p>\r\n<p> </p>\r\n<p>Get it out. Go ahead. Get it all out. Once we begin recovery, we may feel like it’s not okay to gripe and complain. We may tell ourselves that if we were really working a good program, we wouldn’t need to complain.</p>\r\n<p> </p>\r\n<p>    What does that mean? We won’t have feelings? We won’t feel overwhelmed? We won’t need to blow off steam or work through some not-so-pleasant, not-so-perfect, and not-so-pretty parts of life?</p>\r\n<p> </p>\r\n<p>    We can let ourselves get our feelings out, take risks, and be vulnerable with others. We don’t have to be all put together, all the time. That sounds more like codependency than recovery.</p>\r\n<p> </p>\r\n<p>    Getting it all out doesn’t mean we need to be victims. It doesn’t mean we need to revel in our misery, finding status in our martyrdom. It doesn’t mean we won’t go on to set boundaries. It doesn’t mean we won’t take care of ourselves.</p>\r\n<p> </p>\r\n<p>    Sometimes, getting it all out is an essential part of taking care of ourselves. We reach a point of surrender so we can move forward.</p>\r\n<p> </p>\r\n<p>    Self-disclosure does not mean only quietly reporting our feelings. It means we occasionally take the risk to share our human side—the side with fears, sadness, hurt, rage, unreasonable anger, weariness, or lack of faith.</p>\r\n<p> </p>\r\n<p>    We can let our humanity show. In the process, we give others permission to be human too. “Together” people have their not-so-together moments. Sometimes, falling apart—getting it all out—is how we get put back together.</p>\r\n<p> </p>\r\n<h3>    <em>Today, I will let it all out if I need a release.</em></h3>\r\n</div>\r\n</div>	Reading	35	2024-07-18 03:54:23.781025	2024-07-18 03:55:54.72722
