87	content	<div>There are many paths to self-care with families. Some people choose to sever connections with family members for a period of time. Some people choose to stay connected with family members and learn different behaviors. Some disconnect for a time, then return slowly on a different basis.<br><br>There is no one or perfect way to deal with members of our family in recovery. It is up to each of us to choose a path that suits us and our needs at each point in time.<br><br>The idea that is new to us in recovery is that we can choose. We can set the boundaries we need to set with family members. We can choose a path that works for us, without guilt and obligation or undue influence from any source, including recovery professionals. Our goal is to detach in love with family members. Our goal is to be able to take care of ourselves, love ourselves, and live healthy lives despite what family members do or don’t do. We decide what boundaries or decisions are necessary to do this.<br><br>It’s okay to say no to our families when that is what we want. It’s okay to say yes to our families if that feels right. It’s okay to call time-out and it’s okay to go back as a different person.<br><br></div><blockquote><em> God, help me choose the path that is right for me with family. Help me understand there is no right or wrong in this process. Help me strive for forgiveness and learn to detach with love, whenever possible. I understand that this never implies that I have to forfeit self-care and health for the good of the system.</em></blockquote><div><br></div>	Reading	44	2024-10-03 03:18:26.817994	2024-10-03 03:18:26.817994
