91	content	<div>It was late one night. I was sitting home on the edge of my bed and into my room flew a red macaw that landed on my shoulder. “You shot the sheriff,” it squawked in my ear. “You shot the sheriff!” As soon as it came, it flew away. But I knew the cops were after me and told my therapist that the next day. The next thing you know, I was being carted off to the psych ward for the tenth time in my three and a half years sober, due to my schizophrenia and bipolar illness.<br><br>I was 24 when I came into AA. I remember reading the Second Step and immediately thinking that AA could cure my mental illness. I was off my meds for 26 days before I was brought to the hospital by an ambulance that my sponsor had called. It took me a year or two before I figured out that I had to stay on my meds in order for them to work.<br><br>When I was early in sobriety, I went to a meeting a day, sometimes two or three. As I was sobering up and my mental health deteriorated, I realized I needed to take care of my mental health in addition to my alcoholism. Now I go to one AA meeting a week, one MICD (mental illness chemical dependency) group, see a therapist and a psychiatrist on a regular basis, attend two support groups for my mental health and meet with my sponsor once a week. This formula has worked for me to balance my alcoholism and mental illness.<br><br>When I first got sober, I dove into the whole spirituality thing. I would pray all the time, read books, go to church. I thought I had reached the pinnacle of spirituality; I could hear God’s voice. He talked to me and I talked back. There is no way to describe the elation experienced with undiagnosed psychotic mania. Then, one day, I was talking to God and he told me to kill myself. Thank God I had the wherewithal to run to my sponsor and she told me to go to the hospital immediately. The next two years of my life were spent in and out of the hospital, in and out of reality. But I stayed sober.<br><br>In “How It Works,” it states: “There are those, too, who suffer from grave emotional and mental disorders, but many of them do recover if they have the capacity to be honest.” If I were to be honest with myself, I frequently did not have the capacity to be honest, due to my mental illness. My sponsor at the time and I would frequently joke, “I don’t need a Power greater than myself; I need a Power saner than myself!” So I used those around me to keep me safe and sober until I could have the capacity to be honest back.<br><br>In looking at what I’ve been through so far in my sobriety, I have every reason to be discontented. I lost my job due to my mental illness and I am living on disability with my family. But I am content. I trust my Higher Power has a plan for me. I used to measure my happiness by my success, but now I don’t need anything to bring me happiness. AA has taught me to accept what life throws at me, and so—at any moment, no matter what’s going on in my life—my happiness comes from within.</div>	Reading	46	2024-10-21 02:40:44.828358	2024-10-21 02:40:44.828358
