93	content	<div>I first came to AA at the age of 18. I had been drinking alcoholically since I was 13 and my teenage years were filled with problems—legal trouble, being expelled from school, my mom kicking me out of the house at age 17. Even at that age I was already akin to the Dr. Jekyll and Mr. Hyde mentioned in the Big Book. I, too, was never “mildly intoxicated” but  always “insanely drunk.”<br><br>Within eight months of getting my driver’s license I already had two DUI’s. I asked mom to help me out and she got me into a treatment center through her employer’s insurance plan. I went to a 28-day program and then a long term seven month program and when I got out I was already on Steps Eight and Nine. I began going to meetings daily, got a sponsor, got involved in service work, began sponsoring other young men and as a result I stayed sober for four years. But when I had four years and three months, my mother passed away from a brain aneurism at the young age of 46 and I began going to fewer meetings, stopped doing service work and working with other alcoholics and before my fourth year was up I relapsed.<br><br></div><div> It didn’t take long before I was back drinking just as bad as I did at age 18. I soon received my third DUI, lost my driver’s license,  completed a couple of 28 day programs but just couldn’t keep from returning to that first drink. So began my attempts at geographical cures. Over a two year period, I moved to four different states via Greyhound bus and finally landed in Texas, where my consequences became more serious. I committed two felonies, had my probations revoked, and spent 27 months in prison. <br><br></div><div>When I got out I was dead serious about staying sober, but I failed to enlarge my spiritual life and soon after my release I had talked myself into that first drink—again. The next years were filled with many attempts at regaining my sobriety with many returns to the first drink. I had also gotten addicted to a few other hardcore substances throughout the years and at the age of 50, I found myself in a men’s recovery house in a new city a thousand miles away from Texas. I was there for ten days, got drunk and got kicked out. I found myself at a homeless shelter downtown, completely bankrupt, mentally, emotionally, financially, and spiritually.<br><br></div><div> Hope was now officially gone. How could there possibly be hope for a guy like me?<br><br></div><div>I had been going to a lot of meetings while at this recovery center and I so badly wanted to want sobriety. I asked God to please do with me what he would and take this insanity away from me. A gentleman in a suit came and spoke to us in the dining hall that night. From the podium, he said the words that would change my life: “Just one year ago I was sitting in that folding chair just like you, staring at the floor just like you, thinking there was no hope for me, just like you, and I asked God to take over from here and said I will do whatever you need me to do.” <br><br></div><div>I got it—I finally got it. At last, I surrendered and understood that I was powerless over alcohol and that without God’s help there was no hope. I was sleeping on a mattress on a floor with a hundred other men sleeping on the same floor but I was at peace inside. I knew I was done and I knew that I was willing to do whatever was required to not return to that first drink. It has now been almost nine years and I have not returned to the insanity of that first drink. All that is required is that I follow a few simple rules. Trust God, Clean House, Help Others!<br><br></div><div>I got my driver’s license back after 27 years of not having one. I have zero legal issues. I have a loving beautiful wife and a life that I could never have imagined possible. <br><br></div><div>My mom passed away when I had four years three months sober and I relapsed. And my father also passed away when I had another four years three months sober, but this time I stayed sober. I was able to be there for my father and to be the son he needed me to be all because of a loving God who reached into the mire and lifted me out when I was ready and because of the program of Alcoholics Anonymous.  <br><br></div><div>You do not need to relapse to get this thing. Daily reprieve based on the maintenance of my spiritual condition is what changed my life. It is that simple—one day at a time.<br><br></div>	Reading	47	2024-10-28 03:55:58.060015	2024-11-08 04:12:24.971837
