99	content	<pre><strong>Trigger Warning:</strong> This reading discusses sensitive topics, including \r\nsuicide, grief, trauma, and struggles with mental health. \r\nIf these themes are difficult for you, please take care of yourself\r\nas needed, and know that support is available within the fellowship.</pre><div><br>It was December of 2018. I had called the police multiple times. After that last call, when she wouldn’t answer her phone, I had an ominous feeling. <br><br></div><div>“I’ve got a bad feeling,” I texted my friends. Then I waited alone in that uncomfortable dread for a phone call back from the police. When the officer did call me back, it was not good news. She was dead. There was a gun and it was fatal. There can be no worse feeling, except for the call to her family to tell them the tragic news.<br><br></div><div>I don’t know why I continue to suffer from the delusion that because I’m sober, years sober, that I have somehow developed superhuman capabilities, so the pain of this world doesn’t affect me. I’m acutely aware today just how fragile I am, and I’m consciously working on attempting to tell myself it’s OK that I hurt. I know this because when my beautiful friend died by suicide in December, I was forever changed.<br><br></div><div>She was like so many of the alcoholics we meet, struggling with staying sober, in and out of rehabs, detoxes, ERs and hospitals. I had known her for six years. I had sponsored her, been her friend and loved her like my own child. And it wasn’t like she didn’t try. She would do anything I suggested, get in the car, get on a plane, do what we do. But the disease always overtook her.<br><br></div><div>This may seem like an outside issue, but I believe I’m not alone, and it deeply affects us in the rooms. No one talks about the vicarious trauma that can occur with working with others in the program. So, here are a few facts. Nearly 90% of all suicides that occur are associated with a diagnosable mental health or substance-abuse disorder. The likelihood of suicide in diagnosed alcoholics is between 60 and 120 times that of the non-psychiatrically ill individual. That’s high, extremely high. My friend was not my first AA friend to die from suicide, but she was my closest loss. And I know I’m not the only one touched by this loss in AA. Do we talk about it in any of our literature? Do we often treat our emotional sobriety as an outside issue?<br><br></div><div>What are the common themes among those who attempt suicide? Feelings of hopelessness, despair, isolation. Sound familiar? I know I have felt the same feelings in the last 10 months since her death, isolated by my feelings of loss, hopeless to be able to save someone’s life. I’m fortunate. I have been surrounded by loving members of the Fellowship, and I’m eternally grateful for that support. Yet my pain remains. Being in the middle of this Fellowship means feeling joy like we’ve never felt it, but possibly pain and loss as well.<br><br></div><div>Based on the statistics, we alcoholics have a higher likelihood that we will be exposed to this pain and tragedy at some point. Can we find compassion and empathy for those who have experienced this? Can we not make callous remarks, such as, “So and so went back out so we don’t have to,” or, “They died so we can live.” Many people don’t realize the additional pain they can cause with these remarks. <br><br></div><div>I don’t have all the answers. I’m just profoundly aware that this topic affects many of us. I wish we could find a way to help each other more. I know today to reach out to those who listen and will give me the space to grieve. I don’t judge myself for feeling sad. And I share my pain. I know it’s difficult sometimes in an AA meeting filled with laughter and humor to share that which is not funny or happy, but this is where I am today. Recovery has taught me the only way through something is through it. To thine own self be true.<br><br><br></div>	Reading	50	2024-11-11 03:10:14.113413	2024-11-11 03:11:50.079107
103	content	<div>The belief that life has to be hard and difficult is the belief that makes a martyr.<br><br>We can change our negative beliefs about life, and whether we have the power to stop our pain and take care of ourselves.<br><br>We aren’t helpless. We can solve our problems. We do have power—not to change or control others, but to solve the problems that are ours to solve.<br><br>Using each problem that comes our way to “prove” that life is hard and we are helpless—this is codependency. It’s the victim trap. Life does not have to be difficult. In fact, it can be smooth. Life is good. We don’t have to “awfulize” it, or ourselves. We don’t have to live on the underside.<br><br>We do have power, more power than we know, even in the difficult times. And the difficult times don’t prove life is bad; they are part of the ups and downs of life; often, they work out for the best.<br><br>We can change our attitude; we can change ourselves; sometimes, we can change our circumstances.<br><br>Life is challenging. Sometimes, there’s more pain than we asked for; sometimes, there’s more joy than we imagined. It’s all part of the package, and the package is good.<br><br>We are not victims of life. We can learn to remove ourselves as victims of life. By letting go of our belief that life has to be hard and difficult, we make our life much easier.<br><br></div><blockquote><em>Today, God, help me let go of my belief that life is so hard, so awful, or so difficult. Help me replace that belief with a healthier, more realistic view.</em></blockquote>	Reading	52	2024-11-16 22:56:46.475597	2024-11-16 22:56:46.475597
