106	topic	<ul><li> Avoiding Black-and-White Thinking</li><li> The Dangers of Pedestals and Soapboxes</li><li> Progress, Not Perfection</li></ul>	Reading	53	2024-11-21 02:28:50.253225	2024-11-21 02:28:50.253225
105	content	<div>Whenever I minimize people to a black-and-white comment (What a jerk! What a saint! What a knockout!), I turn the polychromatic into the monochromatic and confuse the snapshot with the big picture. I must remind myself that we are far too colorful to be captured like this, even when doing so makes people easier to accept or dismiss. I also need to refrain from applying this thinking back on myself: At any given time, I am a jerk, a saint, and—having never been a knockout—fat, bald and repulsive. Or so I would have me believe.<br><br></div><div>Who among us alcoholics belongs on a pedestal? Today, I know that whenever I get up on my high horse, the horse takes on a second ass. I also know that soapboxes get more slippery with more height. What’s more difficult for me to accept is that everyone has the right to mount their own high horses and soap boxes. I should not take guilty pleasure in their fall or become indignant when they don’t.<br><br></div><div>We must always keep a “backstage view” of ourselves, acknowledging the audience, yet aware that we are all actors. Honest sharing, warts and all, allows others to peek behind our curtains.<br><br></div><div>When I was drinking, I would stand in front of hundreds of people, waxing wise, knowing full well that I was as high as a kite. I was jaywalking! Pursuing that little thrill of “gettingaway with it.” A few friends knew me well enough to know the truth, but the rest were being duped, or so I thought, until I was clipped and - finally smashed at for all the world to see. Today, when I jaywalk in a meeting or two, my friends pull my covers and keep me honest.<br><br></div><div>It’s painfully obvious when a polished outside job is devoid of a sincere inside job. Yet, when people compliment me on some virtuous behavior, rather than feel guilty that I’m not all that virtuous, I’m thankful that some small part of me is exactly that person. Some of us have spent so many years beating ourselves up that we confuse a pat on the back for another whipping. We’re all God’s children.<br><br></div><div>Thank you for giving me the benefit of the doubt, even after I removed all doubt as to who I was. Thank you for inviting me to keep coming back, knowing that unfamiliar good behavior repetitively applied would eventually replace familiar poor behavior. And thank you that progress not perfection allows me to occasionally get back up on my high horses and soap boxes, even though I know full well: The higher I am, the harder I fall.<br><br></div>	Reading	53	2024-11-21 02:28:50.236324	2024-11-21 02:29:03.509453
107	content	<div>For travel reasons, my family decided to celebrate the Thanksgiving holiday one week early this year. In addition to our large extended family, many friends were invited to join, and we ended up with a total of 46 people, 15 of whom were children under the age of 14.<br><br></div><div>Besides the children, I was the only one at the celebration who doesn’t drink. My family gatherings seem to contain only normal drinkers—people who I would not consider to be alcoholic. Nobody gets sloppy drunk, violent, verbally abusive, angry or overly emotional. Most of the time when I’m at a family gathering, I don’t even notice that people are drinking alcohol.<br><br></div><div>There is always a very well- stocked bar at holiday celebrations, including fancy alcohols and some very tasty-sounding concoctions that I never heard of because I got sober before they went on the market.<br><br></div><div>I never liked the taste of alcohol. I drank strictly for the effect, not the taste. So I always preferred the “foo foo” drinks or the flavored alcohols if I was in a position to get them. Of course, at the end of my drinking, most of the time I would drink whatever I could get my hands on regardless of how it tasted. I wanted—no, I needed—that effect that came at once from taking a few drinks.<br><br></div><div>Frequently during the family holidays, no doubt because I’m a little excluded from the focus on drinking, I tend to find myself feeling different, a little more of an outsider, a little more “not-part-of.” I know these feelings originate within me and have nothing to do with the way my family treats me. I know they all love me, and they treat me with love, respect and kindness.<br><br></div><div> This year I had already helped with setting up the buffet, tables and chairs, place settings and the usual stuff. But once that was done, we had to wait another couple of hours for the food to finish cooking. This is the time everyone looks forward to, when they can relax, have their before-dinner drinks, talk and laugh.<br><br></div><div>I was nursing a glass of water, and feeling like an outsider, feeling useless and beginning to get into self-pity. Why can’t I drink like everyone else? It’s not fair! I thought. I then noticed that the smaller children were bored and running around the house crying, fussing and arguing with each other. They were not having fun at all. Neither was I! I was instantly annoyed that the parents weren’t paying attention to disciplining (insert complaint here) their children at this gathering. Oh no! I could feel myself becoming irritable, restless and discontent! I knew I’d better do something quick. I decided to be of service by keeping the kids occupied.<br><br></div><div>So I got out of my chair, rounded up all the kids, took them outside in the backyard and organized them into playing as many of the old childhood games as I could remember. We played Hide and Seek, Red Light Green Light, Mother May I, Red Rover and Duck Duck Goose. As time went by, some of the teenagers came out and joined in. There was more laughing and fun going on outside than there was inside. The kids were having a ball, and I think I was having more fun than they were! I didn’t even notice how fast the time passed. Before we knew it, it was time for dinner. Because the kids had burned so much energy, they were all (almost) perfect angels during dinner. Not only did I have a blast keeping the kids happy and occupied, but that feeling of uselessness and self-pity had disappeared. I had lost interest in selfish things and gained interest in my fellows.<br><br></div><div>I had such a great time this year.maybe I will make playing with the kids part of my normal holiday routine from now on!<br><br></div>	Reading	54	2024-11-28 01:02:16.750412	2024-11-28 01:02:16.750412
108	topic	<ul><li> Overcoming Feelings of Being an Outsider </li><li> Transforming Self-Pity into Service </li><li> Finding Joy in New Traditions </li></ul>	Reading	54	2024-11-28 01:02:16.761729	2024-11-28 01:02:16.761729
109	content	<div>It was a 7:00 A.M. meeting. I couldn’t believe that the people, who I didn’t even know, were all laughing and drinking coffee. But I thought they were laughing at me.<br><br>I knew I needed help to stop drinking. I tried and tried to stop on my own so many times and I could not stop. I just couldn’t do it. I was wondering how this group of people could help. And now I felt like they were laughing at me<br><br>I had pulled my car into the church parking lot earlier looking for the meeting. I saw the other cars but didn’t know exactly where the meeting was. Finally, as luck would have it—or bad luck would have it—this very tall lady saw me and told me to follow her. I was ready to make a run for it, but she kind of herded me toward the right door. She never touched me, but I felt like her long crossed arms wouldn’t let me run. I (we) got to the door, and I was in.<br><br>My idea of running away was still the most likely thing I could think of to do, but I was too polite to run. The first thing I saw was a guy with a bomb tattooed on his upper arm. You know, the cartoon kind of bomb, black and round with a fuse. When I checked out the people in the front row, they all wore long-sleeved shirts. I knew their tattoo bombs were under there. I knew this was a cult, only they didn’t tell me the password to get in—and they didn’t tell me I needed to have a bomb tattoo. Soon I learned the password and it was: Meeting makers make it. I was soon to find out what that meant.<br><br>I was offered a seat by the very tall lady, and she got us coffee. The coffee was good, very strong, the kind that would grow hair on your chest, they said. Why the heck would I want to have a hairy chest, except to date a gorilla? A gorilla is probably nicer than some people I know. I was then told that the coffeemaker job was the best job in the world. I worked in a restaurant and bar and I knew how to make coffee. I was able to smile and even laugh. I was a nurse for 40 years. Nurses are coffee connoisseurs. The bolder the better.<br><br>This was a big meeting, very big, and the people read from this book called Daily Reflections. The book was full of short little stories and each person spoke. There were more than 80 people at the one-hour meeting and each person talked about the reading in one hour!<br><br>Some of the speakers were low talkers and you couldn’t hear them. Some yelled the message so loud you could hear them at the Cape Cod Canal. There were slow talkers and fast talkers. I’m a fast talker and so felt right at home.<br><br>I went back to that meeting again. The very tall lady with the crossed arms didn’t show up and I was kind of glad. I found out that there was no president of the group, although some people thought they were.<br><br>Each person has their own seat (like at church), and out of courtesy it was left empty for them. When you are new, just ask someone where to sit. I heard that people were there to claim their seat. I wasn’t quite sure what that meant. Did we get to take our chairs home? They were pretty nice chairs.<br><br>Everyone invited me to come back tomorrow for coffee. I thought these were really nice people. I was to learn later that the group would become the most important people I have ever known. Thank you, Bass River Morning Meeting in Dennis, Massachusetts. You kept me alive.</div>	Reading	55	2024-12-05 03:24:46.363563	2024-12-05 03:24:46.363563
