111	content	<div>One of our choices in recovery is choosing what we want to think— using our mental energy positively.<br><br>Positive mental energy, positive thinking, does not mean we think unrealistically or revert to denial. If we don’t like something, we respect our own opinion. If we spot a problem, we’re honest about it. If something isn’t working out, we accept reality. But we don’t dwell on the negative parts of our experience.<br><br>Whatever we give energy to, we empower.<br><br>There is magic in empowering the good, because whatever we empower grows bigger. One way to empower the good is through affirmations: simple positive statements we make to ourselves: I love myself. . . . I’m good enough. . . . My life is good. . . . I’m glad I’m alive today. . . . What I want and need is coming to me. . . . I can. . . .<br><br>Our choice in recovery is not whether to use affirmations. We’ve been affirming thoughts and beliefs since we were old enough to speak. The choice in recovery is what we want to affirm.<br><br>Today, I will empower the good in myself, others, and life. I’m willing to release, or let go of, negative thought patterns and replace them with positive ones. I will choose what I want to affirm, and I will make it good.</div>	Reading	56	2024-12-12 03:57:17.159251	2024-12-12 03:57:17.159251
114	topic	<ul><li> Acknowledging and Accepting Feelings </li><li> Healthy Emotional Expression </li><li> Balancing Affirmations and Emotional Honesty </li></ul>	Reading	57	2024-12-19 02:40:49.838816	2024-12-19 02:40:49.838816
113	content	<div>Many of us have gotten so good at following the “don’t feel” rule that we can try to talk ourselves out of having feelings, even in recovery.<br><br>“If I was really working a good program, I wouldn’t feel angry.”<br><br>“I don’t get angry. I’m a Christian. I forgive and forget.”<br><br>“I’m not angry. I’m affirming that I’m happy.”<br><br>These are all statements, some of them quite clever, that indicate we’re operating under the “don’t feel” rule again.<br><br>Part of working a good program means acknowledging and dealing with our feelings. We strive to accept and deal with our anger so it doesn’t harden into resentments. We don’t use recovery as an excuse to shut down our emotions.<br><br>Yes, we are striving for forgiveness, but we still want to feel, listen to, and stay with our feelings until it is time to release them appropriately. Our Higher Power created the emotional part of ourselves. God is not telling us to not feel; it’s our dysfunctional systems.<br><br>We also need to be careful how we use affirmations; discounting our emotions won’t make feelings go away. If we’re angry, it’s okay to have that feeling. That’s part of how we get and stay healthy.<br><br></div><blockquote><em>Today, I will refuse to accept shame from others or myself for feeling my feelings.</em></blockquote><div><br></div>	Reading	57	2024-12-19 02:40:49.83016	2024-12-19 02:41:08.30194
115	content	<div>Since family life has suffered more than anything else, alcoholics are wise to work hard to fix things at home. They won’t make progress elsewhere if they can’t show unselfishness and love under their own roofs. We know there are difficult partners and families. But a person getting over alcoholism must remember they played a part in making their own families become difficult.<br><br>When family members start to see their own mistakes and admit them to the others, they pave the way for helpful discussion. The most useful family talks will take place without angry arguments, self-pity, excuses, or resentful criticism. Little by little, mom and the children will realize they are asking for too much. Dad will see he is giving them too little. Giving, rather than getting, will become their shared goal.<br><br>Now imagine that dad has had a life-changing spiritual experience at the beginning of his recovery. It may seem like he has changed overnight. He becomes very religious. He cannot focus on or talk about anything else. Once his sobriety becomes normal, the family may look at their strange new dad nervously. Later, they may feel annoyed with him. He talks about spiritual matters morning, noon, and night. He may insist that everyone in the family find God for themselves, and fast. Or he may seem like he doesn’t care about them at all, and act like he’s better than everyone else. He may tell mom that she doesn’t know what religion is all about, even if she’s been religious all her life.<br><br>When dad acts this way, the family may react angrily. They may be jealous of a God who has stolen dad’s attention and love. They feel grateful that he’s stopped drinking, but they might not like that a Higher Power could heal dad when they could not. They forget that no human power could help him. They might not see why their love didn’t save him. Their jealousy might turn another way. Dad isn’t so spiritual after all, they say. If he’s going to right his past wrongs, why is he focused on everyone in the world except his family? Then he says that God will take care of them. They start to think dad is losing his mind.<br><br>He’s not as unbalanced as they might think. Many of us have experienced dad’s joy and bliss. We have felt spiritual intoxication. Like a skinny, starving gold miner who has just struck gold. We feel unending joy once we are free from our frustrating lives. Dad feels like he has struck something better than gold. For a while, he may try to keep the treasure to himself. He doesn’t see that he has access to an endless supply of riches. Riches that will only make him wealthy if he mines for the rest of his life and gives it all away.<br><br>If the family is patient, dad will see that he is taking his new beliefs too far. He’ll know that his spiritual growth cannot take over his life. A spiritual life that doesn’t include his family might not be so perfect after all. If the family can accept that dad’s behavior is just a phase in his journey, it will pass. An understanding and sympathetic family will help dad grow beyond this stage.</div>	Reading	58	2024-12-21 15:52:35.500447	2024-12-21 16:08:55.819336
