117	content	<div>Sometimes, the holidays are filled with the joy we associate with that time of year. The season flows. Magic is in the air.<br><br>Sometimes, the holidays can be difficult and lonely.<br><br>Here are some ideas I’ve learned through personal experience, and practice, to help us get through difficult holidays:<br><br>Deal with feelings, but try not to dwell unduly on them. Put the holidays in perspective: A holiday is one day out of 365. We can get through any 24-hour period.<br><br>Get through the day, but be aware that there may be a post- holiday backlash. Sometimes, if we use our survival behaviors to get through the day, the feelings will catch up to us the next day. Deal with them too. Get back on track as quickly as possible.<br><br>Find and cherish the love that’s available, even if it’s not exactly what we want. Is there someone we can give love to and receive love from? Recovering friends? Is there a family who would enjoy sharing their holiday with us? Don’t be a martyr; go. There may be those who would appreciate our offer to share our day with them.<br><br>We are not in the minority if we find ourselves experiencing a less-than-ideal holiday. How easy, but untrue, to tell ourselves the rest of the world is experiencing the perfect holiday, and we’re alone in conflict.<br><br>We can create our own holiday agenda. Buy yourself a present. Find someone to whom you can give. Unleash your loving, nurturing self and give in to the holiday spirit.<br><br>Maybe past holidays haven’t been terrific. Maybe this year wasn’t terrific. But next year can be better, and the next a little better. Work toward a better life—one that meets your needs. Before long, you’ll have it.<br><br></div><blockquote><em>God, help me enjoy and cherish this holiday. If my situation is less than ideal, help me take what’s good and let go of the rest.</em></blockquote><div><br></div>	Reading	59	2024-12-26 03:30:50.971129	2024-12-26 03:40:59.069025
121	content	<div>At age 42, I walked in the doors of Alcoholics Anonymous and for the first time in my life I came to feel really safe. I didn’t know right away what the name of it was, but there was something in the rooms I could sense and soon I was feeling it—even as I also often felt that it might work for you, but not me. But I kept feeling it and eventually realized that what I was feeling was hope. The program gave me hope—and when hope enters despair vanishes and depression lifts. Now with 40 years sober, I have found so much more in these rooms.<br><br>One of the things I discovered along the way is that we each need to find our bliss—to “sing our songs.” If we don’t sing them, they will never be sung. We are all unique and we are each here to to live a life that no one else will live for us. Nobody is ever going to come along and say, “Well, I think I’m going to live Bob’s life for him, I can do it better.” Maybe they could, but they aren’t going to do it. So look, and keep looking, until you find what it is you are meant to do—and then do it!<br><br>As I turn 83, it amazes me that I was lucky enough at age 20 to find my way to New York and into the theatre—to be a part of that magic, the song of the theatre—all this time. Because of mistakes I made, I did not get to sing all the songs I was supposed to sing, but as I got sober and back on track, I sang all that I could. And looking back, I can report it provided me with a life full of magic and adventure and was big enough and interesting enough for me so that now I feel whole.<br><br>While I do have some regrets for things missed, they don’t have much hold on me anymore, and I have enormous gratitude for the people and the things that I did not miss. My career was never big and starry, never one that left its mark on the world in terms of fame and fortune, but it made its mark on me and was rewarding to me. For all the missteps and disappointments, there were many accomplishments in my journey from there to here. So regrets, yes, some—even quite a few—but also rewards galore, just of a different size perhaps. They were smaller victories, smaller stars and comets than I wanted and imagined were possible back then along the early way, but they are victories, nonetheless. And now, rather like looking up on a starry night, there have been so many they are hard to count. With acceptance and effort and stamina and commitment, my life renewed and continues to renew every day in sobriety.<br><br></div>	Reading	61	2024-12-30 03:32:33.668175	2024-12-30 03:32:33.668175
122	topic	<ul><li> Discovering Hope in Sobriety </li><li> Finding and Singing Your Unique Song </li><li> Balancing Regrets and Gratitude </li></ul>	Reading	61	2024-12-30 03:32:33.679286	2024-12-30 03:32:33.679286
123	content	<div>I had heard of AA for some time and although I thought I might have a problem I didn't think I was an alcoholic. I figured if I went to a meeting I would be admitting I was an alcoholic and there would be no turning back; I would be doomed for life. I was a person with low self-esteem and quite shy. <br><br></div><div>Anyway, it's not like I drank all day. I would wait until after 5:00 after I got home from work to start. When I stopped working it got a bit earlier, say 4:30. Then a little earlier still, but usually never before 3:30.<br><br></div><div>I had been drinking daily for nearly 40 years when one day at a doctor appointment my doctor went over my recent blood test with me. It turned out my liver enzymes were elevated. I questioned the doctor about the meaning of this and whether I could have cirrhosis of the liver. He said he didn't know, but that I should really consider quitting drinking—now. This scared me. I had heard that cirrhosis was a death sentence and of course my mind immediately went there. So I checked myself into a residential treatment facility for 30 days thinking I'll straighten out my liver and then go back to drinking. You see, I never thought I had hit "bottom" because I never lost a job, home or family over it. (Never mind that I wrecked two or three cars while driving intoxicated. Thankfully they were all single car accidents.) <br><br></div><div>While in this live-in treatment facility, we were watched pretty constantly. We could not go outside unsupervised except to go to an AA meeting or church on Sundays. I went to three AA meetings while I was living there. When I "graduated" they impressed upon me the importance of attending 90 meetings in 90 days. <br><br></div><div>Well, I didn't do that, but I did continue to go to AA meetings. I eventually found my home group which includes some of the most amazing women I have ever known. At age 62 I have now learned more about myself and life that I never knew I didn't know. I am forever grateful for this wonderful group of women. Through AA, my beautiful "sisters" and my sponsor, I have learned how to live life bravely, honestly and sincerely. Best of all, I have grown spiritually since I've been in AA, and I continue to grow.<br><br></div>	Reading	62	2025-01-02 02:49:49.120941	2025-01-02 03:20:26.335225
125	content	<div>The AA program only suggests that newcomers attempt to begin to conceive of a power greater than themselves, in their own individual terms. After that, an oldtimer might suggest to a skeptical newcomer—along with not picking up the first drink—faking prayer and keeping an open mind.<br><br></div><div>I came into this program a drunken atheist. Today, I pray. My being sober is a reflection of the good attributes of some Higher Power; it is not a reflection of any moral virtue or strength of will on my part.<br><br></div><div>This change in a drunken, hardcore, cynical atheist is a miracle beyond human comprehension. However, one aspect of the program has always been required for me to remain sober—results. Prayer works. If prayer didn’t work and show results, I’d become an atheist again today.<br><br></div><div>Spirituality happens to be extremely practical. Prayer, reading the AA literature, going to meetings, using the Steps, and helping another alcoholic all combine to make my life easier and more comfortable, hour to hour, day to day.<br><br></div><div>As an atheist, I faked prayer on a trial basis in the beginning. The results have altered my viewpoint of the cosmos. An unseen realm does exist. I do not attend church, nor have I experienced a spiritual awakening; I’m still a fire-breathing cynic. Yet I pray regularly to something unseen and so vast that I, as a human being, can never understand or even name it.<br><br></div><div>I pray because of the positive results that flow from prayer. I’m a pragmatist. So for today, I have become an agnostic, who occasionally experiences violent swings toward faith. With all the blessings that have been bestowed upon me in a year and a half, I still experience doubts and have not made that quantum leap to faith.<br><br></div><div>All this proves only one thing: that some nuts are tougher to crack than others. Today, I’m still faking prayer and getting results. Maybe God likes nuts, especially the hard ones.<br><br><br></div>	Reading	63	2025-01-16 03:02:07.138899	2025-01-16 03:02:07.138899
