127	content	<h1><em>Trust in God and do something.</em><br>— <strong>MARY LYON</strong></h1><div><br>It’s important to let ourselves grieve as a passage between yesterday and tomorrow. But we do not have to be controlled unduly by our grief, or our pain.<br><br>There are times when we have grieved, surrendered to the heaviness, tiredness, and weariness of a circumstance long enough. It becomes time to break out. It comes time to take action.<br><br>We will know when it’s time to break the routine of grieving. There will be signs within and around us. We will become tired of the heaviness. An idea will occur; an opportunity will present itself. We may think: No. Too much effort. . . . Do it anyway. Try something. Reach out. Stretch. Do something unusual, something different, something special.<br><br>A new activity may help trigger the transformation process. Stay up two hours later than usual! Make an appointment to do something for yourself that is different from what you usually do. Visit someone you haven’t seen in years. Do something to encourage and help the new energy coming your way.<br><br>We may not feel like breaking out of grief. It may feel safer, easier, to remain in our cocoon. Begin pushing out anyway. <br><br>Test the walls of your cocoon. Push. Push a little harder. It may be time to emerge.<br><br><br></div><h1><em>Today, I will trust God and the process, but I will also take action to help myself feel better.</em></h1><div><br></div>	Reading	64	2025-01-23 03:33:46.122763	2025-01-23 03:34:29.03252
129	body	<div>It’s very rare for someone to completely commit to the A.A. program and still fail. People who do not recover are the ones who can’t or won’t follow this simple program. They are usually people who simply cannot be honest with themselves. We don’t meet a lot of people like this, but they do exist. It is not their fault. They seem to have been born that way. But because they cannot be honest with themselves, they are unlikely to succeed in their recovery.<br>   There are also people who suffer from emotional and mental disorders, and join A.A. to address their alcoholism. Many of them do recover if they are able to be honest along their journey.<br>   Many of the stories we share in this book describe experiences that we have had ourselves. We share stories about what we used to be like, what happened to us, and what our lives are like now. If you feel like we did and want to stop drinking, then you are ready to get started. You are ready to take these steps toward recovery.<br>   When we started, some of those first steps scared us. We thought we could find an easier way. But we could not. Since we know this now from our own experiences, we’re asking you to be fearless and thorough from the start. Some of us tried to keep our old ideas, and they just held us back. Until we let go of those ideas, we were unable to make progress.<br>   Remember that we are dealing with a disease. Alcoholism is a confusing and powerful condition that is unlike anything else in the world. Alcohol is extremely complicated, tricky, and difficult. It seems to control and punish people who are addicted to it. Without help, beating alcoholism is too much for one person to handle. We all need guidance from God, support from a Higher Power. And we need to ask for that support with full and open hearts. We stand at a turning point. We ask for God’s protection and care with all the honesty we have.<br><br></div><div>Here are the steps we took, which are suggested as a program of recovery:</div><div><strong>1. </strong>We admitted we were powerless over alcohol—that our lives had become unmanageable.<br><strong>2. </strong>Came to believe that a Power greater than ourselves could restore us to sanity.<br><strong>3.</strong> Made a decision to turn our will and our lives over to the care of God<em> as we understood Him.</em><br><strong>4. </strong>Made a searching and fearless moral inventory of ourselves.<br><strong>5. </strong>Admitted to God, to ourselves, and to another human being the exact nature of our wrongs.<br><strong>6.</strong> Were entirely ready to have God remove all these defects of character.<br><strong>7.</strong> Humbly asked Him to remove our shortcomings.<br><strong>8. </strong>Made a list of all persons we had harmed, and became willing to make amends to them all.<br><strong>9.</strong> Made direct amends to such people wherever possible, except when to do so would injure them or others.<br><strong>10. </strong>Continued to take personal inventory and when we were wrong, promptly admitted it.<br><strong>11.</strong> Sought through prayer and meditation to improve our conscious contact with God<em> as we understood Him, </em>praying only for knowledge of His will for us and the power to carry that out.<br><strong>12. </strong>Having had a spiritual awakening as the result of these steps, we tried to carry this message to alcoholics, and to practice these principles in all our affairs.<br><br>   If this is your first time reading through these steps, they may seem difficult ... or even impossible. Do not be discouraged. No one has ever followed these principles perfectly. We are not saints. We are simply people who are trying to grow, both spiritually and personally. These ideas are here to guide our progress. And our goal is spiritual progress, not spiritual perfection.<br>   In Chapter 4 we shared a description of alcoholics who do not believe in God. Combined with that, we believe the stories of our experiences as A.A. members all boil down to three simple ideas:<br><br>   A. That we were alcoholics and could not manage our own lives.<br>   B. That no human power could have stopped or changed our alcoholism.<br>   C. That God could and would help us if we tried to find God.</div>	ServiceReading	1	2025-01-29 01:33:58.01154	2025-01-29 01:33:58.01154
130	body	<div>Rarely have we seen a person fail who has thoroughly followed our path. Those who do not recover are people who cannot or will not completely give themselves to this simple program, usually men and women who are constitutionally incapable of being honest with themselves. There are such unfortunates. They are not at fault; they seem to have been born that way. They are naturally incapable of grasping and developing a manner of living which demands rigorous honesty. Their chances are less than average. There are those, too, who suffer from grave emotional and mental disorders, but many of them do recover if they have the capacity to be honest.<br>   Our stories disclose in a general way what we used to be like, what happened, and what we are like now. If you have decided you want what we have and are willing to go to any length to get it—then you are ready to take certain steps.<br>   At some of these we balked. We thought we could find an easier, softer way. But we could not. With all the earnestness at our command, we beg of you to be fearless and thorough from the very start. Some of us have tried to hold on to our old ideas and the result was nil until we let go absolutely.<br>   Remember that we deal with alcohol—cunning, baffling, powerful! Without help it is too much for us. But there is One who has all power—that One is God. May you find Him now!<br>   Half measures availed us nothing. We stood at the turning point. We asked His protection and care with complete abandon.<br><br>Here are the steps we took, which are suggested as a program of recovery:<br><strong>1.</strong> We admitted we were powerless over alcohol— that our lives had become unmanageable.</div><div><strong>2.</strong> Came to believe that a Power greater than our selves could restore us to sanity.<br><strong>3.</strong> Made a decision to turn our will and our lives over to the care of God as we understood Him.<br><strong>4.</strong> Made a searching and fearless moral inventory of ourselves.<br><strong>5.</strong> Admitted to God, to ourselves, and to another human being the exact nature of our wrongs.<br><strong>6.</strong> Were entirely ready to have God remove all these defects of character.<br><strong>7.</strong> Humbly asked Him to remove our shortcomings.<br><strong>8.</strong> Made a list of all persons we had harmed, and became willing to make amends to them all.<br><strong>9.</strong> Made direct amends to such people wherever possible, except when to do so would injure them or others.<br><strong>10.</strong> Continued to take personal inventory and when we were wrong promptly admitted it.<br><strong>11.</strong> Sought through prayer and meditation to improve our conscious contact with God as we understood Him, praying only for knowledge of His will for us and the power to carry that out.<br><strong>12.</strong> Having had a spiritual awakening as the result of these steps, we tried to carry this message to alcoholics, and to practice these principles in all our affairs.<br><br>   Many of us exclaimed, “What an order! I can’t go through with it.’’ Do not be discouraged. No one among us has been able to maintain anything like perfect adherence to these principles. We are not saints. The point is, that we are willing to grow along spiritual lines. The principles we have set down are guides to progress. We claim spiritual progress rather than spiritual perfection.<br>   Our description of the alcoholic, the chapter to the agnostic, and our personal adventures before and after make clear three pertinent ideas:<br><br>   <strong>(a)</strong> That we were alcoholic and could not manage our own lives.<br>   <strong>(b) </strong>That probably no human power could have relieved our alcoholism.<br>   <strong>(c) </strong>That God could and would if He were sought</div>	ServiceReading	2	2025-01-29 01:41:27.281059	2025-02-07 16:02:18.222966
131	body	<div><strong>1.</strong> Our common welfare should come first; personal recovery depends upon A.A. unity.<br><strong>2. </strong>For our group purpose there is but one ultimate authority—a loving God as He may express Himself in our group conscience. Our leaders are but trusted servants; they do not govern.<br><strong>3.</strong> The only requirement for A.A. membership is a desire to stop drinking.<br><strong>4.</strong> Each group should be autonomous except in matters affecting other groups or A.A. as a whole.<br><strong>5.</strong> Each group has but one primary purpose—to carry its message to the alcoholic who still suffers.<br><strong>6. </strong>An A.A. group ought never endorse, finance, or lend the A.A. name to any related facility or outside enterprise, lest problems of money, property, and prestige divert us from our primary purpose.<br><strong>7. </strong>Every A.A. group ought to be fully self-supporting, declining outside contributions.<br><strong>8.</strong> Alcoholics Anonymous should remain forever nonprofessional, but our service centers may employ special workers.<br><strong>9. </strong>A.A., as such, ought never be organized; but we may create service boards or committees directly responsible to those they serve.<br><strong>10. </strong>Alcoholics Anonymous has no opinion on outside issues; hence the A.A. name ought never be drawn into public controversy.<br><strong>11. </strong>Our public relations policy is based on attraction rather than promotion; we need always maintain personal anonymity at the level of press, radio, and films.<br><strong>12.</strong> Anonymity is the spiritual foundation of all our Traditions, ever reminding us to place principles before personalities.</div>	ServiceReading	3	2025-01-29 01:46:37.693164	2025-01-29 01:53:18.548979
133	body	<div>Our book is meant to be suggestive only. We realize we know only a little. God will constantly disclose more to you and to us. Ask Him in your morning meditation what you can do each day for the man who is still sick. The answers will come, if your own house is in order. But obviously you cannot transmit something you haven’t got. See to it that your relationship with Him is right, and great events will come to pass for you and countless others. This is the Great Fact for us.<br><br>Abandon yourself to God as you understand God. Admit your faults to Him and to your fellows. Clear away the wreckage of your past. Give freely of what you find and join us. We shall be with you in the Fellowship of the Spirit, and you will surely meet some of us as you trudge the Road of Happy Destiny. May God bless you and keep you—until then.</div>	ServiceReading	5	2025-01-29 02:57:05.806058	2025-01-29 02:57:05.806058
134	content	<div>One evening, I was alone, weary, and exhausted. I was in the midst of extensive traveling, disconnected from friends and family. I had flown home for the evening, but it seemed like nobody noticed. People were used to me being gone.<br><br>   It was late at night, and I began arguing with God.<br><br>   “I’m out there working hard. I’m lonely. I need to know someone cares. You’ve told me to tell You what I need, and tonight, God, I particularly need the presence of male energy. I need a friend, someone I can trust to care about me in a nonsexual, nonexploitive way. I need to be held. Now, where are you?”<br><br>   I lay down on the couch and closed my eyes. I was too tired to do anything but let go.<br><br>   The telephone rang minutes later. It was a former colleague who had since become my friend. “Hey, kid,” he said. “You sound really tired and needy. Stay right where you are. I’m going to drive out and give you a foot-rub. It sounds exactly like what you need.” <br>   Half an hour later, he knocked on my door. He brought a small bottle of oil with him, and gently massaged my feet, gave me a hug, told me how much he cared about me, then left.<br><br>   I smiled. I had received exactly what I asked for. <br>   It is safe to trust God.<br><br></div><h1>   <strong><em>Today, I will remember God cares about what I need, especially if I do.</em></strong></h1>	Reading	65	2025-01-31 04:08:22.450582	2025-01-31 04:08:22.450582
