136	content	<div>Your new friend may give reasons why they don’t need to complete all of the program. They may rebel at the thought of doing a thorough house cleaning (inventory). They may not want to talk with other people about their problems. Don’t argue with them. Tell them you once felt the same way. Say you don’t think you would have made much progress if you took no action.<br><br>Unless your friend wants to talk further about their own experiences, don’t force them. You don’t want to wear out your welcome. Give them a chance to think it over. If you do stay, let them steer the conversation in any direction they want. Sometimes a person is anxious to start the program right away. You may be tempted to let them do just that. Sometimes this is a mistake. If the problem drinker has trouble later on, they may say you made them feel rushed. You will be most successful with other alcoholics if you don’t act pushy or judgmental. <br><br>Never talk down to an alcoholic from any moral or spiritual perspective. Just lay out the kit of spiritual tools for them to look at. Show them how the tools worked for you. Offer them friendship and fellowship. Tell them that if they want to get well, you will do anything to help. If they are not interested in doing the work of A.A., you will know. If the person wants you to lend them money or act like a nurse when they go on drinking sprees, you might even stop helping them. You’ll need to wait until they change their own mind. This might not happen until they get hurt some more.<br><br>If they are truly interested and want to see you again, ask them to read this book before your next meeting. After doing that, they must decide on their own whether or not to go on. They should not be pushed or prodded by you, their family, or their friends. If they are to connect with a Higher Power, the desire must come from within.<br><br>If the individual thinks they can stop drinking in some other way, or prefers some other spiritual approach, encourage them to do what they think is best for them. A.A. does not believe there is one right path to faith. We just have an approach that worked for us. But point out that we alcoholics have a lot in common and you’d like to keep in touch. Let it go at that.<br><br>Don’t be discouraged if your new friend doesn’t join A.A. right away. Find another alcoholic and try again. It won’t take long to find someone desperate enough to accept what you offer. It’s a waste of time to keep chasing someone who cannot or will not work with you. If you leave such a person alone, they may soon realize that they cannot recover by themselves. To spend too much time on any one person means denying some other alcoholic the chance to live and be happy.<br><br>One member of our Fellowship failed completely with his first six problem drinkers. He often says that if he had continued to work on them, he would not have been able to help others who wanted to recover.</div>	Reading	66	2025-02-04 03:30:37.328585	2025-02-04 03:40:18.291193
141	topic	<ul><li> Breaking Free from Victimization in Challenging Times </li><li> Building Safe and Supportive Communities </li><li> Fighting for Our Right to Happiness </li></ul>	Reading	68	2025-02-06 02:05:39.63108	2025-02-06 02:05:39.63108
140	content	<div>Before recovery, many of us lacked a frame of reference with which to name the <em>victimization </em>and <em>abuse </em>in our life. We may have thought it was normal that people mistreated us. We may have believed we deserved mistreatment; we may have been attracted to people who mistreated us.<br>   We need to let go, on a deep level, of our need to be victimized and to be victims. We need to let go of our need to be in dysfunctional relationships and systems at work, in love, in family relationships, in friendships. We deserve better. We deserve much better. It is our right. When we believe in our right to happiness, we will have happiness.<br>   We will fight for that right, and the fight will emerge from our souls. Break free from oppression and victimization.<br><br><strong><em>Today, I will liberate myself by letting go of my need to be a victim. and I’ll explore my freedom to take care of myself. That liberation will not take me further away from people I love. It will bring me closer to people and more in harmony with God’s plan for my life.</em></strong><br><br></div>	Reading	68	2025-02-06 02:05:39.62277	2025-02-06 02:07:40.87199
142	content	<div>Many new people have come to A.A. who wanted to keep their lives secret. They wanted to avoid discussing the truth about their lives with anyone. Even if they did everything else in the A.A. program and followed all of the other 11 Steps, these people almost always struggled to stay sober. At some point, they got drunk. They were unable to control themselves and wondered why they started drinking again.<br><br>We think the reason is that they never completed their “house cleaning.” They started to take inventory, but didn’t finish the process. They thought they had gotten rid of their selfishness and fear, but they had not. They thought they had learned to be humble, but they had not. They had not learned enough about selfishness and fear because they had not told someone else their complete life story.<br><br>One reason it’s hard for alcoholics to know when we have told our entire life stories is this: Many alcoholics lead double lives. We are like actors. When we are around other people, we act like a character on stage, showing them the version of ourselves we want them to see. We pretend to be people we are not so others will like us. Even when we know we don’t deserve to be liked.<br><br>Leading a double life becomes harder when we go on drinking sprees. Once we get sober, we may remember how we acted when we were drunk and feel disgusted with ourselves. Realizing someone else may have seen us act this way is very upsetting. These memories are like nightmares. We may push them deep inside ourselves so we don’t have to face them. Feeling this way makes us feel constantly afraid and tense, which can lead to more drinking.<br><br>Psychologists tend to agree that alcoholics struggle to be honest with themselves, and also struggle to be honest with others. Many of us have spent thousands of dollars working with psychologists, never feeling able to tell them the whole truth. We couldn’t take their advice, no matter how kind they were to us. We couldn’t be honest with our psychologists or anyone else. No wonder so many doctors believe alcoholics can’t recover!</div>	Reading	69	2025-02-11 03:36:49.853911	2025-02-11 03:36:49.853911
144	content	<div>What a great gift we’ve been given—ourselves. To listen to ourselves, to trust instinct and intuition, is to pay tribute to that gift. What a disservice not to heed the leadings and leanings that so naturally arise from within. When will we learn that these leadings and leanings draw us into God’s rich plan for us?<br><br>We will learn. We will learn by listening, trusting, and following through. What is it time to do? . . . What do I need to do to take care of myself? . . . What am I being led to do? . . . What do I know?<br><br>Listen, and we will know. Listen to the voice within.</div><h1><br></h1><blockquote><h1><em>Today, I will listen and trust. I will be helped to take action when that is needed. I can trust myself and God.</em></h1></blockquote><div><br></div>	Reading	70	2025-02-13 02:30:18.47756	2025-02-13 02:31:39.824114
