146	content	<div><strong>Once we have accepted</strong> A.A.’s principles, we can do all kinds of things alcoholics are not supposed to do. People say we can’t go where liquor is served and we must not have it in our homes. They say we can’t spend time with friends who drink. They tell us not to watch movies or TV shows that show people drinking. They say our friends must hide their bottles if we go to their houses. They insist we can’t think about alcohol at all. Our experience shows that this is not actually true.<br><br>   We are in situations involving alcohol every day. An alcoholic who cannot deal with them still has an alcoholic mind. That person hasn’t truly found their faith or connected with their Higher Power. Their only chance for sobriety would be to move someplace like the North Pole. And even there, someone might show up with a bottle of scotch and ruin everything! Ask any spouse who has sent their alcoholic partner to distant places thinking it would solve the alcohol problem. It never works.<br><br>   We believe that any method of fighting alcoholism that protects the alcoholic from temptation will fail. If the alcoholic tries to protect themself, that may work for a while. But they usually end up going on the biggest drinking spree ever. We have tried these methods. They are attempts to do the impossible, and they have always failed. <br><br>   So our rule is not to avoid places where there is drinking, if we have a real reason for being there. That includes bars, nightclubs, dances, receptions, weddings, even plain ordinary parties. To someone who has had experience with an alcoholic, this may seem like tempting fate, but it isn’t.<br><br>   You may notice that we said we need “a real reason for being there.” As an alcoholic who is thinking of going to a bar or party, ask yourself, “Do I have any good social, business, or personal reason for going to this place? Or am I hoping to get some secondhand pleasure from watching other people drink?” If you answer these questions honestly, you don’t need to worry. Go or stay away, whichever feels right. But make sure you are on solid spiritual ground before you consider going. Also make sure your reasons for going are thoroughly good. Don’t think about what you will get out of the experience. Think of what you can bring to it. And if you feel shaky or unsure, work with another alcoholic instead of putting yourself at risk!<br><br>   Don’t allow yourself to be grouchy or sullen in places where people are drinking. Don’t let yourself sigh about the good old days. If it is a happy occasion, join others in celebrating. If you’re there for business, focus on business discussions with enthusiasm. If you are with a person who wants to eat in a bar, feel free to go along. Let your friends know they don’t need to change their habits on your account. When the time feels right, explain to all your friends why alcohol is a problem for you. If you do this thoroughly, very few people will pressure you to drink. While you were drinking, you were withdrawing from life little by little. Now you are returning to the social life of this world. Don’t start to withdraw again just because your friends drink alcohol.<br><br>   Your job now is to be as helpful as possible to others. Never hesitate to go anywhere if you can be helpful. You can visit the most dirty, dangerous spot on earth if you go there to be helpful. Keep on the firing line of life with these motives and God will keep you unharmed.<br><br>   Many recovering alcoholics keep liquor in our homes. We often need it to get newcomers through a severe hangover. Some of us still serve it to our friends as long as they are not alcoholics. But others think we should not serve liquor to anyone. We never argue about this question. We feel that each family is unique, and can decide for themselves.<br><br>   We are careful never to become intolerant about drinking in general. That attitude is not helpful to anyone. Every newcomer to A.A. seems worried that we will all be hateful about other people’s drinking. They are all relieved when they see we are not. Intolerance of all drinking might discourage alcoholics whose lives could have been saved. They might never try to learn about A.A. for fear of being judged. That kind of intolerance is totally useless. There isn’t a drinker alive who likes to be told anything about alcohol by someone who hates it.<br><br>   Someday we hope that Alcoholics Anonymous will help the public understand the seriousness of alcoholism. We will never reach that goal with an attitude of bitterness or hostility. Drinkers will not stand for it.<br><br>   After all, we created our own problems. Bottles were only a symbol. Besides, we have stopped fighting anybody or anything. We don’t have a problem with anyone who drinks. We don’t even fight alcohol. We just don’t need it!<br><br></div>	Reading	71	2025-02-18 03:28:16.061723	2025-02-18 03:28:34.486184
148	content	<div><strong>We are powerless</strong> over other people’s expectations of us. We cannot control what others want, what they expect, or what they want us to do and be.</div><div><br>   We can control how we respond to other people’s expectations. During the course of any day, people may make demands on our time, talents, energy, money, and emotions. We do not have to say yes to every request. We do not have to feel guilty if we say no. And we do not have to allow the barrage of demands to control the course of our life.<br><br>   We do not have to spend our life reacting to others and to the course they would prefer we took with our life.<br><br>   We can set boundaries, firm limits on how far we shall go with others. We can trust and listen to ourselves. We can set goals and direction for our life. We can place value on ourselves.<br><br>   We can own our power with people.<br><br>   Buy some time. Think about what you want. Consider how responding to another’s needs will affect the course of your life. We live or own life by not letting other people, their expectations, and their demands control the course of <em>our </em>life. We can let them have their demands and expectations; we can allow them to have their feelings. We can own our power to choose the path that is right for us.<br><br></div><blockquote><h1><em>Today, God, help me own my power by detaching, and peacefully choosing the course of action that is right for me. Help me know I can detach from the expectations and wants of others. Help me stop pleasing other people and start pleasing myself.</em></h1></blockquote><div><br></div>	Reading	72	2025-02-19 23:49:37.564353	2025-02-19 23:59:26.002151
150	content	<div>We found ourselves wondering how people who loved their families could be so unthinking, so insensitive, so cruel. They weren’t capable of feeling love, we thought. But just as we had decided for good that our partners were heartless, they would surprise us with promises to change. For a while they would be their old sweet selves, but then they would smash our love to pieces all over again. Whenever we asked why they had started to drink again, they would reply with some silly excuse, or offer us no reason at all. It was so confusing, so heartbreaking. Could we have been so wrong about the people we chose to spend our lives with? When they were drinking, they were strangers. Sometimes they were so emotionally distant that it seemed like a giant wall had been built around them.<br><br>And even if they didn’t love their families, how could they be so blind about themselves? Where had their judgment, common sense, and willpower gone? Why couldn’t they see that drinking was ruining their lives? And when anyone pointed out how dangerous drinking was, why would they get drunk again immediately?<br><br>These are some of the questions which race through the mind of every partner with an alcoholic loved one. Perhaps your partner has been living in that strange world of alcoholism where everything is twisted and exaggerated. You can see that your partner really does love you with their better self. Some people are just incompatible, meaning they aren’t meant to be together. But in cases where one partner is alcoholic and the alcoholic seems unloving and inconsiderate, it’s usually because they are suffering and sick. It’s the sickness making them act that way.<br><br>Try not to judge or punish your partner no matter what they say or do. They are a very sick, unreasonable person. Treat them, when you can, as though they have pneumonia. When they make you angry, remember that they are very ill.<br><br>However, there’s an important exception to this rule. Some people really do have bad intentions, and being patient with them won’t make any difference. An alcoholic who is like this may try to use what we’ve said in this chapter against you. Don’t let them get away with it. If you are sure your partner is bad intentioned, you may decide to end the relationship. Is it right to let this person ruin your life and the lives of your children? Especially when they have a way to stop drinking and treating you badly if only they were willing to put in the work?<br><br></div>	Reading	73	2025-02-25 03:31:06.934594	2025-02-25 03:31:06.934594
