169	body	<div><strong>Rarely have we seen a person fail</strong> who has thoroughly followed our path. Those who do not recover are people who cannot or will not completely give themselves to this simple program, usually people who are constitutionally incapable of being honest with themselves. There are such unfortunates. They are not at fault; they seem to have been born that way. They are naturally incapable of grasping and developing a manner of living which demands rigorous honesty. Their chances are less than average. There are those, too, who suffer from grave emotional and mental disorders, but many of them do recover if they have the capacity to be honest.<br><br>Our stories disclose in a general way what we used to be like, what happened, and what we are like now. If you have decided you want what we have and are willing to go to any length to get it — then you are ready to take certain steps.<br><br>At some of these we balked. We thought we could find an easier, softer way. But we could not. With all the earnestness at our command, we beg of you to be fearless and thorough from the very start. Some of us have tried to hold on to our old ideas and the result was nil until we let go absolutely.<br><br>Remember that we deal with alcohol — cunning, baffling, powerful! Without help it is too much for us. But there is One who has all power — that One is God. May you find God now!<br><br>Half measures availed us nothing. We stood at the turning point. We asked God’s protection and care with complete abandon.<br><br>Here are the steps we took, which are suggested as a program of recovery:<br><br><strong>1.</strong> We admitted we were powerless over alcohol — that our lives had become unmanageable.<br><strong>2. </strong>Came to believe that a Power greater than ourselves could restore us to sanity.<br><strong>3.</strong> Made a decision to turn our will and our lives over to the care of God as we understood God.<br><strong>4.</strong> Made a searching and fearless moral inventory of ourselves.<br><strong>5. </strong>Admitted to God, to ourselves, and to another human being the exact nature of our wrongs.<br><strong>6.</strong> Were entirely ready to have God remove all these defects of character.<br><strong>7.</strong> Humbly asked God to remove our shortcomings.<br><strong>8. </strong>Made a list of all persons we had harmed, and became willing to make amends to them all.<br><strong>9.</strong> Made direct amends to such people wherever possible, except when to do so would injure them or others.<br><strong>10.</strong> Continued to take personal inventory and when we were wrong promptly admitted it.<br><strong>11. </strong>Sought through prayer and meditation to improve our conscious contact with God as we understood God, praying only for knowledge of God’s will for us and the power to carry that out.<br><strong>12.</strong> Having had a spiritual awakening as the result of these steps, we tried to carry this message to alcoholics, and to practice these principles in all our affairs.<br><br>Many of us exclaimed, <em>“What an order! I can’t go through with it.’</em>’ Do not be discouraged. No one among us has been able to maintain anything like perfect adherence to these principles. We are not saints. The point is, that we are willing to grow along spiritual lines. The principles we have set down are guides to progress. We claim spiritual progress rather than spiritual perfection.<br><br>Our description of the alcoholic, the chapter to the agnostic, and our personal adventures before and after make clear three pertinent ideas:<br><br><strong>(a)</strong> That we were alcoholic and could not manage our own lives. <br><strong>(b)</strong> That probably no human power could have relieved our alcoholism. <br><strong>(c)</strong> That God could and would if God were sought.</div>	ServiceReading	6	2025-04-13 01:01:11.499635	2025-04-13 01:03:33.984516
