3	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Anxiety is often\\"},{\\"type\\":\\"text\\",\\"text\\":\\" our first reaction to conflict, problems, or even our own fears. In those moments, detaching and getting peaceful may seem disloyal or apathetic. We think: If I really care, I’ll worry; if this is really important to me, I must stay upset. We convince ourselves that outcomes will be positively affected by the amount of time we spend worrying.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   Our best problem-solving resource is peace. Solutions arise easily and naturally out of a peaceful state. Often, fear and anxiety block solutions. Anxiety gives power to the problem, not the solution. It does not help to harbor turmoil. It does not help. Peace is available if we choose it. In spite of chaos and unsolved problems around us, all is well. Things will work out. We can surround ourselves with the resources of the Universe: water, earth, a sunset, a walk, a prayer, a friend. We can relax and let ourselves feel peace.\\"}]},{\\"type\\":\\"blockquote\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"Today, I will let go of my need to stay in turmoil. I will cultivate peace and trust that timely solutions and goodness will arise naturally and harmoniously out of the wellspring of peace. I will consciously let go and let God.\\"}]}]}]}"	Reading	76	2025-03-06 03:42:28.208036	2025-03-06 03:48:58.556494
1	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"blockquote\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"I was furious when I found myself at my first Al-Anon meeting. It seemed so unfair that he had the problem and I had to go to a meeting. But by that time, I had nowhere left in the world to go with my pain. Now, I’m grateful for Al-Anon and my codependency recovery. Al- Anon keeps me on track; recovery has given me a life.\\"}]}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"right\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"— ANONYMOUS\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"right\\"}},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"There are many Twelve Step programs for codependents: Al-Anon, Adult Children of Alcoholics, CoDa, Families Anonymous, Nar-Anon, and more. We have many choices about which kind of group is right for us and which particular group in that category meets our needs. Twelve Step groups for codependents are free, anonymous, and available in most communities. If there is not one that is right for us, we can start one.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   Twelve Step groups for codependents are not about how we can help the other person; they’re about how we can help ourselves grow and change. They can help us accept and deal with the ways codependency has affected us. They can help us get on track and stay there.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   There is magic in Twelve Step programs. There is healing power in connecting with other recovering people. We access this healing power by working the Steps and by allowing them to work on us. The Twelve Steps are a formula for healing.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   How long do we have to go to meetings? We go until we “get the program.” We go until the program “gets us.” Then we keep on going—and growing.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   Selecting a group and then attending regularly are important ways we can begin and continue to take care of ourselves. Actively participating in our recovery program by working the Steps is another.\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"blockquote\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"left\\",\\"level\\":3},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"I will be open to the healing power available to me from the Twelve Steps and a recovery program.\\"}]}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\" \\"}]}]}"	Reading	74	2025-02-27 02:00:01.798853	2025-02-27 02:03:00.439283
2	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"If you look\\"},{\\"type\\":\\"text\\",\\"text\\":\\" back at our example list, you’ll see that the word “fear” sits in parentheses next to the complaints about Mr. Brown, Mrs. Jones, the employer, and the wife. As we did our own inventories, we saw that this one word somehow touched every aspect of our lives. It was like an evil and destructive thread that wove its way through the fabric of our existence. So often, our fears were the real cause of our resentments. Fear caused events in our lives that created pain we felt we didn’t deserve. But had we really set the ball rolling ourselves? Could we admit to ourselves that our fears had caused that trouble in the first place?\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   We reviewed our fears thoroughly. We put them on paper, even if they weren’t connected to feelings of resentment. We asked ourselves why we had these fears. Wasn’t it because we believed we could do everything and know everything, and then found out we were wrong? Wasn’t it because we couldn’t accept that we needed help? Some of us had felt very confident at times, but our confidence never took away our fears. When it made us cocky, it was worse.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   If we wanted to continue recovering, we needed to find a better way to deal with our fears. And we found it in trusting and relying on a Higher Power. We learned to trust God rather than trying to understand, manage, and do everything in our lives alone. And by putting that trust in God, we are able to get through our darkest, most difficult, and most fearful times.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   And we are not ashamed of relying on God, or of needing God. We know that our faith and trust isn’t a sign of weakness. It is a sign of strength. Faith is a kind of courage, just as trusting a Higher Power is a kind of courage. And when we ask God to remove our fears and help us focus on better, more important things, we can begin to outgrow our fears.\\"}]}]}"	Reading	75	2025-03-04 03:00:22.838061	2025-03-04 03:00:22.838061
4	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"I was forty-six years old before I finally admitted to myself and someone else that my grandfather always managed to make me feel guilty, angry, and controlled. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"right\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"— ANONYMOUS\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"We may love \\"},{\\"type\\":\\"text\\",\\"text\\":\\"and care about our family very much. Family members may love and care about us. But interacting with some members may be a real trigger to our codependency—sometimes to a deep abyss of shame, rage, anger, guilt, and helplessness.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   It can be difficult to achieve detachment, on an emotional level, with certain family members. It can be difficult to separate their issues from ours. It can be difficult to own our power.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   Difficult, but not impossible.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   The first step is awareness and acceptance—simple acknowledgment, without guilt, of our feelings and thoughts. We do not have to blame our family members. We do not have to blame or shame ourselves. Acceptance is the goal—acceptance and freedom to choose what we want and need to do to take care of ourselves with that person. We can become free of the patterns of the past. We are recovering. Progress is the goal.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"   Today, Higher Power, help me be patient with myself as I learn how to apply recovery behaviors with family members. Help me strive today for awareness and acceptance.\\"}]}]}"	Reading	77	2025-03-10 03:53:02.517571	2025-03-10 03:53:02.517571
5	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Most of us struggle \\"},{\\"type\\":\\"text\\",\\"text\\":\\"to admit that we are real alcoholics. Just like everyone else, we dislike feeling different or unusual. We want to be normal, regular people. So we spend a lot of time and energy trying to prove that we can drink like normal, regular people. We believed that somehow, someday we will be able to control and enjoy our drinking. Since we cannot, we fail over and over again. It is astounding how long we continue trying to prove that we aren’t alcoholics! Some of us do it until we lose our minds—or die.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    Over time, we have learned that the first step in recovery is to completely accept that we are alcoholics. The false belief that we are like other people, or more specifically like other drinkers, must be smashed. As alcoholics, we have lost the ability to control our drinking. We have lost this ability \\"},{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"permanently \\"},{\\"type\\":\\"text\\",\\"text\\":\\". There may be short periods of time when we feel like we have taken control. Then we begin to relapse, and then we lose control completely. In fact, it is usually worse. Whenever this happens, we feel like we have failed completely in our lives and may never be worthy again. We are convinced that we have an illness that only gets worse, and never better.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"RELAPSE: When an alcoholic who has stopped drinking for a period of time begins to drink again.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    There is no treatment, program, or medication that will make alcoholics the same as normal drinkers. We have tried every treatment we could find, and nothing worked. Doctors who treat alcoholic patients also agree that it is impossible to turn an alcoholic into a normal drinker. Maybe someday scientists will find the secret, but they haven’t done so yet.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    We have a huge amount of evidence showing that alcoholics cannot control their drinking, but some alcoholics stubbornly believe that they still can. They will insist that they can drink like normal people whenever they want. They will say they can quit whenever they want. They will experiment and argue, trying their hardest to show that they are in charge of their actions.\\"}]}]}"	Reading	78	2025-03-11 03:05:04.730199	2025-03-11 03:05:04.730199
6	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"In spite of our best efforts\\"},{\\"type\\":\\"text\\",\\"text\\":\\" to work our programs and lean on God’s guidance, we sometimes don’t understand what’s going on in our life. We trust, wait, pray, listen to people, listen to ourselves, and the answer still does not come.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    During those times, we need to understand that we are right where we need to be, even though that place may feel awkward and uncomfortable. Our life does have purpose and direction.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    We are being changed, healed, and transformed at levels deeper than we can imagine. Good things, beyond our capacity to imagine, are being prepared and brought to us. We are being led and guided. We can become peaceful. We do not have to act in haste or urgency just to relieve our discomfort, just to get an answer. We can wait until our mind is peaceful. We can wait for clear direction. Clarity will come.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    The answer will come, and it will be good for us and those around us.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"Today, God, help me know I am being guided into what’s good about life, especially when I feel confused and without direction. Help me trust enough to wait until my mind and vision are clear and consistent. Help me know that clarity will come.\\"}]}]}"	Reading	79	2025-03-13 03:45:47.852213	2025-03-13 03:45:47.852213
7	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Trust can be one of the most confusing concepts in recovery.\\"},{\\"type\\":\\"text\\",\\"text\\":\\" Who do we trust? For what?\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"The most important trust issue we face is learning to trust ourselves. The most detrimental thing that’s happened to us is that we came to believe we couldn’t trust ourselves.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"There will be some who tell us we cannot trust ourselves, we are off base and out of whack. There are those who would benefit by our mistrusting ourselves.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Fear and doubt are our enemies. Panic is our enemy. Confusion is our opposition.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Self-trust is a healing gift we can give ourselves. How do we acquire it? We learn it. What do we do about our mistakes, about those times we thought we could trust ourselves but were wrong? We accept them, and trust ourselves anyway.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We know what is best for us. We know what is right for us. If we are wrong, if we need to change our mind, we will be guided into that—but only by trusting where we are today.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We can look to others for support and reinforcement, but trust in ourselves is essential.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Do not trust fear. Do not trust panic. We can trust ourselves, stand in our own truth, stand in our own light. We have it now. Already. We have all the light we need for today. And tomorrow’s light shall be given to us then.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Trust ourselves, and we will know whom to trust. Trust ourselves, and we will know what to do. When we feel we absolutely cannot trust ourselves, trust that God will guide us into truth.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"}},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"blockquote\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"}},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"God, help me let go of fear, doubt, and confusion—the enemies of self-trust. Help me go forward in peace and confidence. Help me grow in trust for myself and You, one day at a time, one experience at a time.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"}}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"}}]}"	Reading	80	2025-03-14 03:29:10.251416	2025-03-14 03:38:19.905291
8	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Certain set times, familiar places, and regular activities associated with drinking\\"},{\\"type\\":\\"text\\",\\"text\\":\\" have been woven closely into the fabric of our lives. Like fatigue, hunger, loneliness, anger, and over elation, these old routines can prove to be traps dangerous to our sobriety.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"When we first stopped drinking, many of us found it useful to look back at the habits surrounding our drinking and, whenever possible, to change a lot of the small things connected with drinking. To illustrate: Many who used to begin the day with an eye-opener in the bathroom now head for coffee in the kitchen. Some of us shifted the order of things we did to prepare for the day, such as eating before bathing and dressing, or vice versa. A change in brands of toothpaste and mouthwash (be careful about the alcohol content!) gave us a fresh, different taste to start out with. We tried a little exercise or a few quiet moments of contemplation or meditation before plunging into the day. Many of us also learned to try a new route when we first left the house in the morning, not passing by a familiar watering hole. Some have switched from the car to a train, from the subway to a bicycle, from a bus to walking. Others joined a different car pool.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Whether our drinking was in the commuter bar car, the neighborhood gin mill, the kitchen, the country club, or the garage, each of us can spot pretty exactly his or her own favorite drinking locale. Whether we were the occasional bender-thrower or the round-the-clock wine sipper, each of us knows for himself or herself what days, hours, and occasions have most often been associated with our tippling.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"When you want not to drink, it helps to shake up all those routines and change the pieces around, we have found. Housewives, for instance, say it helps to shift shopping times and places and rearrange the agenda of daily chores. Working people who used to sneak out for a snort on the coffee break now stay in and really have coffee or tea and a bun. (And that's a good time to call someone you know who's also off the sauce. During times when we used to drink, if s reassuring to talk to a person who has been through the same experiences.)\\"}]}]}"	Reading	81	2025-03-15 23:43:45.857377	2025-03-15 23:43:45.857377
9	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"I got married and had two children\\"},{\\"type\\":\\"text\\",\\"text\\":\\". I married a man who was not or could not be honest. For several years after we were married, I did not drink. My sister went through a divorce and moved to the town I was living in. To be a good sister I went out with her, for she knew no one in the town. We went to a country western place that had a beer bust. You just paid a certain amount to get in, and you could drink all you wanted to drink. I thought I had arrived in heaven. We did this several times a week, and then she started meeting people and started dating. Well, I couldn’t drive, so I started drinking more and more at home.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Several years later alcohol had control over my life. I had a tee shirt that I just loved; it said, “I used to hate myself in the morning. Now I sleep till noon.” That described my feelings totally.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"When my daughter had to go to the hospital, I stayed sober for the five days she was there and told myself that I had licked the alcohol problem. On the way home from the hospital, I got drunk again. I can not tell you the number of times I tried to stop on my own. My son would look at me and say,”Mom, why do you have to drink so much?” He was about eleven years old at the time. So one night I got on my knees and said, “God, change me or let me die.”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"It was at this point in my life that I called Alcoholics Anonymous and asked for help. They sent two ladies over to my house. They sat with me, and I told them that I drank because my marriage was bad. One of the ladies held my hand and said, “That is not why you drink.” I told them I drank because I was part German. She patted my hand and said, “No, that’s not why you drink.” Then I told them I drank because I was legally blind. They said, “No, that’s not why you drink,” and they started to explain to me that alcoholism is a disease. They shared their stories with me and told me how alcohol had taken over their lives.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I started going to meetings, and my story sounded so dull next to some of the stories I heard. The most interesting thing I could think to tell was about the time my friends, who were also drunk, let me drive the car. I almost got us all killed—but what fun! Legally blind, drunk, and behind the wheel of a car. God was really taking care of me and the other people on the road that night; I just didn’t know it at the time.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"The truth is, most of my drinking was done at home alone. I would call people and talk, and the following mornings were awful, trying to piece together what I had said. I would say things to my husband like, “Wasn’t that an interesting call last night,” hoping he would volunteer information. My hands were beginning to shake without the alcohol, yet when I got to A.A., I wasn’t sure I belonged because my drunkalog was not exciting.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Then one night at an A.A. meeting a friend said that even though he had been in jail and done lots and lots of stuff, he was no different from me. He felt the same things I felt. It was then that I knew I was not unique, that the people did understand the pain inside me.\\"}]}]}"	Reading	82	2025-03-16 00:01:43.088585	2025-03-16 00:09:39.390976
10	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Let fears slip away.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    Release any negative, limiting, or self-defeating beliefs buried in your subconscious too. These beliefs may be about life, love, or yourself. Beliefs create reality.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    Let go. From as deep within as your fears, resentments, and negative beliefs are stored, let them all go. Let the belief or feeling surface. Accept it; surrender to it. Feel the discomfort or unrest. Then let it go. Let new beliefs replace the old. Let peace and joy and love replace fear.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"    Give yourself and your body permission to let go of fears, resentments, and negative beliefs. Release that which is no longer useful. Trust that you are being healed and prepared for receiving what is good.\\"}]},{\\"type\\":\\"blockquote\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"Today, God, help me become willing to let go of old beliefs and feelings that may be hurting me. Gently take them from me and replace them with new beliefs and feelings. I do deserve the best life and love have to offer. Help me believe that.\\"}]}]}]}"	Reading	83	2025-03-20 03:23:18.653216	2025-03-20 03:24:20.078501
11	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"I tried to stop drinking again. \\"},{\\"type\\":\\"text\\",\\"text\\":\\"I was able to stay sober for a pretty long time, and I began to feel very confident that I could stop drinking. I decided I was finally strong enough to quit for good! I had beat my alcoholism. Then one day I walked into a cafe to use their phone. Very soon after that, I found myself beating my fists on the bar, drunk, and wondering what had happened to me. As I brought the cup of whisky to my lips, I promised myself I would do better next time. But I figured I might as well get good and drunk then. And I did.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I’ll never forget the guilt and hopelessness I felt the next morning. I didn’t have the courage to keep fighting to stay sober. I also woke up feeling shaky and jittery, like I had so many times before. My brain was going a million miles a minute. I was convinced that something terrible was about to happen to me. The sun was barely up, but an all-night bar was open and I drank at least 12 beers as quickly as I could. My nerves finally began to calm down.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Then I looked at the morning paper, and saw that the stock market had crashed again. I felt like I had crashed my life. The stock market would recover someday, but I felt like I never would. That was a hard thought. I wondered if I should kill myself. But I thought no—not now.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My mind felt hazy and I decided that drinking gin would clear it up. So I drank two bottles and forgot everything. Even though I spent the next two years drinking as much as I possibly could, my mind and body kept me alive somehow. My choices made me feel full of shame, but I couldn’t stop myself. When I woke up in the morning feeling shaky and confused, I would steal money from my wife’s purse to buy more liquor. I wondered again and again if I should kill myself. I thought maybe I could jump out a window or overdose on prescription medicine … but I was too scared. My wife and I would go to the country, hoping a change of scenery might help me change my behavior. But it never did.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Then there was a night when the physical and mental pain was so hellish I felt sure I would jump through my window, glass and all. I dragged a mattress to a lower floor in case I actually did jump. My wife called a doctor, who gave me a sedative: Medicine to help me calm down and get some sleep. The next day, I started drinking gin along with the medicine. That combination of things nearly killed me. People in my life were afraid for me, and I was afraid for myself. I couldn’t really eat anything while I was drinking, so I was 40 pounds underweight. My life was in serious danger, and I knew it.\\"}]}]}"	Reading	84	2025-03-25 03:30:07.53302	2025-03-25 03:30:07.53302
12	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"“How could I do it? How could I say it? Even though I meant it, I still feel ashamed, guilty, and afraid.”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"This is a common reaction to new, exciting recovery behaviors. Anything to do with owning our power and taking care of ourselves can trigger feelings of shame, guilt, and fear.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We do not have to allow these feelings to control us. They’re a backlash. They’re after-burn. Let them burn out.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"When we start confronting and attacking feelings and messages, we will experience some after-burn. The after-burn is what we allowed to control us all our life—shame and guilt.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Many of us grew up with shame-based messages that it wasn’t okay to take care of ourselves, be honest, be direct, and own our power with people. Many of us grew up with messages that it wasn’t okay to be who we were and resolve problems in relationships. Many of us grew up with the message that what we want and need isn’t okay.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Let it all burn off. We don’t have to take after-burn so seriously. We don’t let the after-burn convince us that we are wrong and don’t have a right to take care of ourselves and set boundaries. Do we really have the right to take care of ourselves? Do we really have the right to set boundaries? Do we really have the right to be direct and say what we need to say?\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"You bet we do.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"Today, I will let any after-burn which sets in after I practice a new recovery behavior, burn off. I will not take it so seriously. God, help me let go of my shame and needless fears about what will happen to me if I really start caring for and loving myself.\\"}]}]}"	Reading	85	2025-03-27 03:16:00.160745	2025-03-27 03:16:00.160745
13	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Near the end of November 1934\\"},{\\"type\\":\\"text\\",\\"text\\":\\", I sat drinking in my kitchen. I thought about how I had enough gin hidden around the house to keep me drunk through that night and the next day. My wife was at work. I wondered if I could hide a full bottle of gin near the head of our bed. I knew I would need it before I woke up the next morning.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My thoughts were interrupted by the telephone ringing. I heard the cheerful voice of an old school friend through the phone. He asked if he could come over to visit me. \\"},{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"And he was sober!\\"},{\\"type\\":\\"text\\",\\"text\\":\\" It was years since I could remember hearing him sober, so I was amazed. I’d heard rumors that he was arrested and ordered by a judge to get treatment for his alcoholism. I wondered how he had escaped. I imagined that he would come over for dinner, and then I could drink openly with him. I wasn’t thinking at all about my friend’s health or well-being. I was just thinking of having fun with him like we used to do. I thought of his visit like being rescued. I felt like I was lost in the desert all by myself and dying of thirst. He was a pool of clear water that appeared suddenly to save my life.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"The door opened and he stood there, looking healthy and happy. He seemed very different, though I couldn’t figure out what had changed.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I pushed a drink across the table to him. He refused it. I felt disappointed but curious. I wondered what had happened to change him. He wasn’t acting like himself. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"“What’s going on?” I asked.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"He looked straight at me and smiled. He said, “I’ve got religion.” \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I was shocked by this news. I thought to myself, “Well, last summer he had been a crazy alcoholic. Now he’s just as crazy about religion.” His eyes were wide and sparkling with excitement. I expected him to start giving me a long, passionate speech about finding God. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"But he didn’t. Instead he told me how two men had come to his court hearing, and convinced the judge that he didn’t need to go to the hospital against his will. These men said they had a simple religious idea and a practical program of action to help alcoholics get sober. They offered to help him stop drinking. That was two months ago, and he hadn’t had a drink since then. It worked!\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"He had come to tell me about his experience and I was shocked, but interested. Before he arrived, I had felt hopeless about my own drinking. Now I was curious. He talked for hours, and memories from my own childhood came back to me. I could almost hear the sound of the preacher’s voice as I sat in church on Sundays. I remembered how my grandfather felt about religion. He believed that there was some great mystical force working in the world, but he didn’t want the preacher to tell him what that force was or how it worked. He wanted to make up his own mind about God and religion. He didn’t respect the people who went to church regularly and did exactly as they were told by the preacher. Remembering all of these things made me feel uneasy.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Then I remembered that day at the Winchester Cathedral in England, when I saw those words written on the gravestone. And I started to wonder about my own relationship with religion.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"ATHEIST: Someone who does not believe in God or gods.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I had always believed in a Power greater than myself. I was not an atheist. I didn’t think many people were true atheists, because believing that no Higher Power existed would be so hopeless. It would mean that the universe came from nothing and existed for no reason, which is dark and depressing. I respected the great scientists of the world, and all of them believed that nature followed certain rules and laws. Things like gravity, motion, and other scientific laws worked in predictable ways. Everything worked in harmony. Because of this, it seemed to me that there must be a Power greater than myself. A Power that was guiding our world in some way.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"So I believed there must be a God, but I had not made myself think about God’s power or ability to help me. I didn’t like or trust preachers, ministers, and religions. And if anyone started talking about a God who was made of love and strength, I felt angry and uncomfortable.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I knew that wars had been fought over religion, and people had been killed because of their religious beliefs. This made me feel sick. I even doubted if the religions in our world had truly helped people at all. When I fought in World War I, I saw people do brutal, awful things again and again. This made it seem like the Devil was the one controlling human life.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"But my friend told me honestly that God had helped him when he could not help himself. Like me, he had felt totally hopeless and unable to control his actions. Doctors had told him it was impossible for him to get sober and healthy again. A judge wanted to lock him up in a hospital so he couldn’t hurt himself or anyone else. Just like me, he had given up completely. But when he connected with God, he was filled with hope and the courage to live and try again. He had gone from wishing he was dead to living a joyful, healthy life. He felt like he had been saved from his own death. When he was drinking he felt like he was living in a garbage dump. Now, his life was better than he ever thought it could be.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"By connecting with God, he realized he was not alone. He was not the only person or force guiding his actions. And that was such a relief to him. Knowing he was not alone had saved him from hopelessness.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I was amazed. I began to wonder if religion was more important and useful than I had realized. Maybe God could help people who could not help themselves. Maybe God could guide them toward strength that they could not find alone. My friend’s story showed me that miracles were possible. He was a miracle himself, sitting across the kitchen table from me.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Looking at him, I realized that he hadn’t just changed how he thought and felt. He had changed his entire being. He was a completely new and totally different person. He was a better, happier, healthier person.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Even though I could see all of this, I still felt some doubt. I had never fully embraced God before, especially a God that was connected to me on a personal level. I didn’t like that idea. When people talked about God using terms like “universal mind” or “spirit of nature,” I felt more comfortable. The idea of God as a loving ruler of everything didn’t make sense to me. (I have talked to many people who felt the same way.)\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Then my friend suggested something that might help me. He said, \\"},{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"“Why don’t you create your own idea of who—or what—God is?”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"That simple question changed everything for me. All of my fear and doubt melted away. I felt like I had been living in the shadows for years, and could suddenly step into the sunlight. It was a miraculous moment.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"I realized that I didn’t need to suddenly become a man who went to church every day and had total faith in God. I just had to be willing to believe in a Power greater than myself.\\"},{\\"type\\":\\"text\\",\\"text\\":\\" That was the only thing I needed to do to begin moving away from my drinking problem. I just needed to accept that I was not the only person or force guiding my life. If I let myself believe that a Power greater than myself existed, I could start recovering. Then, one day, I could be as healthy and happy as my friend.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"At that moment, I thought again about that day at the Winchester Cathedral in England, when I saw the words written on the gravestone. When I was there, I needed and wanted God to be part of my life. I was willing to believe in a Power greater than myself, and that Power had come to visit me. God had been with me in that graveyard. But soon after that, I let myself get distracted by the activity of daily life. I let go of my connection with God, and I had not tried to find it again.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My conversation with my friend made me feel determined to connect with God again. This time for good.\\"}]}]}"	Reading	86	2025-04-01 03:17:59.478072	2025-04-01 03:17:59.478072
14	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Surrender to the moment.\\"},{\\"type\\":\\"text\\",\\"text\\":\\" Ride it out and through, for all it’s worth. Throw yourself into it.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Stop resisting.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"So much of our anguish is created when we are in resistance. So much relief, release, and change are possible when we accept, simply accept.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We waste our time, expend our energy, and make things harder by resisting, repressing, and denying. Repressing our thoughts will not make them disappear. Repressing a thought already formed will not make us a better person. Think it. Let it come into reality. Then release it. A thought is not forever. If we don’t like it, we can think another one or change it. But to do that, we must accept and release the first thought.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Resistance and repression will not change a thing. They will put us at war with our thoughts.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We make life harder by resisting and repressing our feelings. No matter how dark, how uncomfortable, how unjustified, how surprising, how “inappropriate” we might deem our feelings, resisting and repressing them will not free us from them. Doing that will make them worse. They will swirl inside us, torment us, make us sick, make our body ache, compel us to do compulsive things, keep us awake, or put us to sleep.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"In the final analysis, all that we’re really called on to do is accept our feelings by feeling them, and saying, “Yes, this is what I feel.”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Feelings are for the present moment. The more quickly we can accept a feeling, the more quickly we will move on to the next.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Resisting or repressing thoughts and feelings does not change us or turn us into the person we want to be or think we should be. It puts us in resistance to reality. It makes us repressed. Eventually, it makes us depressed.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Resisting events or circumstances in our life does not change things, no matter how undesirable the events or circumstances may be.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Acceptance turns us into the person we are and want to be. Acceptance empowers the events and circumstances to turn around for the better.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"What do we do if we’re in resistance, in a tug-of-war with some reality in our life? \\"},{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"Accepting our resistance \\"},{\\"type\\":\\"text\\",\\"text\\":\\"can help us get through that too.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Acceptance does not mean we’re giving our approval. It does not mean surrendering to the will and plans of another. It does not mean commitment. It is not forever. It is for the present moment.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Acceptance does not make things harder; it makes things easier. Acceptance does not mean we accept abuse or mistreatment; it does not mean we forego ourselves, our boundaries, hopes, dreams, desires, or wants. It means we accept what is, so we know what to do to take care of ourselves and what boundaries we need to set. It means we accept what is and who we are at the moment, so we are free to change and grow.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Acceptance and surrender move us forward on this journey. Force does not work.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Acceptance and surrender—two concepts that hurt the most before we do them.\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":3},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"Today, I will practice accepting myself and my present circumstances. I will begin to watch and trust the magic that acceptance can bring into my life and recovery\\"}]},{\\"type\\":\\"horizontalRule\\"}]}"	Reading	87	2025-04-03 03:34:16.756007	2025-04-03 03:35:07.608863
15	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"},{\\"type\\":\\"textStyle\\",\\"attrs\\":{\\"fontSize\\":\\"14.8333pt\\",\\"color\\":\\"rgb(0, 0, 0)\\"}}],\\"text\\":\\"“Made a searching and fearless moral in\\\\u0002ventory of ourselves.”\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"CREATION gave us instincts for a purpose\\"},{\\"type\\":\\"text\\",\\"text\\":\\". Without them we wouldn't be complete human beings. If men and women didn't exert themselves to be secure in their persons, made no effort to harvest food or construct shelter, there would be no survival. If they didn't reproduce, the earth wouldn't be populated. If there were no social instinct, if men cared nothing for the society of one another, there would be no society. So these desires—for the sex relation, for material and emotional security, and for companionship —are perfectly necessary and right, and surely God-given.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Yet these instincts, so necessary for our existence, often far exceed their proper functions. Powerfully, blindly, many times subtly, they drive us, dominate us, and insist upon ruling our lives. Our desires for sex, for material and emotional security, and for an important place in society often tyrannize us. When thus out of joint, man's natural desires cause him great trouble, practically all the trouble there is. No human being, however good, is exempt from these troubles. Nearly every serious emotional problem can be seen as a case of misdirected instinct. When that happens, our great natural assets, the instincts, have turned into physical and mental liabilities.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Step Four is our vigorous and painstaking effort to discover what these liabilities in each of us have been, and are. We want to find exactly how, when, and where our natural desires have warped us. We wish to look squarely at the unhappiness this has caused others and ourselves. By discovering what our emotional deformities are, we can move toward their correction. Without a willing and persistent effort to do this, there can be little sobriety or contentment for us. Without a searching and fearless moral inventory, most of us have found that the faith which really works in daily living is still out of reach.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Before tackling the inventory problem in detail, let's have a closer look at what the basic problem is. Simple examples like the following take on a world of meaning when we think about them. Suppose a person places sex desire ahead of everything else. In such a case, this imperious urge can destroy his chances for material and emotional security as well as his standing in the community. Another may develop such an obsession for financial security that he wants to do nothing but hoard money. Going to the extreme, he can become a miser, or even a recluse who denies himself both family and friends.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Nor is the quest for security always expressed in terms of money. How frequently we see a frightened human being determined to depend completely upon a stronger person for guidance and protection. This weak one, failing to meet life's responsibilities with his own resources, never grows up. Disillusionment and helplessness are his lot. In time all his protectors either flee or die, and he is once more left alone and afraid.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We have also seen men and women who go powermad, who devote themselves to attempting to rule their fellows. These people often throw to the winds every chance for legitimate security and a happy family life. Whenever a human being becomes a battleground for the instincts, there can be no peace.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"But that is not all of the danger. Every time a person imposes his instincts unreasonably upon others, unhappiness follows. If the pursuit of wealth tramples upon people who happen to be in the way, then anger, jealousy, and revenge are likely to be aroused. If sex runs riot, there is a similar uproar. Demands made upon other people for too much attention, protection, and love can only invite domination or revulsion in the protectors themselves—two emotions quite as unhealthy as the demands which evoked them. When an individual's desire for prestige becomes uncontrollable, whether in the sewing circle or at the international conference table, other people suffer and often revolt. This collision of instincts can produce anything from a cold snub t to a blazing revolution. In these ways we are set in conflict not only with ourselves, but with other people who have instincts, too.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Alcoholics especially should be able to see that instinct run wild in themselves is the underlying cause of their destructive drinking. We have drunk to drown feelings of fear, frustration, and depression. We have drunk to escape the guilt of passions, and then have drunk again to make more passions possible. We have drunk for vainglory—that we might the more enjoy foolish dreams of pomp and power. This perverse soul-sickness is not pleasant to look upon. Instincts on rampage balk at investigation. The minute we make a serious attempt to probe them, we are liable to suffer severe reactions.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"If temperamentally we are on the depressive side, we are apt to be swamped with guilt and self-loathing. We wallow in this messy bog, often getting a misshapen and painful pleasure out of it. As we morbidly pursue this melancholy activity, we may sink to such a point of despair that nothing but oblivion looks possible as a solution. Here, of course, we have lost all perspective, and therefore all genuine humility. For this is pride in reverse. This is not a moral inventory at all; it is the very process by which the depressive has so often been led to the bottle and extinction.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"If, however, our natural disposition is inclined to self righteousness or grandiosity, our reaction will be just the opposite. We will be offended at A.A.'s suggested inventory. No doubt we shall point with pride to the good lives we thought we led before the bottle cut us down. We shall claim that our serious character defects, if we think we have any at all, have been caused chiefly by excessive drinking. This being so, we think it logically follows that sobriety— first, last, and all the time—is the only thing we need to work for. We believe that our one-time good characters will be revived the moment we quit alcohol. If we were pretty nice people all along, except for our drinking, what need is there for a moral inventory now that we are sober?\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We also clutch at another wonderful excuse for avoiding an inventory. Our present anxieties and troubles, we cry, are caused by the behavior of other people—people who really need a moral inventory. We firmly believe that if only they'd treat us better, we'd be all right. Therefore we think our indignation is justified and reasonable—that our resentments are the “right kind.” We aren't the guilty ones. They are!\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"At this stage of the inventory proceedings, our sponsors come to the rescue. They can do this, for they are the carriers of A.A.'s tested experience with Step Four. They comfort the melancholy one by first showing him that his case is not strange or different, that his character defects are probably not more numerous or worse than those of anyone else in A.A. This the sponsor promptly proves by talking freely and easily, and without exhibitionism, about his own defects, past and present. This calm, yet realistic, stocktaking is immensely reassuring. The sponsor probably points out that the newcomer has some assets which can be noted along with his liabilities. This tends to clear away morbidity and encourage balance. As soon as he begins to be more objective, the newcomer can fearlessly, rather than fearfully, look at his own defects.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"The sponsors of those who feel they need no inventory are confronted with quite another problem. This is because people who are driven by pride of self unconsciously blind themselves to their liabilities. These newcomers scarcely need comforting. The problem is to help them discover a chink in the walls their ego has built, through which the light of reason can shine.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"First off, they can be told that the majority of A.A. members have suffered severely from self-justification during their drinking days. For most of us, self-justification was the maker of excuses; excuses, of course, for drinking, and for all kinds of crazy and damaging conduct. We had made the invention of alibis a fine art. We had to drink because times were hard or times were good. We had to drink because at home we were smothered with love or got none at all. We had to drink because at work we were great successes or dismal failures. We had to drink because our nation had won a war or lost a peace. And so it went, ad infinitum.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We thought “conditions” drove us to drink, and when we tried to correct these conditions and found that we couldn't to our entire satisfaction, our drinking went out of hand and we became alcoholics. It never occurred to us that we needed to change ourselves to meet conditions, whatever they were. But in A.A. we slowly learned that something had to be done about our vengeful resentments, self-pity, and unwarranted pride. We had to see that every time we played the big shot, we turned people against us. We had to see that when we harbored grudges and planned revenge for such defeats, we were really beating ourselves with the club of anger we had intended to use on others. We learned that if we were seriously disturbed, our first need was to quiet that disturbance, regardless of who or what we thought caused it.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"To see how erratic emotions victimized us often took a long time. We could perceive them quickly in others, but only slowly in ourselves. First of all, we had to admit that we had many of these defects, even though such disclosures were painful and humiliating. Where other people were concerned, we had to drop the word “blame” from our speech and thought. This required great willingness even to begin. But once over the first two or three high hurdles, the course ahead began to look easier. For we had started to get perspective on ourselves, which is another way of saying that we were gaining in humility.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Of course the depressive and the power-driver are personality extremes, types with which A.A. and the whole world abound. Often these personalities are just as sharply defined as the examples given. But just as often some of us will fit more or less into both classifications. Human beings are never quite alike, so each of us, when making an inventory, will need to determine what his individual character defects are. Having found the shoes that fit, he ought to step into them and walk with new confidence that he is at last on the right track.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Now let's ponder the need for a list of the more glaring personality defects all of us have in varying degrees. To those having religious training, such a list would set forth serious violations of moral principles. Some others will think of this list as defects of character. Still others will call it an index of maladjustments. Some will become quite annoyed if there is talk about immorality, let alone sin. But all who are in the least reasonable will agree upon one point: that there is plenty wrong with us alcoholics about which plenty will have to be done if we are to expect sobriety, progress, and any real ability to cope with life.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"To avoid falling into confusion over the names these defects should be called, let's take a universally recognized list of major human failings—the Seven Deadly Sins of pride, greed, lust, anger, gluttony, envy, and sloth. It is not by accident that pride heads the procession. For pride, leading to self-justification, and always spurred by conscious or unconscious fears, is the basic breeder of most human difficulties, the chief block to true progress. Pride lures us into making demands upon ourselves or upon others which cannot be met without perverting or misusing our God-given instincts. When the satisfaction of our instincts for sex, security, and society becomes the sole object of our lives, then pride steps in to justify our excesses.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"All these failings generate fear, a soul-sickness in its own right. Then fear, in turn, generates more character defects. Unreasonable fear that our instincts will not be satisfied drives us to covet the possessions of others, to lust for sex and power, to become angry when our instinctive demands are threatened, to be envious when the ambitions of others seem to be realized while ours are not. We eat, drink, and grab for more of everything than we need, fearing we shall never have enough. And with genuine alarm at the prospect of work, we stay lazy. We loaf and procrastinate, or at best work grudgingly and under half steam. These fears are the termites that ceaselessly devour the foundations of whatever sort of life we try to build.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"So when A.A. suggests a fearless moral inventory, it must seem to every newcomer that more is being asked of him than he can do. Both his pride and his fear beat him back every time he tries to look within himself. Pride says, “You need not pass this way,” and Fear says, “You dare not look!” But the testimony of A.A.'s who have really tried a moral inventory is that pride and fear of this sort turn out to be bogeymen, nothing else. Once we have a complete willingness to take inventory, and exert ourselves to do the job thoroughly, a wonderful light falls upon this foggy scene. As we persist, a brand-new kind of confidence is born, and the sense of relief at finally facing ourselves is indescribable. These are the first fruits of Step Four.\\"}]}]}"	Reading	88	2025-04-05 01:06:14.468673	2025-04-05 01:54:54.240488
16	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"I returned to the hospital\\"},{\\"type\\":\\"text\\",\\"text\\":\\", where I was treated for possible signs of delirium tremens (the shaking that happened to me in the morning before I started drinking). While I was there, I made a silent agreement with God. I asked God to care for my health and well-being, and promised that I would listen for God’s direction. I thought long and hard about all of the hurtful decisions I had made, and I asked God to forgive me. I had never been able to forgive myself, but when I made this agreement with God I finally felt forgiven. It was like I had been carrying a huge weight on my shoulders, and God took that weight away from me.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I have not had a single drink since that day.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My old school friend visited me at the hospital, the same friend who had come to my house to tell me that God had helped him get sober. I explained my own struggles with drinking. Together we made a list of people I had hurt, and also people who had made me angry. I told my friend that I wanted to talk with every person on the list and admit that I had been wrong. I promised that I wouldn’t blame these people or criticize them during our conversations. I just wanted to make things right between us, if I could. This would be part of my process for getting sober.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My friend asked me to do something else, too. He suggested that I silently explore my new relationship with God. If I ever felt doubt or confusion, he said I should sit quietly and ask God for direction and strength. If I prayed, I should not pray for myself unless I was asking for wisdom I could use to help other people. I needed to learn to trust in the Higher Power, and I needed to be less self-centered. These things would take practice. But my friend told me that practicing them and creating a relationship with God was all I needed to stay sober. It seemed simple, but that didn’t mean it would be easy to do. Making these big changes was overwhelming. But as soon as I started making these changes, my life was transformed. Lying there in the hospital, I felt like I had finally won a long and difficult battle. Then I felt a deep sense of inner peace and a surge of confidence. It seemed like I was standing at the very top of a mountain, and a strong, clean wind was blowing through me. God comes to some people slowly, but my own experience connecting to that Higher Power was sudden and very powerful.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"For a moment I was scared, so I called my doctor 1 into my room to explain what was happening and how I felt. He listened quietly as I talked.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Finally he said, “Something has happened to you that I don’t understand. But you had better hang on to it. Anything is better than the way you were.” (My doctor now sees many people who have had experiences like mine.)\\"}]}]}"	Reading	89	2025-04-08 03:26:42.719677	2025-04-08 03:26:42.719677
17	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Our happiness is not a present\\"},{\\"type\\":\\"text\\",\\"text\\":\\" someone else holds in his or her hands. Our well-being is not held by another to be given or withheld at whim. If we reach out and try to force someone to give us what we believe he or she holds, we will be disappointed. We will discover that it is an illusion. The person didn’t hold it. He or she never shall. That beautifully wrapped box with the ribbon on it that we believed contained our happiness that someone was holding—it’s an illusion!\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"In those moments when we are trying to reach out and force someone to stop our pain and create our joy, if we can find the courage to stop flailing about and instead stand still and deal with our issues, we will find our happiness.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Yes, it is true that if someone steps on our foot, he or she is hurting us and therefore holds the power to stop our pain by removing his or her foot. But the pain is still ours. And so is the responsibility to tell someone to stop stepping on our feet.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Healing will come when we’re aware of how we attempt to use others to stop our pain and create our happiness. We will heal from the past. We will receive insights that can change the course of our relationships.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We will see that, all along, our happiness and our wellbeing have been in our hands. We have held that box. The contents are ours for the opening.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"God, help me remember that I hold the key to my own happiness. Give me the courage to stand still and deal with my own feelings. Give me the insights I need to improve my relationships. Help me stop doing the codependent dance and start doing the dance of recovery.\\"}]}]}"	Reading	90	2025-04-10 03:33:34.616153	2025-04-10 03:33:34.616153
18	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Most of us struggle\\"},{\\"type\\":\\"text\\",\\"text\\":\\" to admit that we are real alcoholics. Just like everyone else, we dislike feeling different or unusual. We want to be normal, regular people. So we spend a lot of time and energy trying to prove that we can drink like normal, regular people. We believed that somehow, someday we will be able to control and enjoy our drinking. Since we cannot, we fail over and over again. It is astounding how long we continue trying to prove that we aren’t alcoholics! Some of us do it until we lose our minds—or die.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Over time, we have learned that the first step in recovery is to completely accept that we are alcoholics. The false belief that we are like other people, or more specifically like other drinkers, must be smashed. As alcoholics, we have lost the ability to control our drinking. We have lost this ability permanently. There may be short periods of time when we feel like we have taken control. Then we begin to relapse, and then we lose control completely. In fact, it is usually worse. Whenever this happens, we feel like we have failed completely in our lives and may never be worthy again. We are convinced that we have an illness that only gets worse, and never better.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"RELAPSE: When an alcoholic who has stopped drinking for a period of time begins to drink again.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"There is no treatment, program, or medication that will make alcoholics the same as normal drinkers. We have tried every treatment we could find, and nothing worked. Doctors who treat alcoholic patients also agree that it is impossible to turn an alcoholic into a normal drinker. Maybe someday scientists will find the secret, but they haven’t done so yet.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We have a huge amount of evidence showing that alcoholics cannot control their drinking, but some alcoholics stubbornly believe that they still can. They will insist that they can drink like normal people whenever they want. They will say they can quit whenever they want. They will experiment and argue, trying their hardest to show that they are in charge of their actions.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Many members of A.A. have experimented with their drinking in this way. Here are some of the ways we have tried to prove that we can drink normally:\\"}]},{\\"type\\":\\"blockquote\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Drinking beer only\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Limiting the number of drinks we drink at one time\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Never drinking alone\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Never drinking in the morning\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Drinking only at home\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Never keeping alcohol in the house\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Never drinking during business hours\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Drinking only at parties\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Switching from liquor to wine\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Drinking only natural wines\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Agreeing to resign from our jobs if we ever get drunk at work\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Swearing that we will never drink again\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Reading inspirational books\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Spending time at health spas\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"• Going into treatment for alcoholism voluntarily\\"}]}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"This list could go on forever. As you might have guessed, none of these experiments has changed us into normal drinkers.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We don’t like to label other people as alcoholics, but you can try this experiment and decide for yourself. Go to a bar and start drinking. Force yourself to stop drinking suddenly. Do it more than once. Doing this will show you how much control you really have. Even though you may not feel well later, the experiment may be worth it.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Many of us believe that we might have been able to stop if we’d decided to do so earlier in our lives. Whether or not this is true is hard to say. Few alcoholics truly want to stop while they have any chance at success.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"However, there are stories of people who showed signs of alcoholism and were able to stop drinking for a long period of time simply because they tried their hardest. Here is one of those stories.\\"}]}]}"	Reading	91	2025-04-15 03:32:26.447428	2025-04-15 03:32:26.447428
19	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"This article is the substance of a letter Bill wrote to a close friend who also had troublesome depressions.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I think that many oldsters who have put our AA “booze cure” to severe but successful tests still find they often lack emotional sobriety. Perhaps they will be the spearhead for the next major development in AA—the development of much more real maturity and balance (which is to say, humility) in our relations with ourselves, with our fellows, and with God.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Those adolescent urges that so many of us have for top approval, perfect security, and perfect romance—urges quite appropriate to age seventeen— prove to be an impossible way of life when we are at age forty-seven or fifty-seven.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Since AA began, I've taken immense wallops in all these areas because of my failure to grow up, emotionally and spiritually. My God, how painful it is to keep demanding the impossible, and how very painful to discover, finally, that all along we have had the cart before the horse! Then comes the final agony of seeing how awfully wrong we have been, but still finding ourselves unable to get off the emotional merry-go-round.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"How to translate a right mental conviction into a right emotional result, and so into easy, happy, and good living—well, that’s not only the neurotic’s problem, it’s the problem of life itself for all of us who have got to the point of real willingness to hew to right principles in all our affairs.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Even then, as we hew away, peace and joy may still elude us. That’s the place so many of us AA oldsters have come to. And it’s a hell of a spot, literally. How shall our unconscious—from which so many of our fears, compulsions, and phony aspirations still stream—be brought into line with what we actually believe, know, and want! How to convince our dumb, raging, and hidden “Mr. Hyde” becomes our main task.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I've recently come to believe that this can be achieved. I believe so because I begin to see many benighted ones—folks like you and me— commencing to get results. Last autumn, depression, having no really rational cause at all, almost took me to the cleaners. I began to be scared that I was in for another long chronic spell. Considering the grief I've had with depressions, it wasn’t a bright prospect.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I kept asking myself, “Why can’t the Twelve Steps work to release depression?” By the hour, I stared at the St. Francis Prayer . . . “It’s better to comfort than to be comforted.” Here was the formula, all right. But why didn’t it work?\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Suddenly I realized what the matter was. My basic flaw had always been dependence—almost absolute dependence—on people or circumstances to supply me with prestige, security, and the like. Failing to get these things according to my perfectionist dreams and specifications, I had fought for them. And when defeat came, so did my depression.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"There wasn’t a chance of making the outgoing love of St. Francis a workable and joyous way of life until these fatal and almost absolute dependencies were cut away.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Because I had over the years undergone a little spiritual development, the absolute quality of these frightful dependencies had never before been so starkly revealed. Reinforced by what grace I could secure in prayer, I found I had to exert every ounce of will and action to cut off these faulty emotional dependencies upon people, upon AA, indeed, upon any set of circumstances whatsoever. Then only could I be free to love as Francis had. Emotional and instinctual satisfactions, I saw, were really the extra dividends of having love, offering love, and expressing a love appropriate to each relation of life.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Plainly, I could not avail myself of God’s love until I was able to offer it back to him by loving others as he would have me. And I couldn’t possibly do that so long as I was victimized by false dependencies.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"For my dependency meant demand—a demand for the possession and control of the people and the conditions surrounding me.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"While those words “absolute dependency” may look like a gimmick, they were the ones that helped to trigger my release into my present degree of stability and quietness of mind, qualities which I am now trying to consolidate by offering love to others regardless of the return to me.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"This seems to be the primary healing circuit: an outgoing love of God’s creation and his people, by means of which we avail ourselves of his love for us. It is most clear that the real current can’t flow until our paralyzing dependencies are broken, and broken at depth. Only then can we possibly have a glimmer of what adult love really is.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Spiritual calculus, you say? Not a bit of it. Watch any AA of six months working with a new Twelfth Step case. If the case says “To the devil with you,” the twelfth-stepper only smiles and turns to another case. He doesn’t feel frustrated or rejected. If his next case responds, and in turn starts to give love and attention to other alcoholics yet gives none back to him, the sponsor is happy about it anyway. He still doesn’t feel rejected; instead he rejoices that his one-time prospect is sober and happy. And if his next following case turns out in later time to be his best friend (or romance), then the sponsor is most joyful. But he well knows that his happiness is a byproduct—the extra dividend of giving without any demand for a return.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"The really stabilizing thing for him was having and offering love to that strange drunk on his doorstep. That was Francis at work, powerful and practical, minus dependency and minus demand.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"In the first six months of my own sobriety, I worked hard with many alcoholics. Not a one responded. Yet this work kept me sober. It wasn’t a question of those alcoholics giving me anything. My stability came out of trying to give, not out of demanding that I receive.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Thus I think it can work out with emotional sobriety. If we examine every disturbance we have, great or small, we will find at the root of it some unhealthy dependency and its consequent unhealthy demand. Let us, with God’s help, continually surrender these hobbling demands. Then we can be set free to live and love; we may then be able to Twelfth Step ourselves and others into emotional sobriety.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Of course I haven’t offered you a really new idea—only a gimmick that has started to unhook several of my own “hexes” at depth. Nowadays my brain no longer races compulsively in either elation, grandiosity, or depression. I have been given a quiet place in bright sunshine.\\"}]}]}"	Reading	92	2025-04-17 03:36:10.838526	2025-04-17 03:36:10.838526
20	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"left\\",\\"level\\":2},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"After a friend has an unexpected relapse, one alcoholic wonders—am I next?\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"center\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"“Relapse doesn't have to be part of your story.” \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"That's what my sponsor told me\\"},{\\"type\\":\\"text\\",\\"text\\":\\" as I sobbed in my car. I had just attended my home group, where not one but three members of the group had relapsed over the last few days. The one that really bothered me was Jan (not her real name). She had recently gotten one year of sobriety and was someone I looked up to and empathized. I only had about eight months of sobriety and was feeling pretty great. And then she raised her hand and introduced herself when they asked if it this was anyone's first, second, or third meeting since their last drink. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\" After the meeting, I ran over and asked her what happened. She didn't even seem upset—I was more upset than she was.  I half expected her to tell me that she had been kidnapped and forced to consume alcohol by a group of criminals. But that wasn't the case. She explained that she had gone out to lunch at work, alone. When the waitress came by ask what she’d like to drink, she just accidentally ordered a glass of wine. The words just slipped out, she explained. And so there she sat at noon on a working Tuesday, downing three glasses of wine. She explained that she made it back to the office but said she could barely wait until the end of the day when she could get home and keep drinking. She didn't understand how it could've happened, but she was back now and everything was going to be okay. It was just a few days, after all.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I ran out of the building, personally offended—as if Jan's relapse was a sin against my sobriety, in fact, against sobriety in general. How could she? I called my sponsor sobbing. I could barely get out of my questions, chief among them—would this happen to me? When would I relapse? What would happen then? What should I do? \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"And that’s when she said, “Relapse doesn't have to be part of your story.”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"She reminded me that she had seven years of sobriety and had never relapsed, which was true. I had just assumed naïvely that I was ticking timebomb, awaiting my certain demise. In fact, I could envision my downfall—cheap motels, divorced, children taken away, job gone, nothing. Emptiness. Ruin.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"But the way my sponsor said it—so easily and so plainly—was reassuring. It simply doesn't have to happen. It doesn't have to be part of your story.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Over the time I've spent in the program, I have seen countless people relapse. Some with only a few days, some with a few months, some with 20 or more years. And I had relapsed 500 or more times, on my own, before making it through the door. I even drank solidly through my first two weeks of meetings. But for the people who relapsed with any amount of time all said the same thing. They had drifted away from the program and from meetings, had stop talking with their sponsor, had stopped sponsoring. They did no service work. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Their disease, cunning, baffling, insidious, powerful, had been waiting for them in the shadows and took advantage of what will always remain a weak spot in alcoholics—our thinking.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My disease is ready and waiting and excited to see me again and it's up to me to keep the door closed and bolted. There's only one way for me to do that. Work my program like my life depends on it, no matter how much time has passed since my last drink. Relapse doesn't have to be a part of my story. And it doesn't have to be part of yours either.\\"}]}]}"	Reading	93	2025-04-24 03:37:03.994609	2025-04-24 03:37:03.994609
21	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":2},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"With little drama, but lots of pain, he stopped “just in time”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"A very thin, very small 1% desire to stop drinking got me to AA. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My story does not have a trail of broken relationships, no trips to psych wards, no nasty drug tales, no recovery facilities. I never slept under a bridge. My story comes under the heading of “stopped just in time.” \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"You can yawn now if you like.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I never had any “relationships,” no boyfriends, so never had a relationship break up because of my drinking. Plus, I never lost any jobs because of my drinking. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"By the way, my family were all, and I mean all, teetotalers, to boot.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My 13 years of drinking alcoholically were spent  in New York City. I was a working stage manager and paid $68.72 a month for a 5th floor walkup on East 85th street. Going down five floors in the morning after an evening of drinking with a nasty hangover and then hitting the noisy, hot, and smelly Lexington Ave. subway was not the way to start the day. But waiting for the Second Avenue bus was even worse, sweltering in summer, freezing in winter.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I never went to work drunk and never drank before a show, but I sure called places for morning rehearsals at 10 a.m. or half an hour until stage time on matinee days with head and body-pounding hangovers. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"In the late summer of 1974, sitting on the deck of a hotel on Fire Island, I had this great idea that I would move to Los Angeles and find work in film or TV so people would see my name in the credits at the end. How’s that for an alcoholic ego? I gave notice to the Broadway show I was stage managing, bought a car and headed for California. Once, there I found an apartment in Santa Monica and became an instant drunk driver. Living in New York, I didn’t have to drive, and it never occurred to me that drinking and driving in blackouts was not the smartest thing to do. I got stopped for drunk driving on the Pacific Coast Highway one night and failed the walking the straight line test. Smelling of booze, I headed right for the Malibu drunk tank.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"After my court appearance I paid my fine, left the court house and signed up for the mandated DUI classes. At the end of these classes, the instructor mentioned if anyone thought they might have a problem with alcohol he was available to talk. After class I found myself walking up to the him and saying, “I think I might have a problem with drinking.” We made an appointment for the next week. During our appointment, he gently said that he was in AA and that I should think about going to a meeting. He mentioned that there were special interest’ meetings. Lawyers, doctors, actors, gay people, you name it. I picked gay and called the number he gave me, which was the Van Ness House that was about two years old at that time. Eventually I got the address and schedule for a gay meeting in Venice. My first meeting was in the original Beyond Baroque store front. I got called on that first night and I said I was an alcoholic, but what I did not say was that I did not believe it deep down inside. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I was also embarrassed that I did not have a horrible, dramatic and entertaining drinking story like you all had. The first time I related to anyone’s story was at a gay meeting on Virgil Street when the speaker talked about coming out of a blackout standing in front of his car which was covered with blood which was not his. My brain exploded because that could have been me. And even with that story I still did not believe that I was one of you. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Not even a year sober I get into my first relationship. Never heard that it was not the smartest thing to do for a newcomer. My partner and I were on a trip, and we had words about something, and I stormed out of the restaurant, found a liquor store, and bought a can of beer which I drank out of a paper bag in the parking lot, and I experienced Step One. I finally knew deep down inside I was an alcoholic and powerless over it. That was June 1976 and the beginning of my sobriety.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My story is certainly not the most entertaining or dramatic one you have ever heard, but it is very important to tell it for that newcomer who has also stopped in “just in time.” \\"}]}]}"	Reading	94	2025-04-29 04:09:53.77318	2025-04-29 04:09:53.77318
22	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":2},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"\\\\\\"Every day she kept logging in—often drunk. Then finally she spoke up and said those magic words\\\\\\"\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"}},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"I came to AA unsure that I wanted to stop drinking. \\"},{\\"type\\":\\"text\\",\\"text\\":\\"I had been given an ultimatum by my partner of 15 years: “Choose me or the bottle,” she said.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I didn’t want to lose my relationship, but I didn’t know how to stop drinking. I knew about AA by way of my experience with Al-Anon 25 years earlier. But I didn’t think I had a problem with alcohol—it was my father who was the alcoholic, not me. I was just a heavy drinker, not an alcoholic. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"And so I came to AA because of my partner. I later learned that it didn’t matter which door I went through to get to AA, the important thing was that I opened the door to the possibility of sobriety, even if it was only a crack.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"For me, the virtual door of AA online welcomed me with open arms. My recovery hasn’t been a smooth journey. I bounced along my bottom prior to establishing the continuous sobriety I enjoy today. Two days without alcohol here, 10 days there. I found it nearly impossible to stop drinking.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Anything could set me off on a bender: an argument, loneliness, boredom. Even excitement and joy caused me to drink. These were all excuses and deep down inside I knew this, but I was unable to be rigorously honest with myself. It’s easier to lie than to tell the truth, and each lie brought me back to the bottle.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Although I kept drinking, I learned early on to keep coming back to AA no matter what. And something kept bringing me back, every day. I still find it unbelievable that I attended my online meetings drunk. I didn’t participate but I did listen, and eventually people’s stories started to sink in and make sense. I started to connect with people’s experience, strength and hope. But I couldn’t put down those bottles of wine and beer. That is, I couldn’t until I found my home group in Lakewood, Ohio.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I live in Canada but where you live doesn’t really matter much for an online meeting. That’s the beauty of online meetings—you can visit anywhere in the world and feel at home. The Lakewood Freethinkers AA group meets every day at noon and 9:00 P.M. EST. Our group welcomes newcomers and invites anyone to stay for as long as they like without participating. I was amazed that people in the meeting were just glad I was there. I would attend all the meetings anonymously—with my video off and my microphone on mute.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"But I listened intently. And then came the day when I unmuted myself and shared for the first time. I shared that I was drinking before meetings, during meetings and even after meetings. I don’t know what came over me, but for the first time I admitted I was a drunk and tears streamed down my face. What relief I felt. The truth. Finally. I had spoken the truth and no one judged me. In fact, a few folks said, “Keep coming back, Tracy.”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"And that’s what I did. I drank and I came back, numerous times. Until one day a member from Lakewood asked me if I wanted to chair the Thursday noon meeting. I quickly said no. I could barely string together four days in a row, so how could I chair? Another member said, “We don’t have a minimum sobriety rule. As long as you’re sober the day you chair, you can chair.”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I was on medical leave from work for post-traumatic stress disorder and had a lot of free time. And I was bored. So, I thought, Why not? I used to facilitate seminar groups in university when I was a doctoral student many years ago so I thought I would try chairing the online AA meeting. I ended up loving it.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"And that’s how it all started for me—my journey to sobriety. I did drink the day before or the day after I chaired, and I would share in meetings that I was hungover, but I was firmly committed to never drinking on the day that I chaired. I began to chair twice a week, so I’d be sober at least those two days. And then I’d do the readings for a meeting and stay sober that day. And then I’d open the “doors” of the online meeting and stay sober that day. Soon I started to string together two, three, four days in a row and now I have almost eight months of continuous sobriety.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I know that service work has definitely been the key to keeping me sober, not to mention my home group, which I call my Higher Power. I have a sponsor, I do the Steps, I attend and chair a lot of virtual meetings. I feel gratitude and love for the Fellowship and for my home group, which gave me a chance early on to participate in meetings and to feel a part of something larger than myself. And I cherish the latitude extended to me by the group that enabled me to explore and ask questions about AA in a way that resonated and worked for me. That’s where I found, as our Big Book says, “a way out on which we can absolutely agree.” \\"}]}]}"	Reading	95	2025-05-01 03:20:17.331386	2025-05-01 03:20:17.331386
23	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":2},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"},{\\"type\\":\\"italic\\"}],\\"text\\":\\"Fueled by liquor and fear, he had so many roles he forgot who he was. Then one day, he got to play himself\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"One of the biggest blessings\\"},{\\"type\\":\\"text\\",\\"text\\":\\" of getting sober through the Steps of AA is the knowledge that I no longer have to be an actor in life. From the time I was born I had a role to play. I was the youngest of four and I had a brother who was, let’s just say, a wild child. He was so wild he could have been cast to play the role of Evel Knievel.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"My role was the responsible brother, someone like the character Tom Hanks played in “Saving Private Ryan”. I was always chasing after my brother and getting him out of scrapes. I thought I hated playing that role, but somewhere along the way the lines got blurred. I crossed the line from dreading my role to needing to be the hero of the play. I needed the adrenaline rush of coming to the rescue.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"However, like all plays, the lights would eventually be turned off and the curtain would come down. The audience would leave and the real person inside the character would come out and let his hair down. This is when I learned to “change hats.” I could be someone else. I could be anyone I wanted to be.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"When I look back, I see that I was wearing all sorts of hats. I had different clothes for every occasion. I had preppy clothes, hunting clothes, sports clothes. I had going-out clothes, father clothes, husband clothes, old friend clothes, new friend clothes, church clothes, humble clothes and $2,000 suits. The list goes on and on. I was a chameleon. I played these roles quite well and got rave reviews.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Meanwhile, I slowly melted away inside. The more I drank, the harder I worked at my roles, the worse I felt. It was soul-sickening. Even more confusing was when the roles would collide. As alcohol took greater control of my life, the roles became even more intoxicating and frightful.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"As is the case with many alcoholics, it wasn’t just the physical effects of alcohol that brought me into the rooms of AA. It was the utter confusion of not knowing who the hell I was any longer. Was I the person I was born to be? Or was I one of the many characters that alcohol had turned me into? I was living a complete lie. I had lost my soul.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I was exhausted by the time I got to AA. In fact, after my first AA meeting, I overheard a guy turn to someone else and whisper, “Who’s that homeless person?” He was talking about me. I had become the bewildered one. I was a drunk looking for help in the only place I could find it.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Upon getting sober, I heard that my Higher Power could speak to me through anyone. That very thing happened to me when I read this book by a non-alcoholic person, who wrote, “You can only wear one hat.” He said that “if you ever find yourself being someone that you are not, if you ever find yourself acting in a way that is not you, or if you ever find yourself waking up in the bed with someone that you don’t know (including your spouse), you are wearing too many hats.”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Wow, I thought, that could have been written just for me. I was literally wearing too many hats! Something about that made me start to pay attention to what my sponsor told me to do. One of his suggestions was that I should “compare me to me,” which meant comparing the characters I had been playing to the real me. That was the beginning of learning who I really am.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Today, I know who I am and what I like. More importantly, I know what I don’t like. The real me can say no today without fear or trepidation. The real me can also wear the same clothes to everything.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Although I still like nice things, I now find myself liking clothes without labels. This is odd because before I quit drinking, I wouldn’t be caught dead without the latest and greatest. I was a label junkie. As the “Twelve and Twelve” says, I was grandiose. I was grandiose all the way down to my car, my house, and yes, even my clothes and hats. I like things now because I like them, not because they get me in the club or define me.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Today I feel blessed to know that there are no acting awards for real life. I now have freedom to be myself anywhere and around anyone. I no longer have to worry about who I’m supposed to be. I’m also OK if the show doesn’t go my way. This frees up so much energy to be useful to myself and others.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Another blessing of practicing the Steps is how it opened up a spiritual side in me that I never knew existed. It was like finding the third number on a combination lock...it just magically opened over time. This has allowed me to become the person who others and my Higher Power saved my life to be.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"This is my encore. The only applause I am listening for is my Higher Power’s. If I get that, I’ll not need to take a bow, I can just watch from behind the curtains as the audience enjoys the show. I no longer need to be on the stage.\\"}]}]}"	Reading	96	2025-05-05 03:52:12.572039	2025-05-05 03:52:12.572039
24	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":2},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"After a car crash dealt her a traumatic brain injury, she kept close to the program, got involved in service and learned to ask for help\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"One day in November of 2007\\"},{\\"type\\":\\"text\\",\\"text\\":\\", with 22 years of sobriety, I was a passenger in a high-speed motor vehicle accident. A swerving vehicle hit our car, then pushed it into the next lane where another vehicle hit us and we rolled over three times, end over end. I was awake and conscious the whole time, metal crashing repeatedly into pavement at 65 mph. Every time we landed upside down, I expected to die but didn’t. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"In a matter of minutes, I lost my career, my spouse’s career, our home (which had required two incomes to pay the mortgage) and my credit rating (while hospitalized I failed to pay one month’s worth of bills and the late notices went into my credit rating, which fell through the floor.) Our new car was demolished. And I went through all that sober. I’m writing this now with 33 years and counting. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"The accident caused damage throughout my brain. I lost the ability to filter out background noise. Yet I just went to the California Northern Coastal Area Pre-Conference Assembly as my group’s GSR. There were 500  rowdy sober alcoholics in one big room there. I had to wear earplugs the entire time. It was an awesome experience, but totally exhausting.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"One limitation resulting from late effects of my traumatic brain injury (momentary losses of consciousness) is that I lost my driving privileges. A great\\"},{\\"type\\":\\"hardBreak\\"},{\\"type\\":\\"text\\",\\"text\\":\\"irony is that I never lost my license while drunk and high, though I certainly deserved to get arrested many times. I just never got caught. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Many times I have had to humbly call AA members and ask for rides to meetings. It’s so much easier to give help than to ask for it! I’ve had to practice a lot of acceptance. It helps to remind myself how many rides I’ve gladly given to others over the years, and how happy it always made me. I’m learning to accept that it’s OK to receive, because that provides others the chance to enjoy being the givers.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"It took some time to arrange, but I now have regular rides to three AA meetings a week: Monday Meditation, Sebastopol, California (my home group); Thursday Women’s Step Study; Friday LGBT Beginners (I call it beginners’ tongue in cheek since many in that room have decades of sobriety under their belts.) I get a ride to our district meeting once a month so I’m able to volunteer to be a GSR for my home group.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I’m so grateful to the members who bring me to meetings. I also belong to a closed online AA group. The group has 15,000 members worldwide, so I’ve been able to spend time online with other sober people anytime I want. None of this was available when I first got sober, so I’m glad I didn’t become disabled until late in the day.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I’m also grateful for Grapevine. I love to read it, especially the old issues kept by the groups I attend. In addition to my brain injury, I also suffer from clinical depression which has worsened. Living with these disabilities has taught me so much about humility, acceptance and gratitude.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"It’s important to me to reach out and support other members with dual or multiple diagnoses. I’m serving on the committee planning a workshop on mental health in sobriety where I have a very important job. I’m in charge of the food! And I’m planning on getting some real food—not just cookies!\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"One of the most meaningful things in my life is to sponsor others with dual\\"},{\\"type\\":\\"hardBreak\\"},{\\"type\\":\\"text\\",\\"text\\":\\"or multiple diagnoses. We work the Steps together: I get to rework all of the Steps right alongside my sponsees, sharing our experience, strength and hope. We also share our experience with weakness and despair. This is the only way we get to know and trust and inspire each other—so we can heal together. Our cofounder Bill W. also suffered severe depression at times in his sobriety. It didn’t make him drink, and with his example, I won’t drink either.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Today I belong to what some wiseacre I know calls the “No Matter What Club,” and invite my sponsees to join too. We don’t drink no matter what. Life is so worth living. \\"}]}]}"	Reading	97	2025-05-06 03:47:55.7489	2025-05-06 03:47:55.7489
25	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":2},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"A remote communities chair was surprisingly prepared when the COVID-19 crisis hit\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"Thirty years ago,\\"},{\\"type\\":\\"text\\",\\"text\\":\\" I was standing in front of our junior high gymnasium. I was the new girl in town and I didn’t have many friends. I had decided to run for Student Council and was about to make my speech to the entire school. When the principal introduced me, the mean girls began to boo and heckle. They made animal sounds and everyone laughed. I felt humiliated and held back the tears as the teachers quieted the crowd. That day, my inner light dimmed.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"All those feelings of inadequacy and all the fears from my teenage years carried through into my adult years and dimmed my light even more. I lived in darkness for the next 20 years. Alcohol was the only thing that made me feel good enough, smart enough and pretty enough. I sought success in business, I had loveless relationships, and I made many terrible decisions all because I was trying to fill a void I didn’t know existed.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"By the grace of God I was brought into the rooms of AA. Right away I was told by members to get a service position, and I later became the GSR for my home group. The first assembly I attended was held in a small rural town where a friend lived. I was excited to see her, so I went with her to her small morning AA meeting. The members spoke of how wonderful it was to hear a new story, as they usually heard the same ones week in and week out. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Later that afternoon at the assembly, the attendees broke off into sessions and I was assigned to the remote communities room. I listened intently as lightbulbs began going off in my head. They spoke of the need to connect members living in rural communities.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Being a single mom, I wasn’t able to attend AA meetings outside of my home many nights. As I listened in this remote communities session, I realized I could help. For about a year prior, I had been using an app to hold virtual online business meetings for work. Our district had even been discussing the idea of starting virtual AA meetings. At the next district meeting, they discussed the online meeting once again and I told of my experience at the quarterly conference. I offered to try to set something up, they accepted, and off I went.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I remembered seeing a post on social media by a man who had been working at an oil camp up north, and I messaged him letting him know we were starting an online meeting.  I also encouraged all my Step group sisters to help out and we launched a little virtual online AA meeting in October of 2019. We met every Monday at 8 p.m. We had four regular attendees: the man in the oil camp, a single mom with a baby, my supportive friend and me. One Monday, I sat there by myself staring at the screen for 10 minutes. I was beginning to get discouraged when a woman suddenly appeared and said, “Oh, thank God, I need a meeting!”\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"With tenacity, I began to announce the virtual online meeting at every in-person AA meeting I attended. People would roll their eyes, with a look that felt like, “Oh, here she is, announcing that online meeting again.” But this time the judgement didn’t stop me. It didn’t dim my light. I had the program working in my life and I had God by my side. I had no fear of judgment or not being good enough, so I just kept going. I knew this online meeting had the potential to help people. I had seen it firsthand. The little meeting that started with four grew, and by the beginning of March 2020 we had 11 members.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Then the world changed. COVID-19 hit and my phone began to ring. People started asking about that online meeting I had been announcing all those weeks before. The world had suddenly come to a halt, everyone had been advised to stay at home, and then in-person AA meetings everywhere began to close.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Fear set in, but our little virtual meeting was prepared. We had the tools already in our AA toolkit, so we put them to use. Within a day, that little Monday night meeting was a twice a day, seven days a week fellowship, carrying a message of hope in a dark time. People from everywhere joined.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"As I write this, it’s now day 43 of isolation. In those 43 days we have had over 40,000 members from around the world visit our online meeting. We have had newcomers, some who had never been to AA before joined in. We have also had sober celebrations and we’ve shared many tears. A fellowship has grown up among us and we have made many new friends in our virtual meeting. I thank God and AA for this opportunity to be of service. What a gift this has been.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I have also witnessed a sort of rebirth in the Fellowship during this crisis, a spiritual awakening of sorts—old school AA. I’ve seen people getting excited about the Big Book again. It feels as though new life has been given to AA.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Oh, and that friend in the small rural town? She used to be one of the mean girls who heckled and booed me in junior high. God truly works in mysterious ways, as she was one of the lights that shone bright through my first year of sobriety. Life has truly come full circle It’s a miraculous thing.\\"}]}]}"	Reading	98	2025-05-08 03:47:01.303903	2025-05-08 03:47:01.303903
26	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"A magical potion is available to us today.\\"},{\\"type\\":\\"text\\",\\"text\\":\\" That potion is called acceptance.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"We are asked to accept many things: ourselves, as we are; our feelings, needs, desires, choices, and current status of being. Other people, as they are. The status of our relationships with them. Problems. Blessings. Financial status. Where we live. Our work, our tasks, our level of performance at these tasks.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Resistance will not move us forward, nor will it eliminate the undesirable. But even our resistance may need to be accepted. Even resistance yields to and is changed by acceptance. Acceptance is the magic that makes change possible. It is not forever; it is for the present moment.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Acceptance is the magic that makes our present circumstances good. It brings peace and contentment and opens the door to growth, change, and moving forward.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"It shines the light of positive energy on all that we have and are. Within the framework of acceptance, we figure out what we need to do to take care of ourselves.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Acceptance empowers the positive and tells God we have surrendered to the Plan. We have mastered today’s lesson, and are ready to move on.\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":3},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"Today, I will accept. I will relinquish my need to be in resistance to myself and my environment. I will surrender. I will cultivate contentment and gratitude. I will move forward in joy by accepting where I am today\\"}]}]}"	Reading	99	2025-05-13 03:23:55.822838	2025-05-13 03:23:55.822838
27	richer_content	"{\\"type\\":\\"doc\\",\\"content\\":[{\\"type\\":\\"heading\\",\\"attrs\\":{\\"textAlign\\":\\"center\\",\\"level\\":1},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"italic\\"}],\\"text\\":\\"A newcomer finds out the hard way about the power of liquor and the heartbreak of relapse\\"}]},{\\"type\\":\\"horizontalRule\\"},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"marks\\":[{\\"type\\":\\"bold\\"}],\\"text\\":\\"One time I sat in a meeting\\"},{\\"type\\":\\"text\\",\\"text\\":\\" called the Happy Hour Group and shared, “I want to be happy,” which made everybody laugh. Well, I certainly wasn’t coming back to a group where they laughed at me! So I went back to my safe little group around the corner from my house.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I pretty much lived at that group, as I no longer trusted myself in my home, which had literally become my bar at the end of my drinking. I did not come into AA via treatment or suggestions from law enforcement. I knew at some level my soul was dying. I shook so badly I sat on my hands to stop them from shaking, which I now know can be dangerous.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I did not get a sponsor. I felt that I did not need another “parent.” I read the Steps and was finished with them. When someone gave me their phone number, I informed them I wasn’t gay. I judged negatively anyone who spoke at meetings, and I did not make conscious contact with God, as he was surely busy helping others. Truth be told, I was mad as hell at all the gods! But I kept going to meetings because I knew no one would offer me a drink there.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Then one day someone made a comment I didn’t like at a meeting. I was so mad that I “drank at” them. Does “I’ll drink poison to make you die” sound familiar to anyone else? But I figured that since I only drank three beers, that meant I wasn’t an alcoholic. I had three weeks sober, after all. I must be cured. Birds were flying out of the sky and landing on me, literally. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"Yet the next morning, I found myself drinking Kentucky bourbon out of the bottle. I was in and out of consciousness most of the day. I do remember getting asked to leave a VFW hall due to my behavior. One thing I know is that drinking alcohol is like pouring Miracle Gro on your character defects.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I never want to forget how horrible I felt the next morning. My hair hurt and my eyes were swollen from crying. What I was crying about, I still have no idea. I felt like my tongue needed to be shaved and 1,000 pins were shooting out of every pore of my body. That’s when I went back to AA and got my second and, I sincerely hope, last white chip. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"I started taking all the AA suggestions a lot more seriously—especially, “Take the cotton out of your ears and put it in your mouth.” There were others, like, “If you don’t pick up the first drink you won’t get drunk,” and, “If you sit in an airport for three months, you will not turn into a plane,” and, “Give us three months of sincere effort, and if you choose to drink, we will refund your misery.” Finally, “There’s a wrench for every nut!” These comments are not in the Big Book, but they are the experience, strength and hope of members who came before me. I was also instructed to work the Traditions as hard as the Steps. \\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"It has been many more 24 hours since I adopted this new way of life. I still remember the most burning question of all when I first got sober: “What’s in it for me?” And I have definitely found the answer: A way to live life with coping skills other than my doctorate in being a smart you-know-what. I no longer isolate in a pity party of my own making, and I have found a kind of family in AA that I can count on. Most important of all, I know I’m never alone.\\"}]},{\\"type\\":\\"paragraph\\",\\"attrs\\":{\\"textAlign\\":\\"left\\"},\\"content\\":[{\\"type\\":\\"text\\",\\"text\\":\\"The riches I have found in my own heart are truly better than anything I’ve ever found in my pocket. I wish you all a slow recovery and all the blessings I have found. And I pray every day for continued enthusiasm for the program that saved my soul. \\"}]}]}"	Reading	100	2025-05-15 03:42:15.74409	2025-05-15 03:42:15.74409
